		text += "ፚጵጢፃፄፁ朧朝漳ጼጟጠጴፂፃፁጽፁጵጵጢፃፄፁ朧朝漳ፓጟጠጵፁፃፁጽፁጴጹጲፃፄፁ朧朝漳ፓጟጠጴፀፃ朧朝漳ጾፔፚ\u135fጴፃ\u135d\u135f朧朝漳ፓጟጠጴፀፃጽጽፁጴፚጟፃፄፁፁፓጟጠጴፀፇፓጽፁፄፄጟፃፄፁጲፀጟጠጴፀፇፓጽፁጴጴ፦ፃ\u135d\u135fጺፁጴጤጥፀፇፓጽፁጴጴ፩ፃፄፁጹ";
		text += "ጽጴጠጴፄፇፓጽፁጴጵጢፃፄፅጵጽጴጠጴፀፚፁጽፁጴጵጢፃፄፁ朧朝漳ጼጴጤጥፂፚፁጾፔፚጵጢፃፄፁ朧朝漳ጼጟጠጴፂፃፁጽፁጵጵጢፃፄፁ朧朝漳ፓጟጠጵፁፃፁጽፁጴጹጵፃፄፁ朧朝漳ፓጟጠጴፀፃ朧朝漳ጽፐ\u135cፓጢፃ\u135bፁ朧朝漳ፓጟጠጴፀፇፓፁፅጵ\u135fጷፃፄፁፉፓጟጠጴፀ";
		text += "ፇፓጽፁፄፄ፩ፃፇ\u135f朧朝漳ጼጟጠጴፀፇፓጽፁጴጹጲፃጟፁ朧朝漳ፓጠጹፄፀፇፓጽፁጴጵጢፃፚፁፙፔፚጠጴፉጢፓጽፁጴጵጢፃፄፅጵጽጴጠጴፁፇፓጽፁጴጵጢፃፄፁ朧朝漳ጼጴጠፄፄፃፁጽፁጴፅጣፃፄፁ朧朝漳ፓጟጠጴፀፃ朧朝漳ጽፅጵፚጟፃፄፁጵፔፄጠጴፀፇፓጽፁጴጴ፦";
		text += "ፃ\u135d\u135fጺፁፄጠጥፀፇፓጽፁጴጴ፩ፃፄፁ\u135dፓጟጠፄፃፇፓጽፁጴጵጢፃፄፁፁፔጴጤጴፉጢፓጽፅጵጵጢፃፄፁ朧朝漳ፓጟጠጴፄፃጽጽፔፚጴጠፃፄፁ朧朝漳ፓጟጠጴፀፚጹጿፁጴጵጣፃ\u135bፁ朧朝漳ፓጟጠጴፀፇፓጾፁጴ\u135bጢፃፄፁጵፔጴጤጴፀፇፓጽፁጴጴጟፄፚፁጲፁጴጠጴፀፇፓ";
		text += "ጽፁጴጵጣፃጟፁ朧朝漳ፔጴጤ፠ፀፇፓጽፁጴጵጢፃፚፁፙፔፄጠ፡ፆፇፓጽፅጴጵጢፃ\u135d\u135f朧朝漳ጽጴጠጴፁፃጽጽፁጴጵጢፃፄፁ朧朝漳ጼጴጠፄፄፃፁጽፁጴፄጟፃፄፁ朧朝漳ፓጟጠጴፀፃ朧朝漳ጽፐጟፅጢፃፄፁ朧朝漳ፓጟጠፅፂፇ\u135fጽፁጴጵጥፃፄፁ朧朝漳ፔ\u135bጵ፠ፀፇፓጽፁጴ";
		text += "ጵጢፃፄፁ朧朝漳ፔጴጠጴፀፇፓጽፁጴፅጣፃፙ朧朝漳ፅፔጴጠጴፀፇፓጽፁጴጵጢፃፚፁፐፁጟጠጵፁፇፓጽፁጴጵጢፃፄፅጵጼ\u135bጹ፠ፀፚጽጽፁጴጵጢፃፄፁጲፀፚጤጥፂፇ\u135fጽፅጴጵጣፃፄፁ朧朝漳ጼጟጠጴፉጴፉጽፁጵ\u135bጢፃፄፁ朧朝漳ፓጟጠጴፄፇ\u135bጿፁጴጹጴፃፄፁ朧朝漳ፓ";
		text += "ጟጠጴፀፚጹጽፅጶጼ፨ፄ\u135c\u135fጲፁፄጠጴፀፇፓጽፁጴጹጲፃፄፁጹጼ\u135bጹ፠ፀፚፉጽፁጴጵጢፃፄፁጲፀ\u135bጹጵፅፇፓፂፅጴፚ፧ፃፆ\u135f\u135dፓጠጹ፠ፀፇፓጽፁጴጵጢፄፅፁጲፀፚጠ፠ፉጢፗጽፁጴጵጢፃፄፁ朧朝漳ፓጠጵፅፄፚፉጽፁጴጵጤፄፅፁ朧朝漳ፓጟጠጴፁፇፗጽፁጴጵጢፃፄ";
		text += "ፁ朧朝漳ፓጟጠጴፀፇፓጽፁጴጵጢፃፄፁጺፁጴጠ፡ፃፇፓጽፁጴጹጶፃፄፅፁፓጟጠጴፀፇፓጽፁጴፅጣፄፆ\u135fጽፓጟጠጴፃፇፓጽፁጵጴ፦ፃፄፁ朧朝漳ፓጟጠጴፀፇፓጽፁጴ\u135bጢፃፄፁ朧朝漳ፓጟጠፄፁፃጽፂፅጴፅጢፃፄፁ朧朝漳ፓጟጠጴፀፃ朧朝漳ጾፐጠ\u135bጢፄፅፁ朧朝漳ፓጟጠ";
		text += "ጴፀፇፓፁፅጵ\u135fጷፃፄፅጹፓጟጠጴፀፇፓጽፁፄፄ፩ፃፆ\u135fጽፔጴጠጴፁፇፓጽፁጶጽጢፃፙ朧朝漳ፅፓጟጤ፠ፀፇፓጽፁጴጵጢፃፚፁጹጽጴጠጵፃፇፓጽፁጴጵጢፃፄፅጵጼ\u135bጹ፠ፁፇፗጽፁጴጵጢፃፄፁጲፀፚጠጴፂፇፓጽፔፚፚጟፃፅፁጹፓጟጠጴፀፇፓጽፁፄፄ፨ፄ\u135c\u135fጵፔፚ";
		text += "ጠጴፀፇፓጽፁጴጹጲፃፄፅጶፁፅጹፄፁፇፓጽፐ\u135bፅጤፃጟፁጲፁጟጠጴፀፇፓጽፁጴጹጲፃፄፅጹፓጟጠጥፀፚጹጽፐ\u135cፓጣፃፄፁ朧朝漳ፓጟጠጴፀፇፓፁፅፅጹጶፃፄፁ朧朝漳ፓጟጤ፠ፂፚጹጽፁጴፅጣፃፄፁ朧朝漳ፓጟጠጴፀፇፓጽፁጴጵጢፃፄፁ朧朝漳ፓጟጠጴፃፇ\u135bጽፔፚ\u135b";
		text += "ጢፃፄፁጵፓጟጠጵፄፇፓጽፁጴጵጢፃፄፁጵፔጵጵ፠ፃፇፓጽፁጵጵጢፃፄፁፁጼፚጠጴፀፇፓጽፁጴጵጢፃፄፁጽፓጟጠጴፀፇፓጽፅጴፄ፩ፄ\u135bፁጵፓጟጠጴፀፇፓጽፁጴጴ፦ፃ\u135c፣ፉፓጠጵፄፀፇፓጽፁጴጵጢፄፅፁፐፁጟጠጵፂፇፓጽፁጴጵጢፃፄፅጵጼጟጠ፠ፃፇፗጽፁጴፅጢ";
		text += "ፃፄፁፙፓጟጣ፦ፅፇፓጾፐፚጵጢፃፄፁ朧朝漳ፓጟጤጴፂፃፁጽፁፄጠጢፃፄፁ朧朝漳ፓጟጠጵፁፃጹፂፐፚፄ፦ፃፄፁ朧朝漳ፓጟጠጴፀፚጹጽፁጴ\u135bጢፃፇ\u135fጹጽጴጠፄፂፇፓጽፁጴጵጢፃፄፅጵፓጟጤጴፆፚፓጽፅጵፅጢፃፄፁ朧朝漳ፓጟጠጵፁፇፗጾፔፚጹጲፄፚፅፅፔጴጠጴፂ";
		text += "ፃጵጽፐ\u135cፓጢፄ\u135c\u135f朧朝漳ፓጟጠጴፀፇፓፁፅጴጹጳፃፅፁፉፓጠጵፄፂፃፁጽፅጴጵጢፃፄፁ朧朝漳ፓጟጠጵፁፚፅፂፅጴጵጢፃፄፁፉፔፅጵፄፀፇፓጽፁጴጵጢፃፅፁጵፓጟጠጴፀፇፓጽፁጴጵጢፃፄፁ朧朝漳ፓጟጠጴፀፇፓጽፔ\u135bጵጥፃፚፁ朧朝漳ፓጟጠፄፀፇፓፂፁጴጵጢፃፄ";
		text += "ፁ朧朝漳ፓጟጠፄፁፚጽጽፔፚጵጢፃፚፁ朧朝漳ፓጠጵፅፄፇፓጽፔፚጵጢፃፄፁ朧朝漳ፓጟጤጴፀፇፓጽፁጴጵጣፃፅፁፙፔፄጤጴፅፇፓጽፅጴጵጢፃ\u135d\u135f朧朝漳ጼጠጹፄፀፃፅጽፁጴጵጢፃፄፁ朧朝漳ጼጴጠ፠ፉጢፓፁፔፚጵጢፃፄፁ朧朝漳ፓጠጵፄፀፚጽጾፔፚፚ፦ፄፆ\u135f朧朝漳ፔ";
		text += "ጴጠጴፀፃጽጽፁጶጽጤፃፆ፣ፉፓጟጠፄፀፇፓጾፔፚጵጤፃጟፁ朧朝漳ጽፄጠጴፀፇፓጽፁጴጴ፨ፃ\u135d\u135fጹፔፅጹ፠ፀፇፗጽፁጴጴ፩ፃፄፁጵጼፚጠ፠ፉጢፗጾፐፚጵጢፃፄፁ朧朝漳ፓጠጵፄፂፚፁጽፔፚጵጢፃ\u135d\u135fፚፁጟጠጴፁፇፓጽፁጴጵጢፃፄፁፁፔፄጨጴፀፚፅጽፁጴጵጢፃፄ";
		text += "ፁ朧朝漳ጼፚጤጥፂፃጵጽፅጴጵጣፃፄፁ朧朝漳ጼጟጠጴፂፃፁጽፅጴጠጢፃፄፁ朧朝漳ፓጟጠጴፆፇ\u135bጿፁጴፄ፩ፃፄፁ朧朝漳ፓጟጠጴፀፚጹጽፅጴጠጢፄፚፁጵፔፄጠጵፄፇ\u135bጿፁጴጹጴፃፄፁ朧朝漳ፓጟጠጴፀፃጹጾጼጵፅጢፃጠፁ朧朝漳ፓጟጠጴፀፇፓጾፁጴፚጟፃፅፁፙፓጟጠ";
		text += "ጴፀፇፓጽፁፄፅጢፄፆ፣ፂፁፚጤ፡ፂፇፓጾፔ\u135cጽጤፃፚፅጹፓጟጠፄፀፇፓጾፔፚጴ፩ፃፆ\u135fጺፁጟጠጴፁፇፓጽፁጶጽጢፃፆ\u135f\u135dፓጟጨፄፀፇፓጽፁጴጵጢፃ\u135c\u135fጹጽጴጠፄፉጢፓጽፁጴጵጢፃፄፅጵፔጴጠጥፀፚፅጽፅጴ\u135bጢፄፚፁጹጽጴጠጵፄፇፓጽፁጴጵጢፃፄፁፉጼጟጠ፠";
		text += "ፅፇፗጽፁጴፅጢፃፄፁፙፓጟጠ፠ፉጢፗጽፔፚጵጢፃፄፁ朧朝漳ፓጟጤ፠ፂፃፁጽፅጶጽጢፃፄፁ朧朝漳ፓጟጠጵፁፇፗጽፔፚጹጶፃፅፁጹፓጠጹፄፂፃፁጽፁፄጠጢፃፄፁ朧朝漳ፓጟጠጴፆፃጽፂፅጴጴጠፃፄፁ朧朝漳ፓጟጠጴፀፃ朧朝漳ጽፐ\u135cፓጣፃ\u135d\u135f朧朝漳ፓጟጠጴፀፇፓፁፅ";
		text += "ጴጹጳፄፚፅፅፔፄጨጴፂፃጵጽፐ\u135cፓጢፄ\u135c\u135f朧朝漳ፓጟጠጴፀፇፓፁፅጴጹጵፃፄፁፙፔፄጨጴፁፇ\u135fጽፁጴጵጢፃፄፁ朧朝漳ጼፚጠፄፃፇፓፂፅጴፅጤፃፄፅፅፔፄጨጴፀፚፁጽፁጴጵጢፃፄፁ朧朝漳ጼፚጣ፦ፅፇፓጿፅጴጵጢፃፄፁ朧朝漳ፓጟጤጴፂፃፁጽፅጶጽጢፃፄፁ朧朝漳";
		text += "ፓጟጠጵፁፇፓፁፐፚፚጟፃፅፁ朧朝漳ፓጟጠጴፀፇፓጽፁፄፉጵፄ\u135bፁ朧朝漳ፓጟጠጴፈጢ\u135bጿፁጴፄጠፃፄፁ朧朝漳ፓጟጠጴፀፚጹጾጼጵፅጢፃጠፁ朧朝漳ፓጟጠጴፀፇፓጾፁጴፚጟፃፅፁፙፓጟጠጴፀፇፓጽፁፄፅጢፄፆ፣ፂፁፚጠ፠ፀፇ\u135bጾፅጴፚጟፃፄፅፉፓጟጠጴፀፇፓጽፁ";
		text += "ፄፅጣፃፇ\u135f朧朝漳ጼጴጠጴፈ፩ጽጽፐ\u135bፄ፧ፃፄፁጵፓጟጠጴፈጢፓጾጼጵፅጢፃጠፁ朧朝漳ፓጟጠጴፀፇፓጾፁጴፚጟፃፅፁፙፓጟጠጴፀፇፓጽፁፄፅጢፄፆ\u135fጹጽጴጠፄፀፇፓጽፁጴጵጢፃፄፅጶፁፅጹፄፀፇፓጽፁጶጽጤፃጟፁጶፀፚጠጴፀፇፓጽፁጴጹጲፃፙ朧朝漳ፅፓጟጨፄ";
		text += "ፀፇፓጽፁጴጵጢፃፚፁጹጽጴጠፄፈጢፓጽፁጴጵጢፃፄፅጵፓጠጵ፡ፄፚፉጽፐፚጵጤፃ\u135bፁጹጽጴጠጵፆፇፓጽፁጴጵጢፃፄፅጵፔጴጠጥፀፃጵጽፁጶጼ፩ፃፆ\u135fፅጼፄጠጴፁፇፓጽፁጶጽጢፃፙ朧朝漳ፅፓጟጨፄፀፇፓጽፁጴጵጢፃፚፁጹጽጴጠፄፈጢፓጽፁጴጵጢፃፄፅጵፓጠጵ";
		text += "፠ፂፃፁጽፅጴጵጢፃፄፁ朧朝漳ፓጟጠጵፁፚፅፂፅጴጵጢፃፄፁፙጼጠጹፄፀፚፉጽፁጴጵጢፃፄፁ朧朝漳ጼጴጤ፡ፆፇፗፁፐፚጵጢፃፄፁ朧朝漳ፓጠጵፄፁፇ\u135fጽፁፅ\u135bጣፃፆ\u135fጲፁጟጠ፠ፉጢፗፁፔፚጵጢፃፄፁ朧朝漳ፓጠጵፄፁፇ\u135fጽፅጴጵጣፃፆ\u135fጵፓጟጤጥፂፃጵፁፐፚጵጣ";
		text += "ፃፄፁ朧朝漳ጼጟጠጴፂፃፁጽፅፅጵጢፃፄፁ朧朝漳ፓጟጠጵፁፃጽፂፅጴጴጠፃፄፁ朧朝漳ፓጟጠጴፀፃ朧朝漳ጽፐ\u135cፓጣፃ\u135d\u135f朧朝漳ፓጟጠጴፀፇፓፁፅጴጹጳፄፚፅፅፔፄጠጴፂፃጵጽፐ\u135cፓጢፄ\u135c\u135f朧朝漳ፓጟጠጴፀፇፓፁፅጴፅጥፃፄፁፉፓጟጤጥፈጢ\u135bጾፐጠጵጢፃፅፁ朧朝";
		text += "漳ፓጟጤጥፀፃጽፂፅጴጴጠፃፄፁ朧朝漳ፓጟጠጴፀፃ朧朝漳ጽፐ\u135cፓጣፃ\u135d\u135f朧朝漳ፓጟጠጴፀፇፓፁፅጴጹጳፃፆ\u135f\u135dፔጴጠጴፀፇፓጽፁጴጵጢፄፅፅፂፁፚጠጴፀፇፓጾፔ\u135cጽጤፃፆ፣ፉፓጟጠፄፀፇፓጾፔፚጴ፩ፄ\u135bፁ朧朝漳ጽፄጠጴፀፇፓጽፁጴጴ፦ፃፆ\u135f\u135dፔጴጤጥፀፇፓጽ";
		text += "ፁጴጵጢፄፅፁጲፀጟጠጴፈ፩ጽፂፅጴፅጢፃፄፁ朧朝漳ፓጟጠጴፀፃ朧朝漳ጾፐጠ\u135bጣፄ\u135bፁ朧朝漳ፓጟጠጴፀፇፓፁፅጵ\u135fጷፃፅፅፉፓጟጠጴፀፇፓጽፁፄፄ፩ፃፆ\u135fፚፁጟጠጴፁፇፓጽፁጶጽጢፃ\u135d\u135fጹፔፅጹ፠ፀፇፗጽፁጴጴ፩ፃፄፁፐፁጟጠ፠ፀፇፓጽፁጴጵጢፃፄፅጵጼጟጠ";
		text += "፠ፐጢ\u135fጽፁጴፅጢፃፄፁፙፓጟጤጥፂፚጹጽፔፚጵጣፃፄፁ朧朝漳ጼጟጠጴፆፚፓጽፐፚጵጢፃፄፁ朧朝漳ፓጟጠጵፁፃጽጽፐጟፉጳፃፄፁጵፓጟጠጴፈጢፓጾፔፚ\u135bጤፄ\u135c\u135f朧朝漳ፔጴጠጴፀፃጽጽፁጵ\u135fጷፃፆ\u135f朧朝漳ፓጟጠጴፀፇፓጽፁፄፄ፩ፃፆ፣ጶፁጟጠጴፁፇፓጽፁጶጽጢ";
		text += "ፃ\u135d\u135fጹፔፅጹ፠ፀፇፗጽፁጴጴ፩ፃፄፁፐፁጟጠ፠ፀፇፓጽፁጴጵጢፃፄፅጵጼጟጠ፡ፂፇ\u135fጽፁጴፅጢፃፄፁፙፓጟጤጥፂፚጽጿፅጴጵጣፃፄፁ朧朝漳ጼጟጠጴፆፚፓጽፐፚጵጢፃፄፁ朧朝漳ፓጟጠጵፁፃጽጽፐጟ\u135fጵፃፄፁጵፓጟጠጴፈጢፓጾፔፚ\u135fጲፃፇ\u135f朧朝漳ፔጴጠጴፀፃጽ";
		text += "ጽፁጵ\u135fጷፃፆ\u135f朧朝漳ፓጟጠጴፀፇፓጽፁፄፅጤፃጟፁጲፁጴጠጴፀፇፓጽፁጴጹጲፃፄፅጺፁፅጹፄፁፚጽጽፐ\u135bፅጤፃጟፁጲፁጟጠጴፀፇፓጽፁጴጹጲፃፅፁጽፓጟጤጥፀፃጽጾፔፚፚ፧ፃ\u135bፁ朧朝漳ፔጴጠጴፀፃጽጽፁጴፚጟፃፄፅጽፓጟጠጴፀፇፓጽፁፄፅጢፄፆ\u135fጹጽጴጠፄ";
		text += "ፀፇፓጽፁጴጵጢፃፄፅጶፁፅጹፄፀፇፓጽፁጶጼ፩ፃፆ፣ጽጼጟጠጴፁፇፓጽፁጶጽጢፃፆ\u135f\u135dፓጠጵጥፀፇፓጽፁጴጵጢፄፅፁጲፀጟጠ፠ፉጢ\u135bጽፅጴጵጢፃፄፁ朧朝漳ፓጠጵፄፆፚፓጽፐፚ\u135bጢፃፄፁ朧朝漳ፓጟጠጵፁፃጽጽፐጟፚጠፃፄፁጵፓጟጠጴፈጢፓጽፅጵፅጣፃ\u135c\u135fጹጽ";
		text += "ጴጠ፠ፃፇፓጽፁጴጵጢፃፄፅጵፔጴጠጥፀፃፁጽፅጴፅጢፃጟፁ\u135eፁ\u135bጵ፠ፈጢፗጾፔፚጠጥፃፄፅጽፓጟጤጥፈጢ\u135bፁጼጵጵጢፃፅፁ朧朝漳ፓጟጤጥፀፇ\u135bጿፁጴጹጴፃፄፁ朧朝漳ፓጟጠጴፀፚጹጽፁፄ\u135bጢፃ\u135d\u135fጵፔጴጠጴፉጢፗጽፅጴጴጟፃጟፅፆፀጟጤጥፁፃጽፂፁፄፄጠፄፅ";
		text += "ፁጹጽጴጠጵፃፇፓጽፁጴጵጢፃፄፅጵፓጠጵ፡ፄፚፉጽፅፄ\u135bጤፃ\u135bፁጹጽጴጠጵፆፇፓጽፁጴጵጢፃፄፅጵፔጴጠጥፀፃፅጽፁጶጼ፩ፃፆ፣ጾፁፄጠጴፁፇፓጽፁጶጽጢፃፆ\u135f\u135dፓጠጵጥፀፇፓጽፁጴጵጢፄፅፁጲፀጟጠ፠ፉጢፗጽፁጴጵጢፃፄፁ朧朝漳ፓጠጵፅፄፚፉጽፁጴጵጣፄ";
		text += "\u135c\u135fጹጼፚጠ፠ፉጢ\u135bጾፁጴጵጢፃፄፁ朧朝漳ፓጠጵፄፈጢ\u135bፂፁጴፅጢፃፅፁ朧朝漳ፓጟጤጥፀፃጹፂፐፚፚ፧ፃፄፁ朧朝漳ፓጟጠጴፀፚጹጽፐጟጠጣፃፇ\u135f朧朝漳ጼጟጤጥፂፚፅጿፅጴጵጣፃፄፁ朧朝漳ጼጟጠጴፉጴፉጽፁጶ፣ጢፃፄፁ朧朝漳ፓጟጠጴፄፇ\u135bጿፁጴፄ፩ፃፄፁ朧朝漳";
		text += "ፓጟጠጴፀፚጹጽፁፄ\u135fጵፄ\u135bፁጺፁፚጠጴፈ፩ጽጽፐጠፅጥፃፄፁጵፓጟጠጴፈጢፓጾጼጵፅጢፃጠፁ朧朝漳ፓጟጠጴፀፇፓጾፁጴፚጟፃፅፁፙፓጟጠጴፀፇፓጽፁፄፅጢፄፆ፣ፂፁፚጠፅፂፇ\u135bጾፅጴፚጟፃፄፅፉፓጟጠጴፀፇፓጽፁፄፅጣፃፇ\u135fጲፀፚጠጴፈ፩ጽፂፅጴጴጠፃፄፁ";
		text += "朧朝漳ፓጟጠጴፀፃ朧朝漳ጽፐ\u135cፓጢፄፇ\u135f朧朝漳ፓጟጠጴፀፇፓፁፅጴጹጳፃፆ\u135f\u135dፔጴጠጴፀፇፓጽፁጴጵጢፄፅፅፂፁፚጠጴፀፇ\u135bጿፁጴፅጣፃፄፁ朧朝漳ፓጟጠጴፀፃጹጽፐጟጠጣፃፇ\u135f朧朝漳ጼጟጤጥፂፚፉፂፁጴጵጣፃፄፁ朧朝漳ጼጟጠጴፉጴፉጽፁጶ፣ጢፃፄፁ朧朝漳ፓጟ";
		text += "ጠጴፄፇ\u135bጿፁጴፄ፩ፃፄፁ朧朝漳ፓጟጠጴፀፚጹጽፁፄ\u135bጤፄፆ\u135fጵፔጴጠጴፈ፩ጽጽፐጠፚ፧ፃፄፁጵፓጟጠጴፈጢፓጾጼጵፅጢፃጠፁ朧朝漳ፓጟጠጴፀፇፓጾፁጴፚጟፃፅፁፙፓጟጠጴፀፇፓጽፁፄፅጢፄፆ\u135f朧朝漳ጼጟጣ፦ፅፇፓጽፐፚጵጢፃፄፁ朧朝漳ፓጟጤጴፉጴፉጽፁጶ፣";
		text += "ጢፃፄፁ朧朝漳ፓጟጠጴፄፇ\u135bጿፁጴፄ፩ፃፄፁ朧朝漳ፓጟጠጴፀፚጹጽፁፄ\u135bጢፃ\u135d\u135fፙፔፅጹ፡ፂፇፓጽፅጴጵጢፃ\u135d\u135f朧朝漳ጼጠጹፄፀፃፅጽፁጴጵጢፃፄፁ朧朝漳ጼጴጠ፠ፉጢፗጾፔፚጵጢፃፄፁ朧朝漳ፓጠጵፄፀፚጽጽፁጶጽጤፃጟፁጵፔፄጠጴፀፇፓጽፁጴጴ፨ፃፙ朧朝漳ፅ";
		text += "ፓጟጨፄፀፇፓጽፁጴጵጢፃፚፁጹጽጴጠፄፈጢፓጽፁጴጵጢፃፄፅጵፓጠጵ፠ፈጢ\u135bጽፐጠ\u135bጢፃፅፁ朧朝漳ፓጟጤጥፀፇፓፁፔ\u135cፁጶፃፅፁ朧朝漳ፓጟጠጴፀፇፓጽፁጵጴ፨ፄ\u135c\u135fጲፀፚጠጴፀፇፓጽፁጴጹጲፃ\u135c፣ፉፓጠጵ፠ፀፇፓጽፁጴጵጢፄፅፁፙፔፄጠጥፁፇፓጽፅጴጵጢፃ";
		text += "\u135d\u135f朧朝漳ጼጠጹፄፀፃጹጽፁጴጵጢፃፄፁ朧朝漳ጼጴጠ፠ፉጢፓፁፔፚጵጢፃፄፁ朧朝漳ፓጠጵፄፁፃጹጾፐጠ\u135bጤፃ\u135c\u135f朧朝漳ፓጟጠጴፀፇፓፁፅጵ\u135fጷፃፆ\u135fፙፓጟጠጴፀፇፓጽፁፄፅጣፃፇ\u135fጵፔፄጠፄፆፇፗጽፔፚፅጣፃፆ፣ጹፔፄጤ፠ፁፇፗጽፅጴ\u135bጣፃፅፁጵፔጴጨፅፁፇ";
		text += "ፗጽፔፚጹጳፃፅፁጵፓጠጵ፠ፆፚፓጽፐ\u135cፓጢፃፄፁ朧朝漳ፓጟጠጵፁፇፗፂፐፚ\u135bጢፃፇ\u135fጽፓጠጹፄፀፃፁጽፅጴፅጢፄፆ\u135fፙፔፄጠጴፁፇፓጽፐፚጵጢፃ\u135d\u135f朧朝漳ፔፄጨጴፁፃጽጽፁጴጵጢፃፄፁጲፀፚጠጵፃፇፗጽፅጴፅጣፃፅፁፚፁፄጤ፠ፁፇ\u135fጽፅጴፅጣፃፅፁጵፔጴጠ";
		text += "ፄፁፇፗጽፐ\u135cፗጶፄፆ\u135fፙፔፚጠ፡ፄፇ\u135bፂፁፅፅጢፄ\u135c\u135fጹጼፄጠ፠ፉጢፓፂፐፚጵጢፃፄፁ朧朝漳ፓጠጵፄፁፇ\u135fጽፁፄጠጤፃጟፁጵፓጟጠጴፀፇፓጽፁጴጹጲፄፚፅፅፓጟጠጴፀፃጽጽፁጶፓጤፃጟፁጲፁጴጠጴፀፇፓጽፁጴጹጲፃፆ፣ጵፓጟጠጴፀፇፓጽፁጴጵጢፃፅፁፉጼጴ";
		text += "ጠጴፀፇፓጽፁጴጵጢፃፄፁ朧朝漳ፔጴጠጴፀፇፓጿፁፅፚጠፄ\u135c\u135f朧朝漳ፓጟጠ፠ፉጢፓፂፁጴጵጢፃፄፁ朧朝漳ፓጟጠፄፀፇፓጽፁጴጹጴፃ\u135d\u135f朧朝漳ፓጟጠፄፃፚፅፁፅጴጵጢፃፆ\u135f朧朝漳ፓጠጹጴፀፇፓጽፁጴጵጢፃፅፁ朧朝漳ፓጟጠጴፀፚፓፁፅጴጵጢፃፅፁጽፓጠጹጴፀፇፗ";
		text += "ጽፐፚጵጢፄፚፁ朧朝漳ፓጟጠጴፀፇፓጽፅጴጵጢፃፄፁ朧朝漳ፔፅጹጴፀፇፗጽፐጠፚ፧ፄፇ\u135f朧朝漳ፔጴጠ፠ፀፇፓፂፁጴጵጢፃፄፁ朧朝漳ፓጟጠፄፀፇፓጽፁጴጴጟፄፚፁ朧朝漳ፔጴጤጥፂፚፓፂፐፚጵጣፃፅፅጹፓጠጹጴፀፇፓጽፁጴጵጢፃፅፁ朧朝漳ፓጟጠጴፀፇ\u135bጾፐፚጵጤ";
		text += "ፃፃ朧朝漳ፁጼፚጠጥፀፇ\u135bጽፅፄ\u135bጢፄፚፁ朧朝漳ፓጟጠጴፀፇፓጽፅጴጵጢፃፄፁ朧朝漳ጼጠጹፄፀፇ\u135bጽፔ\u135c፧ጳፃ\u135d\u135f朧朝漳ፔፄጠፅፂፇፓፂፁጴጵጢፃፄፁ朧朝漳ፓጟጠፄፀፇፓጽፁጴጵጥፃ\u135c\u135f朧朝漳ፔፚጤ፠ፀፃፅጾፐፚጵጥፃፄፅፉፓጠጹጴፀፇፓጽፁጴጵጢፃፅፁጵፔ";
		text += "ፚጠጥፀፇፓጽፅጴጵጢፃፄፅጽፓጟጠጴፀፇፓጽፁጴጵጢፃ\u135bፁ朧朝漳ፓጟጠጴፀፇፗጽፅጴጵጤፃፆ\u135f\u135dፓጠጹፄፀፇፓጽፁጴጵጢፃ\u135c\u135fጹጽጴጠ፠ፐጢፓጽፁጴጵጢፃፄፅጵፔፅጵፄፁፇ\u135fጽፔፚጵጢፃፅፁ朧朝漳ፓጟጠፄፀፇፓጽፁጴጵጢፃፄፁ朧朝漳ፓጟጤ፠ፀፇፓጽፁጴጵጣ";
		text += "ፃፅፁ朧朝漳ፔፄጤፄፀፇ\u135bጿፁጴ\u135fጲፃፄፁ朧朝漳ፓጟጠጴፀፚጹጽፁፄ\u135bጣፃፆ\u135f朧朝漳ፔጴጠ፠ፉጢፓፂፐፚጵጢፃፄፁ朧朝漳ፓጟጤ፠ፂፚጹጽፅጴጠጥፃፄፁ朧朝漳ፔፄጠጴፀፇፓፂፁጴጵጢፃፄፁ朧朝漳ፓጟጠጴፀፃጽጽፁጴጵጢፃፄፁጵፔጴጠ፠ፉጢ\u135bፁፐፚጵጢፃፄፁ朧朝";
		text += "漳ፓጠጵፄፀፇ\u135bጾፅጴጴ፨ፄ\u135c\u135fጺፁጴጠጴፀፇፓጽፁጴጹጲፃፆ፣ጵፓጟጠጴፀፇፓጽፁጴጵጣፃፇ\u135fጽፓጟጠጴፂፇፓጽፁጴጹጵፃፄፁ朧朝漳ፓጟጠጴፀፇፓጽፁጵፅጢፃፄፁ朧朝漳ፓጟጠፄፁፇ\u135bጿፁጴ\u135fጳፃፄፁ朧朝漳ፓጟጠጴፀፚጹጽፁጴፚ፧ፃፄፁፐፁጟጠ፡ፄፇፓጽፁጴ";
		text += "ጵጢፃፄፅጵፔፅጵፄፀፇፓጽፁጴጵጢፃፄፁጵፔፚጠጥፀፇፓጾፁጴጵጢፃ\u135c\u135fፅፓጟጠጴፀፇፓጽፁጴጵጢፃጟፁ朧朝漳ፓጟጠጴፀፇፗጽፅጴጵጤፃ\u135d\u135fጽፔፅጹፄፀፇፓጽፁጴጵጢፄፅፁጲፁፄጠጴፐጢፗጾፐ\u135cጽጥፃፆ፣ፉፓጟጠጴፀፇፓጽፁፄፅጢፄፇ\u135fጶፀፚጨጵፄፇፓፁፔ";
		text += "ፚጵጢፃፄፁ朧朝漳ፓጟጠፄፀፚጽጽፁጶ፣ጢፃጠፁፐፁጟጠጥፀፇፓጽፁጴጵጢፃፄፅጵፔጵጵ፠ፆፚጹፂፁፄፄ፨ፄ\u135c\u135fጽፔጴጠጴፀፇፓጽፁጴጹጲፃፄፁ፡ፓጟጤጥፁፃጹጽፅፄፄ፨ፄ\u135c\u135fጽፔፄጠጴፀፇፓጽፁጴጹጲፃፆ\u135fፉፓጟጤጥፁፃጹጽፐ\u135cፓጥፃፇ\u135f朧朝漳ፓጟጠጴፀፇ";
		text += "ፓፁፅጴፅጥፃፄፁፁፓጟጨፄፁፃጹጾፐጟፄ፨ፄ\u135c\u135fጽፔጴጠጴፀፇፓጽፁጴጹጲፃፅፁጵፓጟጤጴፁፃጽፂፁፄፅጣፃፙ朧朝漳ፁጼፚጨጵፄፇፓፁፔፚጵጢፃፄፁ朧朝漳ፓጟጠፄፀፚጹጽፁጶፓጢፃ\u135c\u135fጵጼፚጠፄፁፇፓጾፁጵ\u135fጷፃፇ\u135fፁፓጟጠጴፀፇፓጽፁፄፅጤፃ\u135c\u135f朧朝漳ጽ";
		text += "ጴጤ፡ፆፇ\u135fጾፅጴጵጢፃፄፁ朧朝漳ፓጠጵፄፀፃፅጾፐጠ\u135bጥፃ\u135bፁ朧朝漳ፓጟጠጴፀፇፓፁፅጴጴ፨ፃፆ፣ጵፓጟጠጴፀፇፓጽፁጴጵጣፄፆ\u135fጽፓጟጠጴፅፇፓጽፁጴጤጶፃፄፁ朧朝漳ፓጟጠጴፀፇፓጽፁጶ፣ጢፃፄፁ朧朝漳ፓጟጠፄፁፇፗጾፐፚጹጳፃፄፁፚፀጟጤፄፁፚፓጾፐ\u135b";
		text += "ጵጤፃጟፁጽጼፚጠጴፀፇፓጽፁጴጹጲፃፄፅፁፔጴጠ፠ፀፇ\u135fጽፅፅፚ፨ፃፚፁጵጼጴጠፄፃፇፓጾፁጴፅጤፃፄፁፁፔጵጹ፠ፆፃ朧朝漳ጽፐ\u135cፓጢፃፇ\u135f朧朝漳ፓጟጠጴፀፇፓጾፐፚ\u135fጴፃፄፁፁፔጴጤጥፀፚጹፂፁፅፅጣፄፅፁ朧朝漳ጼጟጠፄፉጴፅጾፐፚጹጳፃፄፁፙፔጵጵፄፃ";
		text += "ፇፗፂፁጶፗጵፄ\u135bፁጲፁፚጠ፠ፅፇ\u135bጿፁጴጹጷፃፄፁ朧朝漳ፓጟጠጴፀፚጹጽፁፄጠጤፃጟፁጵፓጟጠጴፀፇፓጽፁጴጹጲፄፚፅፅፓጟጠጴፁፃጹጽፐጟፅጢፃ\u135c\u135fጺፀፚጠጴፀፇፓጽፁጴጵጣፃፅፁ朧朝漳ፓጟጠጴፀፇፓጽፁጴጵጢፃፄፁ朧朝漳ፓጟጠጴፀፇ\u135bፁፔፚ\u135fጴፃፄፁ朧";
