		text += "ፁፅጴ\u135fጴፃፄፁ\u135dጼጟጠ፠ፂፚፓጽፁጴፅጢፃፄፁፙፓጟጠጵፁፚፅፂፅጵጵጢፃፄፁፙፔፄጨጴፃፃፅጽፁጴጵጢፃፄፁጲፀፚጠ፠ፉጢፓጾፔፚጵጢፃፄፁ朧朝漳ፓጟጤ፠ፁፃጽፂፁጵ\u135bጤፃጟፁጽጼፚጠጴፀፇፓጽፁጴጹጲፃፄፅጽፓጟጤጥፁፇ\u135bጽፁጴ\u135bጢፃጟፁፐፁጟጠ፠ፉጢ";
