		text += "ጟጠጴፀፇፓፁፅፅጹጶፃፄፁ朧朝漳ፓጟጤ፠ፂፚጹጽፁጴጵጢፃፄፁ朧朝漳ፓጟጠጴፁፇፗጽፁጴጵጢፃፄፁ朧朝漳ፓጟጠጴፀፇፓጽፁጴጵጢፃፄፁፁጼጟጤጴፈጢፓጽፁጴፄ፦ፃፄፅፁፓጟጠጴፀፇፓጽፁጴፅጣፄፆ\u135fጽፓጟጠጴፉጢፓጽፁጵፄ፦ፃፄፁ朧朝漳ፓጟጠጴፀፇፓጽፁፄ";
		text += "\u135bጢፃፄፁ朧朝漳ፓጟጠፄፁፃጽጽፐፚጴ፧ፃፄፁጹፓጟጠጴፈጢፓጽፐ\u135cፓጥፄፅፁ朧朝漳ፓጟጠጴፀፇፓፁፅጶጽጤፃፅፅፁፓጟጠ፠ፀፇፓጾፔፚጵጤፃጟፁጲፁጴጠጴፀፇፓጽፁጴጹጲፃፄፅፁፔጴጠ፠ፀፇ\u135fጽፅጵጵጣፃፇ\u135f朧朝漳ጼጴጠፄፂፇፓጾፁጴፄ፨ፃፅፁጹፓጟጠፄፁ";
