		text += "ጥፃፇ\u135f朧朝漳ፓጟጠጥፀፇፓጾፐጠፅጢፃፄፁ朧朝漳ፓጟጠጴፀፇፓፁፔፚጵጢፃፄፁ朧朝漳ፔጴጠፄፀፇ\u135bጽፐ\u135cፓጥፄፇ\u135f朧朝漳ፓጟጠጴፀፇፓፁፅጵ\u135fጷፃፃ朧朝漳ፁፓጟጠጴፀፇፓጽፁፄፅጣፃፇ\u135f朧朝漳ጼጴጠፄፆፇፓፂፁጴ\u135fጳፃ\u135bፁፁፔጴጠፄፀፃ朧朝漳ጽፁጶ።ጠፄፅ";
