		text += "ጽፁጴጵጣፃፅፁጵጼፚጠ፠ፉጢፗፁፐፚጵጢፃፄፁ朧朝漳ፓጟጤ፠ፁፃጹጿፁጴጵጢፄፚፁ朧朝漳ፓጟጠጴፀፇፓጾፁጶፁጶፃፅፁ朧朝漳ፓጟጠጴፀፇፓጽፁጵጴ፨ፄ\u135c\u135fጲፀፚጠጴፀፇፓጽፁጴጹጲፃ\u135c፣ፉፓጠጵ፠ፀፇፓጽፁጴጵጢፄፅፁፚፁፚጠፄፃፇፓጽፁጴጵጢፃፄፁፁፔጴ";
