		text += "ጠጴፉጴፉጽፁፅ\u135bጢፃፄፁ朧朝漳ፓጟጠጴፄፇ\u135bፁፔፚፚጠፃፙ朧朝漳ፅፓጠጹ፠ፀፇፓጽፁጴጵጢፃፚፁፐፁጟጠጥፅፇፓጽፁጴጵጢፃፄፅጵፔጵጹጴፂፃፁጽፐ\u135bጵጢፃፄፁ朧朝漳ፓጟጠጵፁፃጽጽፐፚፉጵፃፄፁጹፓጟጠጴፈጢፓጾጼጵፅጢፃ\u135c\u135f朧朝漳ፓጟጠጴፀፇፓጾፁጶጽ";
