		text += "ፁጵ\u135fጷፃፄፅጵፓጟጠጴፀፇፓጽፁፄፄ፨ፄ\u135c\u135fጲፀጟጠጴፀፇፓጽፁጴጹጲፃ\u135d\u135fጹጽጴጨፄፀፇ\u135bጽፁጴጴ፩ፃፄፁጵጼጟጤ፡ፆፇፓፂፁጴጵጢፃፄፁ朧朝漳ፓጠጵፄፉጴፉጽፁጵ\u135bጢፃፄፁ朧朝漳ፓጟጠጴፄፇፗጾፐ\u135b\u135fጷፃፚፅፉፓጟጠጴፀፇፓጽፁፄፉጵፄ\u135bፁጲፁጟጠ፠ፅ";
		text += "ፇ\u135bጿፁጴጹጷፃፄፁ朧朝漳ፓጟጠጴፀፚጹጽፅጴጠጢፃፚፁጹጽጴጠፄፀፇፓጽፁጴጵጢፃፄፅጶፁፅጹፄፀፇፓጾፔፚፚጠፄፆ\u135f朧朝漳ፔፄጠጴፀፃጽጽፁጶፁጶፃፄፅፅፓጟጠጴፀፇፓጽፁጵጴ፨ፄ\u135c\u135fፂፀጟጠጴፀፇፓጽፁጴጹጲፃ\u135d\u135fጹጼጠጵ፠ፀፇ\u135bጽፁጴጴ፩ፃፄፁጹጽጴ";
		text += "ጠፄፈጢፓጽፁጴጵጢፃፄፅጵፔጴጤ፠ፁፃጹጽፅጵፅጤፃጟፁፂፁጴጠጴፀፇፓጽፁጴጹጲፃፆ\u135fፐፁፅጹፄፀፚፓጽፐ\u135bፅጤፃጟፁጲፁጟጠጴፀፇፓጽፁጴጹጲፃፅፁጽፓጟጤፄፂፃፁጽፅጴጵጢፃፄፁ朧朝漳ፓጟጠጵፁፚፅፂፅጴጵጢፃፆ\u135f\u135dጼፄጠጴፀፇፓጽፁጴጵጢፄፅፁጺፀ";
		text += "ፚጠጴፀፇፓጽፅጵጹጴፃፄፁ朧朝漳ፓጟጠጴፀፇፓጽፁጴጵጢፄፇ\u135f朧朝漳ፓጟጠ፠ፈጢ\u135fጽፔፚጵጢፃፄፅፅፓጠጹጴፀፇፓጽፁጴጵጢፃፅፁ朧朝漳ፓጟጠጴፀፃ朧朝漳ጽፅጴጵጢፃፆ\u135fፙጼፚጨጴፀፇፓጽፁፅፅጢፄፚፁ朧朝漳ፓጟጠጴፀፇፓጽፅጴጵጢፃፄፁ朧朝漳ጼጟጤ፠ፀፇ";
		text += "ፓጽፐ\u135bጴጠፄፅፁ朧朝漳ፓጟጠጵፅፇፓፂፁጴጵጢፃፄፁ朧朝漳ፓጟጠፄፀፇፓጽፁጴጹጲፃጟፁ朧朝漳ፓጟጠጥፂፚፅፁፅጴጵጢፃፄፅፅፓጠጹጴፀፇፓጽፁጴጵጢፃፅፁ朧朝漳ፓጟጠጴፀፚፉጿፁጴጵጢፃፆ\u135fፙፓጠጹ፠ፀፇፗጽፁፅ\u135bጢፄፚፁ朧朝漳ፓጟጠጴፀፇፓጽፅጴጵጢፃ";
		text += "ፄፁ朧朝漳ፔጵጹፄፀፇፗጽፐ\u135bጴ፦ፃፆ\u135f朧朝漳ፔጴጠጵፆፇፓፂፁጴጵጢፃፄፁ朧朝漳ፓጟጠፄፁፚጽጽፔፚጵጢፃ\u135bፁ朧朝漳ፓጠጵ፠ፁፇፓጽፐፚጵጢፃፄፁ朧朝漳ፓጠጹ፠ፀፇፓጽፁጴጵጣፃፅፁጹፓጠጹፄፉጢፓጽፔፚጵጢፃፄፁ朧朝漳ፔፄጨጴፅፇፗጽፁጴጵጢፃፄፁጲፀፚ";
		text += "ጣ፦ፅፇፓፁፐፚጵጢፃፄፁ朧朝漳ፓጟጤጴፃፃፅጽፁፄ\u135bጢፃፅፁ朧朝漳ፓጟጠጴፀፃጽፂፅጴጹጶፃፄፁ朧朝漳ፓጟጠጴፀፃ朧朝漳ጾጼጵፅጢፃ\u135bፁ朧朝漳ፓጟጠጴፀፇፓጾፁጴፚጟፃፃ朧朝漳ጵፓጟጠጴፀፇፓጽፁፄፄ፨ፄ\u135c\u135fፁጼጴጠጴፀፇፓጽፁጴጹጲፃ\u135d\u135fጹፔጵጹጴፀፇ\u135b";
		text += "ጽፁጴጴ፩ፃፄፁፚፁፚጠጴፄፇፓጽፁጴጵጢፃፄፁፁጼ\u135bጹ፠ፄፃ朧朝漳ጽፁጴጵጢፃፄፁጲፀፚጠ፠ፉጢፗጾፔፚጵጢፃፄፁ朧朝漳ፓጠጵፄፈጢ\u135fጽፁጶጽጢፃፄፁ朧朝漳ፓጟጠጵፁፇ\u135bጿፁጴፄ፨ፃፄፁ朧朝漳ፓጟጠጴፀፃጹጽፐጟጠጢፃ\u135bፁጽጽጵጹጴፂፇፓጽፁጴጵጢፃፄፁ朧";
		text += "朝漳ጼጠጹፄፀፃጵጽፁጴጵጢፃፄፁ朧朝漳ጼጴጠ፠ፉጢ\u135fፁፅጴጵጢፃፄፁ朧朝漳ፓጠጵፄፈጢ\u135bጽፅፅጵጢፃፆ\u135f朧朝漳ፓጟጤጥፀፃጽፂፅጴጴ፦ፃፄፁ朧朝漳ፓጟጠጴፀፃ朧朝漳ጽፐ\u135cፓጣፃ\u135d\u135f朧朝漳ፓጟጠጴፀፇፓፁፅጴፚጟፃ\u135bፁጹፓጟጠጴፀፇፓጽፁፄፅጤፄፇ\u135fጶፁፚጣ";
		text += "፦ፅፇፓጾፅጴጵጢፃፄፁ朧朝漳ፓጟጤጴፂፃፁጽጼጴፅጢፃፄፁ朧朝漳ፓጟጠጵፁፃጽጽፐፚፉጵፃፄፁጹፓጟጠጴፈጢፓጾጼጵፅጢፃፚፁ朧朝漳ፓጟጠጴፀፇፓጾፁጴፚጟፃፅፁፙፓጟጠጴፀፇፓጽፁፄፅጤፃጟፁፂፁፚጠጴፀፇፓጽፁጴጹጲፃፙ朧朝漳ፅፓጟጤፄፀፇፓጽፁጴጵጢ";
		text += "ፃፚፁጹጽጴጟ፦ፁፇፓጽፁጴጵጢፃፄፅጵጼጟጠ፠ፁፚፅጽፁጴ\u135bጢፃፄፁፙፓጟጣ፦ፅፇፓጾፁጴጵጢፃፄፁ朧朝漳ፓጟጤጴፂፃፁጽፅጶጽጢፃፄፁ朧朝漳ፓጟጠጵፁፇፗጾፔ\u135cጽጥፃ\u135bፁጽፓጟጠጴፀፇፓጽፁፄፅጢፄፆ\u135fፚፁፚጠጵፅፇፓጽፁጴጵጢፃፄፁፁጼ\u135bጹ፠ፄፚጽጽፁ";
		text += "ጴጵጢፃፄፁጲፀፚጠ፠ፉ፩ጵጾፁጴጵጢፃፄፁ朧朝漳ፓጠጵፄፀፚጹጽፁጶጽጢፃ\u135c\u135fጵጼፚጠጴፆፃፁፂፅፄፚ፩ፃ\u135c፣ፉጼፄጤፄፀፇፓጽፁጴጵጢፄፅፁ朧朝漳ጼጟጤ፡ፆፃጵጾፐፚጵጢፃፄፁ朧朝漳ፓጠጵፄፀፃጽጾፐጠፚ፧ፃ\u135d\u135f朧朝漳ፓጟጠጴፀፇፓፁፅጶፁጶፃፄፁፅፓጟ";
		text += "ጠጴፀፇፓጽፁጵጵጤፃጟፁጾፀፚጠጴፀፇፓጽፁጴጹጲፃ\u135d\u135fጹፔጵጹጴፀፇ\u135bጽፁጴጴ፩ፃፄፁፚፁፚጠጴፄፇፓጽፁጴጵጢፃፄፁፁፔፄጨጴፁፃጽጽፁጴጵጢፃፄፁጲፀፚጤጥፃፇፓጾፔፚጵጢፃፄፁ朧朝漳ፓጠጵፄፉጢፓጽፁፅፅጢፃፄፁ朧朝漳ፓጟጠጴፄፃጽፂፅጴጹጶፃፄፁ";
		text += "朧朝漳ፓጟጠጴፀፃ朧朝漳ጾፐጠፚ፦ፄፆ\u135f朧朝漳ፓጟጠጴፀፇፓፁፅጴፚጟፃ\u135bፁ\u135dፓጟጠጴፀፇፓጽፁፄፅጤፃ\u135c\u135fጹጽጴጤፄፀፇፓጽፁጴጵጢፃፄፅጶፁፅጹፄፁፇ\u135fጽፐ\u135bፅጤፃጟፁጲፁጟጠጴፀፇፓጽፁጴጹጲፃፄፅጽፔፄጨጴፅፇፓጽፁጴጵጢፃፄፁጲፀፚጠ፠ፉጢፗጽፁጴ";
