		text += "ጴፂፃፁጾፅፄፅጢፃፄፁ朧朝漳ፓጟጠጵፁፇፗጾፐፚፄ፩ፃፆ\u135f朧朝漳ጽጴጨጴፁፇ\u135fጽፁጴጵጢፃፄፁጹጽጴጤጵፃፇፓጽፁጴጵጢፃፄፅጵፔፄጤ፡ፄፚፉጽፁፅ\u135bጤፃ\u135bፁጹጽጴጠጵፆፇፓጽፁጴጵጢፃፄፅጵፔጴጠጥፀፃ朧朝漳ጽፐ\u135cፓጣፃፄፁ朧朝漳ፓጟጠጴፀፇፓፁፅፅጹጶ";
		text += "ፃፄፁ朧朝漳ጼጠጹፄፀፚፅጽፁጴጵጢፃፄፁ朧朝漳ጼጴጠጥፐ፩ፅፁፔፚጵጢፃፄፁ朧朝漳ፓጟጠጴፉጴፉጽፅጴጵጢፃፄፁ朧朝漳ፓጟጠጴፄፃጹፂፐፚጹጲፃፄፁ朧朝漳ፓጟጠጴፀፚጹጾፐጠ\u135bጢፄፆ\u135f朧朝漳ፓጟጠጴፀፇፓፁፅጶፁጶፃፅፁጽፓጟጠጴፀፇፓጽፁጵጵጣፃ\u135d\u135fፐፁ";
		text += "ጟጠጵፄፇፓጽፁጴጵጢፃፄፅጵጼጠጹፄፀፃጹጽፁጴጵጢፃፄፁ朧朝漳ጼጴጤጥፂፃጽፁፐፚጵጤፃፄፁ朧朝漳ጼጟጠጴፉጴፉጽፁፅፅጢፃፄፁ朧朝漳ፓጟጠጴፄፃጹፂፐ\u135bጹጳፃፄፁ朧朝漳ፓጟጠጴፀፚጹጾፔፚፚ፨ፄፆ\u135f朧朝漳ፔፚጠጴፀፃጽጽፁጴፚጟፃፅፁፙፓጟጠጴፀፇፓጽ";
		text += "ፁፄፄ፨ፄ\u135c\u135fፆፀጟጠጴፀፇፓጽፁጴጹጲፄፚፅፅፓጠጹ፠ፂፃጵጽፐ\u135cፓጢፄ\u135c\u135f朧朝漳ፓጟጠጴፀፇፓፁፅጴፅጥፃፄፁፅፔፄጨጴፁፇፓጽፁጴጵጢፃፄፁጲፀ\u135bጹጵፅፇፓጽፁጶፁጶፃፅፁ朧朝漳ፓጟጠጴፀፇፓጽፁጵጴ፨ፄ\u135c\u135fጲፀፚጠጴፀፇፓጽፁጴጹጲፃ\u135c፣ፉጼጵጵፄፀ";
		text += "ፇፓጽፁጴጵጢፄፅፁፚፁፚጠፄፃፇፓጽፁጴጵጢፃፄፁፁፔጴጤጥፆፚፓጽፁፅጵጢፃፄፁ朧朝漳ፓጟጠጵፁፃጽፂፅጴጴ፨ፃፄፁ朧朝漳ፓጟጠጴፀፃ朧朝漳ጾፔፚፚ፩ፄፆ\u135f朧朝漳ፔፄጠጴፀፃጽጽፁጶፁጶፃፄፅፅፓጟጠጴፀፇፓጽፁጵጴ፨ፄ\u135c\u135fፂፀጟጠጴፀፇፓጽፁጴጹጲፃ\u135d";
		text += "\u135fጹጼ\u135bጵ፠ፀፇ\u135fጽፁጴጴ፩ፃፄፁጹጽጴጠፄፈጢፓጽፁጴጵጢፃፄፅጵጼ\u135bጹ፠ፅፚጽጽፁጴጵጢፃፄፁጲፀ\u135bጹጵፅፇፓፂፐፚፚ፧ፃፆ\u135f\u135dፓጠጹ፠ፀፇፓጽፁጴጵጢፄፅፁጵፔፚጠጴፆፇ\u135bጿፁጴፅጢፃፄፁ朧朝漳ፓጟጠጴፀፚጹፂፁፅፅጢፃፄፁፚፁፚጠጵፃፇፓጽፁጴጵጢፃ";
		text += "ፄፁፁፔፅጵጥፆፇፓጾጼጵፅጢፄ\u135bፁ朧朝漳ፓጟጠጴፀፇፓጾፁጵ\u135fጷፃፚፅጹፓጟጠጴፀፇፓጽፁፄፅጣፄፚፁጹጽጴጠ፠ፄፇፓጽፁጴጵጢፃፄፅጵጼጟጠ፠ፁፚፅጽፁጴ\u135bጢፃፄፁፙፓጟጣ፦ፅፇፓጾፐፚጵጢፃፄፁ朧朝漳ፓጟጤጴፈጢ\u135bጾጼጵ\u135bጢፃፆ\u135f朧朝漳ፓጟጤጥፀፇ\u135bጿ";
		text += "ፁጵጹጵፃፄፁ朧朝漳ፓጟጠጴፀፚጹጽፅጶጽጤፃጟፁፆፁጴጠጴፀፇፓጽፁጴጹጲፃፅፅፁፔፄጨጴፂፃ朧朝漳ጽፁጴጵጢፃፄፁጲፀፚጤጥፂፇፗፂፁጴጵጤፃፄፁ朧朝漳ጼጟጠጴፉጴፉጽፁጵ\u135bጢፃፄፁ朧朝漳ፓጟጠጴፄፃጽጽፐ\u135cፁጷፃፄፁጹፓጟጠጴፈጢፓጽፐ\u135cፒ፦ፄፚፁ朧朝";
		text += "漳ፓጟጠጴፀፇፓፁፅጴፄጠፃ\u135d\u135fጽጼፄጠጥፀፇፓጽፁጴጵጢፄፅፁ\u135dፓጟጠጵፆፇፓጽፁጴጵጢፃፄፁፂፁፅጹፄፀፚፓጽፐ\u135bፅጤፃጟፁጲፁጟጠጴፀፇፓጽፁጴጹጲፃፅፁጽፓጟጤጥፂፃፁጽፅጴጵጢፃፄፁ朧朝漳ፓጟጠጵፁፚፅፂፅጴጵጢፃፆ፣ጵፓጟጠጴፀፇፓጽፁጴጵጢፃፅ";
		text += "ፁፂፁጴጠጴፀፇፓጽፁጴጵጢፃፄፁ朧朝漳ጼጵጹጴፀፇፓፁፐጠ\u135bጢፄፇ\u135f朧朝漳ፔጴጠፄፃፇፓፂፁጴጵጢፃፄፁ朧朝漳ፓጟጠፄፀፇፓጽፁጴጵጣፄ\u135c\u135f朧朝漳ፔጴጠፄፂፇ\u135fጽፅጴጵጣፃፄፅፅፓጠጹጴፀፇፓጽፁጴጵጢፃፅፁ朧朝漳ፓጟጠጴፀፇ\u135fፂፐፚጵጣፃ\u135bፁፅጽፄጤጴፀ";
		text += "ፇፗጽፁፅ\u135bጢፄፚፁ朧朝漳ፓጟጠጴፀፇፓጽፅጴጵጢፃፄፁጲፀ\u135bጹጴፀፇፗጽጼጵ\u135fጶፄፇ\u135f朧朝漳ፔጴጠጵፆፇፓፂፁጴጵጢፃፄፁ朧朝漳ፓጟጠፄፀፇፓጽፁጴጹጷፄፆ\u135f朧朝漳ፔጴጟ፦ፆፇ\u135fፁፅጴጵጤፃፄፅፉፓጠጹጴፀፇፓጽፁጴጵጢፃፅፁ朧朝漳ፓጟጠጴፀፃጵጽፁጴጵጤ";
		text += "ፃ\u135bፁጶፀፚጠፄፀፇ\u135bጽፁፅ\u135bጢፄፚፁ朧朝漳ፓጟጠጴፀፇፓጽፅጴፉጳፃፇ\u135f朧朝漳ፓጟጨፄፀፇፓጾፅጵጵጢፄፇ\u135f朧朝漳ፓጟጠጴፀፇፗጽፁጴጵጢፃፄፁ朧朝漳ፔጴጠፄፀፚፓጽፁጴጵጤፃጟፁጲፁጟጠጴፀፇፓጽፁጴጴ፨ፃፙ朧朝漳ፅፓጟጨፄፀፇፓጽፁጴጵጢፃፚፁጵጼፄጠ";
		text += "ፄፆፇ\u135bጿፁጴ\u135bጥፃፄፁ朧朝漳ፓጟጠጴፀፚጹጽፁፄፅጢፃ\u135c\u135fጵጼፚጨፅፁፇፗጽፔፚፚ፧ፃፅፁጵፔፄጤፄፈጢ\u135bጾፁጵፅጢፃፅፁ朧朝漳ፓጟጤጥፀፇፗጾፐፚፚጟፃፚፁፅፓጟጠጴፀፇፓጽፁፄፅጣፃ\u135c\u135fጽፔፚጠጵፂፇፗጾፐ\u135cፓጢፃፅፁጹፓጟጠጴፀፇፓጽፁጵጹጵፄፚፁጶ";
		text += "ፁጟጠጵፃፇፓጽፁጴጵጢፃፅፁጵፔፄጤፄፈጢ\u135bጾፔ\u135bፅጢፃፇ\u135f朧朝漳ፓጟጤጥፀፇፗጾፐፚፚጟፃፚፁፅፓጟጠጴፀፇፓጽፁፄፅጣፃ\u135c\u135fጽፔፚጠ፠ፐ፩ጽጽፐ\u135cጼ፧ፃፄፁጽፓጟጠጴፈጢፓጾጼጵፅጢፃጠፁ朧朝漳ፓጟጠጴፀፇፓጾፁጶፁጶፃፅፁጵፓጟጠጴፀፇፓጽፁጵጴ፩ፄ";
		text += "ፇ\u135fጶፁጴጠጴፀፇፓጽፁጴጴ፦ፃፆ\u135f\u135dፓጠጵጥፀፇፓጽፁጴጵጢፃ\u135c\u135fጹጽጴጠፄፈጢፓጽፁጴጵጢፃፄፅጵፔፄጨጴፁፚፅጽፁጴጵጢፃፄፁ朧朝漳ጼፚጠ፠ፆፚፅፂፁፅፄ፨ፃፄፅጹፓጟጠጴፀፇፓጽፅጴፅጤፃ\u135bፁፙፔፄጣ፦ፂፇፓጽፔፚጵጢፃ\u135d\u135f朧朝漳ፔጴጤ፠ፂፃፁጾፁጵ";
		text += "ፅጢፃፄፁ朧朝漳ፓጟጠጵፁፇፗጾፐ\u135bጵጢፄፅፁፙፓጟጠጴፀፇፓጽፁጴጵጢፃ\u135c\u135fጵጼጟጨፅፁፇፗጽፔፚፚ፨ፃፅፁጵፔፄጤ፠ፈጢ\u135bጿፁጵፅጢፃፇ\u135f朧朝漳ፓጟጤጥፀፇፗጾፐፚፚጟፃፚፁፅፓጟጠጴፀፇፓጽፁፄፅጣፃ\u135c\u135fጽፔፚጠፄፂፇፓጾፐፚፄጟፃጠፅጵፓጟጤ፠ፁፃፅ";
		text += "ጿፅፄፅጣፃ\u135d\u135fጹጽጴጠጵፁፇፓጽፁጴጵጢፃፄፁፉፔፄጤ፡ፄፚፅፁፅፄጠጢፄፆ\u135f朧朝漳ፓጟጠጴፀፇፗጽፅጴፚ፨ፃ\u135d\u135fጹጽጴጨፄፀፇ\u135fጽፁጴጴ፩ፃፄፁጵጼፚጠ፠ፉ፩朧朝漳ጾፅጴጵጢፃፄፁ朧朝漳ፓጠጵፄፁፃጹጽፔፚጟ፧ፃፄፁ朧朝漳ጼፚጠፄፉ፩ፅፁፅጴጴ፨ፃፅፁ፡";
		text += "ጽፅጵፄፁፃጽጽፐ\u135cፓጢፄፅፁ朧朝漳ፓጟጠጴፀፇፓጾፐፚፚ፨ፃ\u135d\u135fጹጽጵጹጴፀፇ\u135fጽፁጴጴ፩ፃፄፁፚፁፚጠጴፐጢፓጽፁጴጵጢፃፄፁፁፔፄጨጴፀፚፁጽፁጴጵጢፃፄፁጲፀፚጠጴፆፇፗጾፔ\u135c፧ጲፃፆ\u135f\u135dፓጠጵጥፀፇፓጽፁጴጵጢፄፅፁፚፁፚጠጴፐጢፓጽፁጴጵጢፃፄፁ";
		text += "ፁፔፄጨጴፀፚፁጽፁጴጵጢፃፄፁጲፀፚጠጴፆፇፗጾፔ\u135c፧ጲፃ\u135d\u135fጹፔፅጹ፠ፀፇፗጽፁጴጴ፩ፃፄፁጹጽጴጠጴፐጢፓጽፁጴጵጢፃፄፁፉፔፄጨጴፅፚፅጽፁጴጵጢፃፄፁጲፀፚጠ፠ፉጢፗጿፁጴጵጢፃፄፁ朧朝漳ፓጠጵፄፂፃፁጽፅፅጵጢፃፄፁ朧朝漳ፓጟጠጴፆፇ\u135bጾፐጠጹጵ";
		text += "ፃፚፅጽፓጠጵ፠ፀፇፓጽፁጴጵጣፃፅፁጹጼፚጤጥፂፃፅፂፐፚጵጥፃፄፁ朧朝漳ጼጟጠጴፁፃጹጽፐ\u135cፒ፦ፃ\u135bፁ朧朝漳ፓጟጠጴፀፇፓፁፅጴፄ፨ፃፚፁጲፀፚጠፄፀፚጹጽፁጴጵጢፃፄፁ朧朝漳ጼፚጠፄፉ፩ፅፁፅጴፚጟፃፄፁ\u135dፓጟጠጴፀፇፓጽፁጵ\u135fጵፄፚፁጺፁጴጠጵፂፇፓ";
		text += "ጽፁጴጵጢፃፅፁጵፔፄጤፄፈጢ\u135bፁፅጴጠጢፃፇ\u135f朧朝漳ፓጟጤጥፀፇፗጾፐፚፚጟፃፚፁፅፓጟጠጴፀፇፓጽፁፄፅጣፃ\u135c\u135fፁፓጟጤፅፁፇፓጽፅጴጵጢፃፄፁ朧朝漳ፓጟጤ፠ፁፃፁጿፅፄፅጣፃ\u135c\u135fፐፁጟጤፅፅፇፓጽፁጴጵጢፃፄፅጵፔጵጹ፠ፁፚፓጽፔፚጟ፩ፃጠፁፙፔፚጠጴ";
		text += "ፐጢፓጽፁጴጵጢፃፄፅጵፔጴጠጥፀፃ朧朝漳ጽፁጵ\u135bጣፃ\u135c\u135f።ፀፚጣ፦ፅፇፓጿፅጴጵጢፃፄፁ朧朝漳ፓጟጤጴፀፃጹጽፅጶጼጠፄፅፁፚፁፚጠጴፐጢፓጽፁጴጵጢፃፄፁፁፔፄጨጴፄፚፅጽፁጴጵጢፃፄፁጲፀፚጤ፡ፆፇ\u135bጿፁጴጵጢፃፄፁ朧朝漳ፓጠጵፄፀፚፅጽፅጴፅጢፃፚፁ";
		text += "朧朝漳ፔፄጠጴፐጢፓጽፐ\u135cፗጶፄፆ\u135fፙፓጟጨፅፄፚጹጾፐጠፚ፧ፄ\u135c\u135f朧朝漳ፓጟጠጴፀፇፓፁፅጴፅጣፃፄፁፁጼ\u135bጹ፠ፆፇፓጽፁጴጵጢፃፄፁጲፀፚጠ፠ፉጢፗጽፁጴጵጢፃፄፁ朧朝漳ፓጟጤ፠ፀፚጽፂፁፅጴጟፃፆ\u135f朧朝漳ፓጟጠጴፀፇፓጽፁጴፚ፧ፃፆ\u135f\u135dፓጠጹ፠ፀፇፓጽ";
		text += "ፁጴጵጢፄፅፁጵፔፚጠጴፅፃጽጽፐጟፄጠፃፄፁጽፓጟጠጴፈጢፓጾጼጵፅጢፃጠፁ朧朝漳ፓጟጠጴፀፇፓጾፁጶጽጤፄፆ\u135fጵፓጟጠጥፀፇፓጾፔፚጵጤፃጟፁጵጼጟጠጴፀፇፓጽፁጴጹጲፃፆ\u135f\u135dፔጵጹጴፀፇፓጽፁጴጵጢፃ\u135c\u135fጹጼፚጤጥፂፚፁፂፁጴጵጥፃፄፁ朧朝漳ጼጟጠጴፂ";
		text += "ፃፁጽፅፅጵጢፃፄፁ朧朝漳ፓጟጠጴፆፇ\u135bጾፐፚፚጟፃፅፁ朧朝漳ፓጟጠጴፀፇፓጽፁፄፉጵፄፚፁ፡ፔፚጠጵፁፇፓጽፁጴጵጢፃ\u135d\u135fጽጼፚጠፄፀፇፓጽፁጴጵጢፄፅፁጵፔፚጠጴፆፇፗጽፅጴጴ፨ፃፄፁፉፔጴጨጴፑጴጹጾፐጠፚ፨ፃፆ\u135f朧朝漳ፓጟጠጴፀፇፓፁፅጴጹጳፄፚፅፅ";
		text += "ፔፚጤጥፂፃጵጽፐ\u135cፓጢፄ\u135c\u135f朧朝漳ፓጟጠጴፀፇፓፁፅጴፅጥፃፄፁፙጼጟጠ፡ፁፃፅጽፁጴጠጢፃፄፁፙፓጟጣ፦ፅፇፓጿፅጴጵጢፃፄፁ朧朝漳ፓጟጤጴፈጢ\u135bፂፁጵፅጢፃፇ\u135f朧朝漳ፓጟጤጥፀፇ\u135bጿፁጴፄ፩ፃፄፁ朧朝漳ፓጟጠጴፀፚጹጽፐ\u135cፓጣፄፚፁ朧朝漳ፓጟጠጴፀፇፓ";
		text += "ጾፐፚፚ፨ፃ\u135d\u135fጺፁጵጹጴፀፇ\u135fጽፁጴጴ፩ፃፄፁጹጽጴጠፅፄፇፓጽፁጴጵጢፃፄፁፉፔፄጤ፠ፂፃፁጽፅጴጵጢፃፄፁ朧朝漳ፓጟጠጵፁፚፅፂፁጵጴጟፃፄፅጵፓጟጠጴፀፇፓጾፔፚ\u135fጴፄፚፁ朧朝漳ፔፚጠጴፀፃጽጽፁጴፚጟፃፅፅፁፓጟጠጴፀፇፓጽፁጵ\u135bጤፃ\u135c\u135fጹጽጴጤ፠";
		text += "ፃፇፓጽፁጴጵጢፃፄፅጵጼጟጠ፠ፂፃፅጽፁጴ\u135bጢፃፄፁፙፓጟጠጴፆፇፗጾፔ\u135c፧ጲፃፆ\u135f\u135dፔጴጤጥፀፇፓጽፁጴጵጢፄፅፁጲፁጴጠጴፉጢፓጾፔፚፚጟፃ\u135c\u135fፁፓጟጠጴፀፇፓጽፁፄፅጢፃጟፁጹጽጴጤፄፉጢፓጽፁጴጵጢፃፄፅጵፔፄጤ፠ፈጢ\u135bፁፅጶ፣ጢፃፇ\u135f朧朝漳ፓጟጤ";
		text += "ጥፀፃጽፂፅጴጴጠፃፄፁ朧朝漳ፓጟጠጴፀፃ朧朝漳ጾፔፚ\u135fጷፃፇ\u135f朧朝漳ፔፚጠጴፀፃጽጽፁጴጴጟፃ\u135d\u135fጽፓጟጤጥፀፇፓጽፁጴጵጢፄፅፁፐፁጟጤጴፃፇፓጽፁጴጵጢፃፄፅጵፔፄጨጴፄፚፅጽፁጴጵጢፃፄፁጲፀፚጠ፠ፉጢፗፂፁጴጵጢፃፄፁ朧朝漳ፓጟጤ፠ፂፃጹፂፁፅጹጷ";
		text += "ፃፆ\u135f朧朝漳ጽፄጠጴፀፇፓጽፁጴፚ፧ፃፆ\u135f\u135dፓጠጹ፠ፀፇፓጽፁጴጵጢፄፅፁጵፔፚጠጴፉ፩ጽጽፐጟፄጠፃፄፁጽፓጟጠጴፈጢፓጾጼጵፅጢፃጠፁ朧朝漳ፓጟጠጴፀፇፓጾፁጶጽጤፃፄፅፁፓጟጤጴፀፇፓጾፔፚጵጣፃፅፁ朧朝漳ጽጴጤ፡ፆፃጹጾፅጴጵጢፃፄፁ朧朝漳ፓጠጵፄፂ";
		text += "ፃፁጾፁፅጵጢፃፄፁ朧朝漳ፓጟጠጵፁፇ\u135bጿፁጴፉጵፃፄፁ朧朝漳ፓጟጠጴፀፃጹጽፐ\u135b\u135bጤፃጟፁጵፓጟጠጴፀፇፓጽፁጴጹጲፄፚፅፂፀጠጹ፠ፀፃፅጽፁጴጵጢፃፄፁጵፔጴጠ፠ፅፃጽጽፐፚ\u135fጳፃፄፁፁፓጟጠጴፈጢፓጽፅጵ\u135bጤፃጟፁፁጼፄጠጴፀፇፓጽፁጴጹጲፃፅፁፉጼጴ";
		text += "ጠጴፂፚፓጽፁጴ\u135bጢፃፄፁ朧朝漳ፓጟጠጴፆፇፗጾፔ\u135c፧ጲፃፅፁፉጽጵጹጴፀፚፁጽፁጴጵጢፃፄፁ朧朝漳ፔጴጠ፠ፉጢፓጿፅጴጵጢፃፄፁ朧朝漳ፓጟጤ፠ፈ፩朧朝漳ጽፁጴፅጢፃፄፁ朧朝漳ፓጟጠፅፂፇፗጽፔፚጴጠፃፄፁፉፔጴጨፄፑጴጹጾፐጠ\u135bጤፃጟፁ朧朝漳ፓጟጠጴፀፇፓ";
		text += "ፁፅጴፉጷፃፄፅጶፁጠጹፄፀፃ朧朝漳ጽፅጴፅጢፃጠፁ\u135eፁ\u135bጵ፠ፈጢፗጾፐጠ\u135fጶፃፄፁጵጼፅጹ፠ፂፚፁጾፁጵ\u135bጣፄፆ\u135f\u135eፁፄጠፄፁፇፓጽፁጴጵጢፃፄፁጵፔጴጠጥፂፃጽጽፅጴፅጤፃ\u135d\u135fጵጼፚጤጥፂፇ\u135fጽፔፚጴ፦ፃፄፁ朧朝漳ጼጟጠጵፁፇ\u135bጽፅጴፅጤፃ\u135d\u135fጵጼጟጣ፦";
		text += "ፅፇፓጿፅጴጵጢፃፄፁ朧朝漳ፓጟጤጵፁፇ\u135bጽፅጴፅጤፃ\u135d\u135fጵጽጴጠጴፆፇፗጾፔ\u135c፧ጲፄፅፁጹፔጴጠፄፂፃጽጽፅጶ።፩ፄ\u135bፁ朧朝漳ጽፄጠጴፀፇፓጽፁጴጴ፦ፄፅፁጹፔጴጠፄፂፃጽጽፅፄፅጣፃ\u135d\u135fጹጽጴጤ፠ፆፇፓጽፁጴጵጢፃፄፅጶፀፚጠ፠ፁፇፗጽፐ\u135cጽጤፃጟፁፆፀ";
		text += "ፚጠጴፀፇፓጽፁጴጹጲፃፆ\u135f\u135dፔጵጹጴፀፇፓጽፁጴጵጢፃ\u135c\u135fጹጼ\u135bጹጵፄፇ\u135fፁፐፚጴጠፃፄፁ朧朝漳ፓጟጠጴፀፃጹጽፅጶ።ጠፄፅፁፐፁጟጠ፠ፉጢፓጽፁጴጵጢፃፄፅጵፔጵጹ፠ፀፚጹጽፔፚፄ፩ፃ\u135d\u135fፙፔፚጠጴፐጢፓጽፁጴጵጢፃፄፅጵፔጴጠጥፀፚፁጽፅፄጟጟፄፚፁጵ";
		text += "ፔጴጠጴፀፇፓጽፁጴጵጣፃፅፁጽፔፄጤጥፁፇፗጽፐ\u135cጽጣፃ\u135c\u135f朧朝漳ጼፚጠፄፆፃፅፁፅፄፅጤፃፅፁጵፔፄጤጥፁፃጽጾጼጵፅጢፃጠፁ朧朝漳ፓጟጠጴፀፇፓጾፁፄፅጤፃፅፁጵፔፄጤጥፁፃፁጽፁጵ\u135bጣፃ\u135d\u135f።ፀ\u135bጵፄፂፇፗጽፅጴፚ፩ፃፅፁ፡ጼጠጹፄፀፃፅጽፁጴጵጢፃ";
		text += "ፄፁ朧朝漳ጼጵጵፄፂፇፗጽፅጴፚ፩ፃፅፅጵፓጟጤ፠ፁፃፁጿፅፄፉጲፃፆ\u135fጵፔጴጠ፠ፈጢፗፁፐ\u135cፁጶፃፄፁ፡ፓጟጠጴፀፇፓጽፁጵጹጲፃፆ\u135fጵፔጴጠ፠ፈጢ\u135bጿፁጵፉጲፃፄፁ朧朝漳ፓጟጠጴፀፚጹጾፐጠ\u135bጤፃጟፁ朧朝漳ፓጟጠጴፀፇፓፁፅጴፅጥፃፄፅጹፔጴጠፄፀፚፁጽ";
		text += "ፁጴ\u135bጣፃፅፁጲፀጟጠጴፂፃፁፂፅፄፚ፩ፃፅፁጵፓጠጵ፡ፄፚጹጾፐጠፚ፧ፄ\u135c\u135f朧朝漳ፓጟጠጴፀፇፓፁፅጴፅጣፃፄፅጽጼ\u135bጹ፠ፆፇፓጽፁጴጵጢፃፄፁጲፀፚጠ፠ፉጢፗጽፁጴጵጢፃፄፁ朧朝漳ፓጟጤ፠ፁፇ\u135fጽፁጶ፣ጢፃ\u135c\u135fጵጼጟጨፅፁፇፗጽፅጴጴጠፃፅፁ፡ፔፄጨጴፀ";
		text += "ፚጹጽፁጴጵጢፃፄፁ朧朝漳ጼፚጠ፠ፆፇፗፁፐ\u135cፗጵፃፅፁጵፓጟጠጴፀፇፓጽፁጴፅጣፃፇ\u135fጹጼጟጠፄፁፇ\u135bጾፔፚፄ፨ፃ\u135d\u135fጹፔፚጠጥፀፃ朧朝漳ጽፁጴጴ፩ፃፄፅጵፔፄጠፄፁፇ\u135bጾፔፚፄ፩ፃፙ朧朝漳ፅፓጟጨፄፀፇፓጽፁጴጵጢፃፚፅጵፔፄጠፄፁፇ\u135bጾፔፚፄጟፃፄፁፉ";
		text += "ፔጴጤጥፑጴጹፁፅጴ\u135bጣፃፅፁጹጼጟጠፄፐ፩ጽፂፅጴጴጠፃፄፁ朧朝漳ፓጟጠጴፀፃ朧朝漳ፁፅጴ\u135bጣፃፅፁጹጼጟጠፅፁፇፗጾፐፚፚጟፃ\u135c\u135fፉፓጟጠጴፀፇፓጽፁፄፉጲፃፆ\u135fጵፔጴጠ፠ፈጢ\u135bጿፁጵፉጲፃፄፁ朧朝漳ፓጟጠጴፀፚጹጽፐ\u135cፓጣፄፚፁ朧朝漳ፓጟጠጴፀፇፓጾፐ";
		text += "ፚፚ፨ፃፅፁጵፓጟጨፄፈጢ\u135bጽፔ\u135c፣ጢፃፚፁ朧朝漳ፓጟጤጥፀፇ\u135bጿፁጴፄ፦ፃፄፁ朧朝漳ፓጟጠጴፀፃጹጽፐ\u135cፓጣፃፆ\u135f朧朝漳ፓጟጠጴፀፇፓፁፅጴፅጥፃፄፅጵፔጴጠፄፀፚጹጽፅጵጴ፩ፃፆ\u135fጾፁፄጠጴፄፇፓጽፁጶጽጢፃፅፁፙጽጵጹጴፀፇ\u135fጽፁጴጵጢፃፄፁ朧朝漳ፔጴ";
		text += "ጠፄፃፇ\u135bጿፁጴፅጣፃፆ\u135f\u135dፔጴጤ፠ፉጴፉጽፁጶጽጢፃፄፁ朧朝漳ፓጟጠጴፄፚጹጽፐፚፅጣፃፆ\u135f\u135dፔጴጤጴፁፃ朧朝漳ጽፐ\u135cፒ፨ፃ\u135d\u135f朧朝漳ፓጟጠጴፀፇፓፁፅጴፅጣፃፄፅጵፔጴጤጴፈጢ\u135bጾፁጴፅጢፃፚፁ朧朝漳ፓጟጤጥፀፇፗጾፔ\u135cፗጵፃፄፁጽፓጟጠጴፀፇፓጽፁጴፅ";
		text += "ጣፃፇ\u135fጹጽጴጠፄፁፇ\u135bጿፁጴፄ፨ፃፙ朧朝漳ፅፓጟጨጴፀፇፓጽፁጴጵጢፃፚፅጵፔፄጠፄፁፇ\u135bጿፁጴፄ፦ፃፅፁፁፔፄጨጴፆፃጽጽፁጴጵጢፃፄፁጲፀፚጠፄፁፇፓፁፅጴፄ፦ፃ\u135d\u135fጹጼጴጤፄፀፃ朧朝漳ጽፁጴጴ፩ፃፄፁጵጼጟጨጵፄፇፓጽፔፚጵጢፃፄፁ朧朝漳ፓጟጠፄፁፇ";
		text += "\u135fጽፐ\u135cፓጣፃፅፁጹጽጴጠፄፆፇፓጾፐፚፄጟፃጠፅጶፀፚጠ፠ፁፇፗጽፐ\u135cፓጣፃፚፁጵጼጴጠ፠ፉ፩ጹጾፔፚጵጢፃፄፁ朧朝漳ፓጠጵፄፁፇፗጽፁፄፅጣፃፚፁፙፔፄጤጵፄፇፓጾፁጴጵጢፃ\u135d\u135f朧朝漳ፔጴጤ፠ፐጴፅጽፁጴጠጢፃፄፁ朧朝漳ፓጟጠጴፁፇፗጾፁጴፄ፦ፃፅፁፁፔ";
		text += "ጴጤጥፂፃፁጾፐ\u135cፓጢፃፄፁ朧朝漳ፓጟጠጵፁፇ\u135bጾፐፚ\u135fጳፃፄፁፉፔጴጤጥፂፃፁጾፅጴፅጢፃፄፁ朧朝漳ፓጟጠጵፁፃጽፂፅጴፅጤፃፄፁ朧朝漳ፓጟጠጴፀፃ朧朝漳ጽፅጵ\u135fጷፄ\u135bፁ朧朝漳ፔጴጨጵፃፇ\u135fጿፁጴጵጢፃፄፁ朧朝漳ፓጟጠፄፁፇፗጽፁፄፅጣፃፚፁፙፔፄጤፄፐጢ";
		text += "ፓጾፁጴጵጢፃ\u135d\u135f朧朝漳ፔጴጤ፠ፐጴፅጽፁጴጠጢፃፄፁ朧朝漳ፓጟጠጴፁፇፗጾፁጴፄ፦ፃፅፁፁፔፄጨጴፆፃፅጽፁጴጵጢፃፄፁጲፀፚጠፄፈ፩ፁፁፔፚጟጟፃፄፁ朧朝漳ፓጟጠጴፀፇፗጽፅጵ\u135bጤፃጟፁፐፀፚጠጴፀፇፓጽፁጴጹጲፃፆ\u135f\u135dጼ\u135bጵ፠ፀፇፓጽፁጴጵጢፄፅፁጹጽ";
		text += "ጴጤ፡ፃፇፓጽፁጴጵጢፃፄፅጵፔፅጴ፦ፂፚፓጽፅጴፅጢፄፅፁጵጼጴጤጥፂፃጹጽፅጴጴ፦ፃፄፁ朧朝漳ጼጟጠጴፁፃጽጿፁፅጵጢፃፇ\u135f朧朝漳ፓጟጠጴፀፇፓጽፅጴፅጥፃፆ\u135f\u135dፔጴጠፄፂፃፁጽፅጵ\u135bጣፃ\u135d\u135f\u135eፁጴጠጥፉጢፓጽፁጴጵጢፃፄፁጶፀፚጠ፠ፁፇፗጽፐ\u135cፓጣፃፚ";
		text += "ፁጵጼጴጠ፠ፉ፩ጹጾፔፚጵጢፃፄፁ朧朝漳ፓጠጵፅፄፚፅጾጼጵጵጢፃ\u135d\u135f朧朝漳ፓጟጠጴፀፇፗጽፅጴፚ፧ፃ\u135d\u135fጹጼፚጨፄፀፃ朧朝漳ጽፁጴጴ፩ፃፄፁጵጼፚጠ፠ፉ፩朧朝漳ጾፅጴጵጢፃፄፁ朧朝漳ፓጠጵፄፁፃጹጾፁጴጴጟፃፆ\u135f朧朝漳ፔጴጠጴፀፇፓጽፁጴጴ፨ፃፅፁፙጽፅጵ";
		text += "ፄፁፃጹጿፁፅጵጢፄፇ\u135f朧朝漳ፓጟጠጴፀፇፓጽፅጴፚጟፃፄፁ፡ፓጟጠጴፀፇፓጽፁጵፚ፩ፃፚፁ朧朝漳ፔጴጠጴፀፇፓጽፁጴፉጳፃፅፁጽፓጠጹጴፀፃጹጽፅጶፒጠፄፅፁፐፁጟጠ፠ፉጢፓጽፁጴጵጢፃፄፅጵፔጵጹ፠ፀፚጹፂፐጠፅጢፃፚፁጵፔጴጠጵፄፃፁፂፅፄፚ፩ፃፅፁፐ";
		text += "ፁጠጹፄፀፇፗጾፅፅ\u135bጤፄፇ\u135fፁጼፚጠፅፂፃፁፂፁጴፅጣፃፄፁ朧朝漳ፓጟጠጴፀፇፗጽፅጴጠጤፃ\u135d\u135fጵፔጴጠ፠ፈጢፗጾፐ\u135cጽጤፃፇ\u135fጽፓጟጤጴፀፇፓጾፔፚጹጲፃፆ\u135fጵፔጴጠ፠ፈጢፗጾፔ\u135cፁጶፃፄፁ፡ፓጟጠጴፀፇፓጽፁጵጹጲፃፆ\u135fጵፔጴጠ፠ፈጢፗጿፁጴጴ፨ፃፅፁ";
		text += "ፙጽፅጵፅፁፇ\u135bጽፅጴፅጤፃ\u135d\u135fጵጽፄጣ፦ፅፇፓጿፅጴጵጢፃፄፁ朧朝漳ፓጟጤጵፁፇ\u135bጽፅጴፅጤፃ\u135d\u135fጶፀፚጠፄፈጢ\u135bጿፁጵፚ፨ፃፄፁ朧朝漳ፓጟጠጴፀፚጹፁፅጴ\u135bጣፃፅፁጹጼጟጠ፠ፉ፩ጵፁፅጴጵጢፃፄፁ朧朝漳ፓጠጵፄፂፃፁጽፅፅጵጢፃፄፁ朧朝漳ፓጟጠጴፆፇ\u135bጾ";
		text += "ፐጠጹጵፄ\u135c\u135f፡ፓጟጤ፠ፀፇፓጽፁጴጵጢፃ\u135c\u135fጵጽጴጨፅፁፃጹፂፐፚፚጟፃፄፁ朧朝漳ፓጟጠጴፀፚጹጽፅፅ\u135bጢፄፅፁጽፔጴጤጵፄፃጽጽፔፚጴጠፃፄፁ朧朝漳ፓጟጠጴፀፚጹጽፅጴጠጣፃፄፁ朧朝漳ጼፚጠፄፆፃፅፁፅጶፁጶፃፄፁ፡ፓጟጠጴፀፇፓጽፁጵጵጢፃ\u135c\u135fጵጼጟጨ";
		text += "ፅፁፃጽፂፅጴጴጠፃፄፁ朧朝漳ፓጟጠጴፀፃ朧朝漳ጽፐ\u135cፒ፦ፄፚፁ朧朝漳ፓጟጠጴፀፇፓፁፅጵ\u135fጷፃፆ\u135f\u135dፓጟጠጴፀፇፓጽፁፄፅጣፃፇ\u135fጲፁጟጠፄፁፇፗጽፁጴጵጤፃፅፁጵፓጠጹ፠ፀፇ\u135bጿፁፅፉጳፃ\u135d\u135fጵፔጴጠጵፆፚፅፁፅጵ\u135fጷፃ\u135bፅፉፓጟጠጴፀፇፓጽፁፄፅጣፃፅ";
		text += "ፁጵፓጟጤ፡ፆፃጹጽፁጴጵጢፃፄፁ朧朝漳ፓጠጵፄፂፃፁጽፅጴጵጢፃፄፁ朧朝漳ፓጟጠጴፆፇፗጽፔፚጹጵፃፄፁፉፔጴጤጥፑጴጹጽፅጴፅጢፄፚፁጵጽፄጠ፠ፉጢፓፁፅጴጵጢፃፄፁ朧朝漳ፓጟጤ፠ፂፃጹጽፅፄፚጟፄፚፁጵፔጴጠጴፀፇፓጽፁጴጵጣፃፅፁጽፔፄጤጥፁፇፗጽፐ";
		text += "\u135cጽጣፃ\u135c\u135fፙፔፄጠጥፃፇፓጾፁጴጵጢፃ\u135d\u135fጲፀፚጠ፠ፁፇፗጽፐ\u135cጽጣፃ\u135d\u135fፚፁፚጠጴፐጢፓጽፁጴጵጢፃፄፁፂፀፚጠ፠ፁፇፗጽፐ\u135cጽጣፃጟፁ朧朝漳ጼፚጠፄፈ፩ፅፁፅፄፅጤፃፅፁጵፔፄጤጥፁፃፅጾጼጵፅጢፃጠፁ朧朝漳ፓጟጠጴፀፇፓጾፁፄፅጤፃፅፁጵፔፄጤጥፁፚ";
		text += "ጹጽፅጵ\u135bጤፃጟፁፉጼፚጠጴፀፇፓጽፁጴጹጲፄፅፁጹፔጴጠፄፂፃጽጽፐ\u135cፒ፧ፄፅፁ朧朝漳ፓጟጠጴፀፇፓፁፅጴፚጟፃፅፅፁፓጟጠጴፀፇፓጽፁጵ\u135bጤፃ\u135c\u135fጵፔጴጠጵፄፃጽጽፐፚጟጠፃፄፁፁፓጟጠጴፈጢፓጽፐ\u135cፓጣፃፚፁ朧朝漳ፓጟጠጴፀፇፓጾፐፚፚጟፃፅፁጹፓጟጠ";
		text += "ጴፀፇፓጽፁፄፅጣፃፇ\u135fጲፁፚጠፅፂፃፁፂፁጴፅጣፃፄፁ朧朝漳ፓጟጠጴፀፇፗጽፅጴጠጤፃ\u135d\u135fጵፔጴጠ፠ፈጢፗጾፐ\u135cጽጤፃ\u135c\u135f፡ፓጟጤጴፀፇፓጾፔፚጹጲፃፆ\u135fጵፔጴጠ፠ፈጢፗጾፔ\u135cፁጶፃፄፁ፡ፓጟጠጴፀፇፓጽፁጵጹጲፃፆ\u135fጵፔጴጠ፠ፈጢፗጿፁጴጴ፨ፃፅፁፙጽፅ";
		text += "ጵፅፁፇ\u135bጽፅጴፅጤፃ\u135d\u135fጵጽፄጣ፦ፅፇፓጿፅጴጵጢፃፄፁ朧朝漳ፓጟጤጵፁፇ\u135bጽፅጴፅጤፃ\u135d\u135fጶፀፚጠፄፁፇፓፂፅጴፄ፦ፃ\u135d\u135fጹጼጟጠፄፀፃ朧朝漳ጽፁጴጴ፩ፃፄፁጵጼፚጨጵፄፇፓጽፔፚጵጢፃፄፁ朧朝漳ፓጟጠፄፁፃ朧朝漳ጽፅጵጵጣፃፚፁጹጽጴጤ፠ፐጢፓጽፁጴጵ";
		text += "ጢፃፄፅጵፔፄጨጴፁፃፁጽፁጴጵጢፃፄፁጲፀፚጠፄፃፇ\u135bጿፅጴፅጤፃፆ\u135f፡ፔፄጨጴፀፚፁጽፁጴጵጢፃፄፁ朧朝漳ጼ\u135bጵፄፂፇፗጽፅጴፚ፩ፃፆ\u135f\u135dጼፅጵፄፀፇፓጽፁጴጵጢፄፅፁጹጽጴጠፅፄፇፓጽፁጴጵጢፃፄፁፉፔፄጤ፡ፄፚፅፂፅጶፓጢፃ\u135bፁ朧朝漳ፓጟጠጴፀፇፗጽ";
		text += "ፅጴፚ፧ፃ\u135d\u135fጹጼጟጤጥፀፃ朧朝漳ጽፁጴጴ፩ፃፄፁጵጼፚጠ፠ፉ፩朧朝漳ጾፅጴጵጢፃፄፁ朧朝漳ፓጠጵፄፁፃጹጾፁጴጴጠፃ\u135d\u135f朧朝漳ፔጴጠጴፀፇፓጽፁጴፚጟፃ\u135c፣ፁፓጟጠጴፀፇፓጽፁፄፄ፨ፄ\u135c\u135fፐፁፚጠጴፀፇፓጽፁጴጹጲፃፅፁጽፔፅጹ፠ፁፇ\u135bጽፐጠ\u135bጤፃጟፁፐፁ";
		text += "ጟጠጴፀፇፓጽፁጴጹጲፃፆ\u135f\u135dጼ\u135bጹጴፀፇፓጽፁጴጵጢፄፅፁፐፁጟጤ፡ፅፇፓጽፁጴጵጢፃፄፅጵፔጴጠጥፃፇፓጽፅጴ\u135bጥፃፄፁጹጽጴጤጥፀፇፓጽፁጴጵጢፃፄፅጵፔፄጠጴፀፃጵጽፅጴጵጢፃፆ\u135f朧朝漳ፓጟጤጥፃፃጽጽፅጴጵጢፃፄፁ朧朝漳ፓጠጵፄፁፇ\u135fጽፅጵፅጣፃፅ";
		text += "ፁጵጼፄጠ፠ፉ፩ጽጽፐፚጵጢፃፄፁ朧朝漳ፓጠጵፄፁፇ\u135fጽፅጴፅጣፃፅፁጵፔጴጠፄፆፇፗጾፐፚፄ፨ፃፅፁፉፔጴጠ፠ፃፇፗጽፅጴፅጣፃ\u135bፁፐፁጟጤጥፃፇፓጽፁጴጵጢፃፄፅጵፔጴጠፄፁፃጵጾፐጠፚ፩ፃፚፁ朧朝漳ፓጟጠጴፀፇፓፁፅጴፚጟፃ\u135d\u135fፅፓጟጠጴፀፇፓጽፁፄፅ";
		text += "ጣፃፅፁጽፔጴጠ፠ፀፇ\u135bጽፁጴጵጢፄፃ朧朝漳ጽፓጟጠጴፆፚፓጾፔ\u135b\u135bጢፃፄፁ朧朝漳ፓጟጠጵፁፇ\u135bጿፁጶጼ፩ፃፄፁ朧朝漳ፓጟጠጴፀፚጹጽፅጴፅጣፃፅፁጵፔፄጠጥፀፇ\u135bጿፁጶጼጟፃፄፁ朧朝漳ፓጟጠጴፀፚጹጽፅጴ\u135bጥፃፅፁጶፁጟጠ፠ፀፇፗፂፐፚ\u135bጢፃፆ\u135f\u135dጼጟጤፄ";
		text += "ፀፇፓጽፁጴጵጢፄፅፁጵፔጴጠጥፁፇ\u135bጿፁጶጼጠፃፄፁ朧朝漳ፓጟጠጴፀፚጹጽፅጴፅጥፃፄፁፐፁጟጣ፦ፁፇፓጽፁጴጵጢፃፄፅጶፁፅጹፄፀፚፓጽፐ\u135bፅጤፃጟፁጲፁጟጠጴፀፇፓጽፁጴጹጲፃፅፁጽፔጴጤጥፂፃፁጽፅጴጵጢፃፄፁ朧朝漳ፓጟጠጵፁፚፅፂፅጴጵጢፃፅፁጵፔ";
		text += "ጴጠፄፆፚፓጾጼጴ\u135bጢፃፄፁ朧朝漳ፓጟጠጵፁፇፓጾፐፚፄ፩ፃጠፅጵፔፄጨጴፉጴፁጽፁጴጵጢፃፄፁጲፀፚጠጴፆፇፗጿፁጶ፧ጲፃፆ\u135f\u135dጼጠጵጥፀፇፓጽፁጴጵጢፄፅፁፙፔፚጣ፦ፄፇፓጽፁጴጵጢፃፄፅጵፔጴጠጥፁፃጹጽፅጴፅጣፃ\u135c\u135fጹጽጴጤጥፂፇፓጽፁጴጵጢፃፄፅጵ";
		text += "ፔጴጠጥፁፇፗጽፅጴፅጣፃፅፁጵፔጴጠፄፅፇፗጾፐፚፄ፨ፃፅፁጵፔጴጤ፠ፆፚፓጾፔፚጠጢፃፄፁ朧朝漳ፓጟጠጵፁፇፗጽፅጴፄ፨ፃ\u135c፣ፉጼጟጤጴፀፇፓጽፁጴጵጢፄፅፁፐፁጟጣ፦ፅፇፓጽፁጴጵጢፃፄፅጵፔጴጠፄፁፇፗጾፐጠፚ፩ፄፆ\u135f朧朝漳ፓጟጠጴፀፇፓፁፅጶጽጥፃ";
		text += "ፄፁ፡ፓጟጠጴፀፇፓጽፁፄፅጣፃፇ\u135fጵፔፚጤጥፂፃጽጾፔፚጴ፦ፃፄፁ朧朝漳ጼጟጠጴፉጴፉጽፁጶ፣ጢፃፄፁ朧朝漳ፓጟጠጴፄፇ\u135bጿፁጴጹጴፃፄፁ朧朝漳ፓጟጠጴፀፚጹጽፅጴጠጤፃጠፁጵፔፄጠ፠ፐጢ\u135bጿፁጴጹጶፃፄፁ朧朝漳ፓጟጠጴፀፃጹጽፅጴጵጢፃፄፁጵፔጴጠፄፃፇ";
		text += "ፓጽፐፚፄ፨ፃፄፁጹጽጵጹፅፂፃጽጾፐጠፚ፧ፄ\u135c\u135f朧朝漳ፓጟጠጴፀፇፓፁፅጶጽጥፃፄፁ፡ፓጟጠጴፀፇፓጽፁፄፅጣፃፇ\u135fጵጼጴጠፄፁፇፗጾፐፚፅጣፃፅፁፁፔፄጨጴፉጴፓጽፁጴጵጢፃፄፁጲፀፚጤ፡ፆፃፁጽፁጴጵጢፃፄፁ朧朝漳ፓጠጵፄፁፇፗጽፅጵጴ፨ፄ\u135c\u135fፉፓጟጠ";
		text += "ጴፀፇፓጽፁጴጹጲፃፆ\u135f\u135dፔጵጵፄፀፇፓጽፁጴጵጢፃ\u135c\u135fጵፔፚጠፄፂፇፗጽፅጴፅጤፃፙ朧朝漳ፅፔጴጤጥፀፇፓጽፁጴጵጢፃፚፁጵጼፚጠ፠ፉ፩朧朝漳ጾፅጴጵጢፃፄፁ朧朝漳ፓጠጵፄፁፃጹጽፐጠፅጤፃፄፁጵፔጴጠፄፂፃፁጽፁጴፄ፩ፃፄፁ朧朝漳ፓጟጠጴፀፃ朧朝漳ጽፅጴ";
		text += "ፅጣፃፇ\u135fጵፔጴጠፄፄፃጹፂፐ\u135b\u135bጢፃፄፁ朧朝漳ፓጟጠጴፀፚጹጽፅጵ\u135bጣፃፅፁጵጼጴጤ፡ፆፇ\u135fጽፁጴጵጢፃፄፁ朧朝漳ፓጠጵፅፂፃጽጾፐጠፚ፧ፄ\u135c\u135f朧朝漳ፓጟጠጴፀፇፓፁፅጴ\u135fጳፃፄፁ\u135dፔጴጠፄፁፇ\u135fጽፅጵፚ፨ፄ\u135c\u135f\u135dፔጴጠጴፀፇፓጽፁጴጹጲፃፅፁጵፔጴጠጥፆ";
		text += "ፚፓጾፐፚጵጢፃፄፁ朧朝漳ፓጟጠጵፁፇ\u135bጿፁጴፉጴፃፄፁ朧朝漳ፓጟጠጴፀፃጹጽፐ\u135b\u135bጣፃፅፁጵፔፚጤ፡ፆፇ\u135fጾፅጴጵጢፃፄፁ朧朝漳ፓጠጵፄፁፇፗጽፅጵጴ፨ፄ\u135c\u135fጽጼፄጠጴፀፇፓጽፁጴጹጲፃፅፁጵፔጴጤፄፆፚፓጿፁጴ\u135bጢፃፄፁ朧朝漳ፓጟጠጵፁፇፗጽፅጴፄ፨ፃ\u135c";
		text += "፣ፉጽጴጠ፠ፀፇፓጽፁጴጵጢፄፅፅፂፁፄጟ፦ፅፇፓጾፁጴጵጢፃፄፁ朧朝漳ፔጴጠፄፂፃጵጾፔፚፚ፩ፄ\u135c\u135f朧朝漳ጼጴጠጴፀፃጽጽፁጴፄ፨ፃፆ\u135f\u135dጼጴጤፄፀፇፓጽፁጴጵጢፄፅፁጵጼፚጠጥፃፃጽጽፐፚጴ፨ፃፅፁፙጽፅጵፄፁፇ\u135fጽፔፚ\u135bጣፃፅፁጽፔፄጤጥፂፃፁጾፅጴጵ";
		text += "ጥፃፄፁ朧朝漳ጼጟጠጴፁፃጹጽፐ\u135cፒ፦ፃ\u135bፁ朧朝漳ፓጟጠጴፀፇፓፁፅጴፄ፨ፃፇ\u135fጽፓጠጵፄፂፃፁጽፅጶጽጢፃፄፁ朧朝漳ፓጟጠጴፆፚፅፂፁጴጹጷፃፄፁፁፓጟጠጴፀፇፓጽፅጴፅጥፃፆ\u135fፙፔፄጨጴፐጢፓጽፔፚጵጢፃ\u135d\u135f朧朝漳ፔጴጤ፠ፂፃፁጾፁጵፅጢፃፄፁ朧朝漳ፓጟ";
		text += "ጠጵፁፇፗጾፐፚጠጥፃፅፁ朧朝漳ፔጴጤ፠ፂፃፁጽፅፄ\u135bጢፃፄፁ朧朝漳ፓጟጠጴፆፇ\u135bጿፁጵፅጢፃፄፁ朧朝漳ፓጟጠጴፀፚጹፂፁፅጹጶፄ\u135c\u135f朧朝漳ፔፚጠጴፀፇፓጽፁጴፅጣፃፇ\u135fጹጼጟጠ፠ፑጴፓጽፁጴጠጢፃፄፁፙፓጟጠፄፆፇ\u135bጿፁጵጴ፧ፃፄፁ朧朝漳ፓጟጠጴፀፚጹጽፅ";
		text += "ጵፚ፦ፃፄፁፁጼጴጠጴፃፇፓጽፁጴጵጢፃፅፁፉፔፄጨጴፁፚጽጽፁጴጵጢፃፄፁ朧朝漳ጼፚጣ፦ፅፇፓፂፅጴጵጢፃፄፁ朧朝漳ፓጟጤጴፆፚፓጾፁፄ\u135bጢፃፄፁ朧朝漳ፓጟጠጵፁፇ\u135bጿፁጵፄጟፃፄፁ朧朝漳ፓጟጠጴፀፚጹጽፐ\u135b\u135bጤፃጟፁፅፓጟጠጴፀፇፓጽፁጴጹጲፄፚፅፂፀጠ";
		text += "ጵጥፀፇ\u135fጽፁጴጵጢፃፄፁጵፔጴጠ፠ፅፃጽጽፐ\u135cፒ፧ፃፄፁፁፓጟጠጴፈጢፓጽፅጵ\u135bጤፃጟፁፁጼፄጠጴፀፇፓጽፁጴጹጲፃፅፁፉጼጴጠጴፈጢ\u135bጽፁጴፅጢፃፄፁ朧朝漳ፓጟጠፄፄፇፗጽፔፚፄጟፃፄፁፉፔጴጤጥፑጴጹጽፅጵፚ፨ፄ\u135c\u135fፆፁፚጠጴፀፇፓጽፁጴጹጲፃፅፅፉፔ";
		text += "ጵጹ፠ፃፇ\u135fጾፔ\u135bፄ፩ፃፇ\u135f朧朝漳ጽፄጠጴፀፇፓጽፁጴጹጲፃፅፁጽፔጵጵ፠ፀፃጹጽፅጵፚጠፄፅፁፚፁፚጠጴፐጢፓጽፁጴጵጢፃፄፁፁፔፄጨጴፀፚፁጽፁጴጵጢፃፄፁጲፀፚጤ፡ፆፇ\u135bጿፁጴጵጢፃፄፁ朧朝漳ፓጠጵፄፁፇ\u135fጽፅፄፅጣፃፅፁጶፀጟጠጴፂፇፗጽፅጴፉጲፃፄ";
		text += "ፁጹጽጵጹፅፂፃጽጽፅጴፅጣፄፅፅፂፀፚጤ፡ፆፃጵፂፐፚጵጢፃፄፁ朧朝漳ፓጠጵፄፁፇፗጽፅፄፚ፨ፄ\u135c\u135fፉፓጟጠጴፀፇፓጽፁጴጹጲፃፆ\u135f\u135dፔጴጠጴፀፇፓጽፁጴጵጢፃ\u135c\u135fጵፔፚጠፄፐጴፅፂፁጶፓጥፃፄፁ朧朝漳ፓጟጠጴፀፇፓጽፐ\u135bፅጤፃጟፁጲፁጟጠጴፀፇፓጽፁጴጹ";
		text += "ጲፃፅፁጽፔጵጵጥፈጢ\u135bፁፅጶ፣ጢፃፇ\u135f朧朝漳ፓጟጤጥፀፃጽፂፅጴጴጠፃፄፁ朧朝漳ፓጟጠጴፀፃ朧朝漳ጾፔፚፚጟፄፆ\u135f朧朝漳ጼጴጠጴፀፃጽጽፁጴፚጟፃፅፁፙፓጟጠጴፀፇፓጽፁፄፅጤፃጟፁጶፁፄጠጴፀፇፓጽፁጴጴ፨ፃፆ\u135fፉጼጟጠ፡ፃፚፅጽፁጴጠጢፃፄፁፙፓጟጠ፠";
		text += "ፉጢፗፂፁጴጵጢፃፄፁ朧朝漳ፓጟጤ፠ፂፃጹጽፐ\u135cፓጣፃፄፁ朧朝漳ፓጟጠጴፀፇፓፁፅፅጹጵፃፆ\u135fፁፓጟጠጥፀፇፓጽፁጴጴ፩ፃፇ\u135fፉፔጴጠጴፀፇፓጽፁጴጹጲፃፅፁጽፔጵጹጴፁፇፗጽፅፅጵጢፃ\u135c\u135fጵጼጟጨፅፁፃጹፂፐ\u135b\u135bጤፃፄፁ朧朝漳ፓጟጠጴፀፚጹጽፅጴጠጣፃጟፅ";
		text += "ፂፁፚጠጥፈጢ\u135bጾፅጴፚጟፃፄፅፉፓጟጠጴፀፇፓጽፁፄፅጣፃፇ\u135fጶፁፚጤጥፂፚጹጿፅጴጵጥፃፄፁ朧朝漳ጼጟጠጴፉጴፉጽፁጶ፣ጢፃፄፁ朧朝漳ፓጟጠጴፄፃጽጽፐ\u135cፗጳፃፄፁፁፓጟጠጴፈጢፓጽፐ\u135cፓጣፃ\u135d\u135f朧朝漳ፓጟጠጴፀፇፓፁፅጴፚጟፃፅፅፁፓጟጠጴፀፇፓጽፁጵ";
		text += "\u135bጤፃ\u135c\u135fፙፔፅጴ፦ፄፇፓጽፔፚጵጢፃ\u135d\u135f朧朝漳ፔፄጨጴፁፚፅጽፁጴጵጢፃፄፁ朧朝漳ጼፚጠ፠ፆፇ\u135bጿፁጴፅጢፃፄፁ朧朝漳ፓጟጠጴፀፚጹፂፁፅጹጵፃጟፁ朧朝漳ፔፄጠጴፀፇፓጽፁጶጽጤፄፃ朧朝漳ፁፓጟጠጥፀፇፓጾፔፚጵጤፃጟፁጶፁፄጠጴፀፇፓጽፁጴጴ፨ፃፆ\u135fፉፔ";
		text += "ፄጨጴፆፇ\u135fጽፁጴጵጢፃፄፁጲፀፚጤጥፂፃጽፂፐፚጵጤፃፄፁ朧朝漳ጼጟጠጴፂፃፁጽፁፄጠጢፃፄፁ朧朝漳ፓጟጠጵፁፇፗጽፔፚፄጠፃ\u135d\u135fጺፀፚጨፄፀፇ\u135fጽፁጴጴ፩ፃፄፁፚፁፚጠጴፐጢፓጽፁጴጵጢፃፄፁፁጼጟጠ፡ፁፃጵጽፁጵጵጢፃፄፁፙፓጟጠፄፁፇፗጿፅጶጽጥፃፄ";
		text += "ፁፙፓጟጠጴፀፇፓጽፁፄፄ፨ፄ\u135c\u135fፁፔፚጠጴፀፇፓጽፁጴጹጲፃፆ\u135f\u135dጼጵጹጴፀፇፓጽፁጴጵጢፄፅፁጹጽጴጠፅፄፇፓጽፁጴጵጢፃፄፁፉፔፄጤ፠ፂፇፓፂፁጴጵጢፃ\u135d\u135f朧朝漳ፓጟጠጴፀፇ\u135bጿፁጵፅጣፃፄፁ朧朝漳ፓጟጠጴፀፚጹጽፅጴፅጣፃጠፁጵፔጴጠፄፉጢ\u135bጿፁጵፚ";
		text += "፦ፃፄፁ朧朝漳ፓጟጠጴፀፚጹጽፅጴፅጣፃጠፁፙፔፅጹ፡ፂፇፓጽፅጴጵጢፃ\u135d\u135f朧朝漳ፔፄጨጴፉጢ\u135fጽፁጴጵጢፃፄፁጲፀፚጠ፠ፆፚፅፂፅጴጠጥፃፆ\u135fፅፔፄጨጴፀፚፓጽፁጴጵጢፃፄፁጲፀፚጠፄፃፇፗፂፐ\u135cጽጤፄፅፁ፡ፓጟጠጥፀፇፓጾፔፚጴ፩ፄ\u135bፁ朧朝漳ጽፄጠጴፀፇ";
		text += "ፓጽፁጴጴ፦ፃ\u135d\u135fጺፀጠጹ፠ፀፃ朧朝漳ጽፁጴጴ፩ፃፄፁጵፔጴጠፅፆፃጹፂፐ\u135bፚ፧ፃፄፁ朧朝漳ፓጟጠጴፀፚጹጽፐ\u135cፒ፦ፄፚፁ朧朝漳ፓጟጠጴፀፇፓፁፅጴፚጟፃፅፅፁፓጟጠጴፀፇፓጽፁጵ\u135bጤፃ\u135c\u135fጹጽጴጠፄፀፇፓጽፁጴጵጢፃፄፅጶፁፅጹጴፄፇፗጽፁጴ\u135bጢፃፄፁ朧朝";
		text += "漳ፓጟጠ፠ፉጢፗጾፔፚጵጢፃፄፁ朧朝漳ፓጟጤ፡ፄፚፅጽፔ\u135cጽጢፃፆ\u135f朧朝漳ፓጟጠጴፀፇፗጽፅጴፚ፧ፃ\u135d\u135fጺፁፅጵ፠ፀፃ朧朝漳ጽፁጴጴ፩ፃፄፁጵጼፚጠ፠ፉ፩朧朝漳ጾፅጴጵጢፃፄፁ朧朝漳ፓጠጵፄፁፃጹጾፁጴጹጳፄ\u135c\u135f朧朝漳ፓጟጠጴፀፇፓጽፁጶፁጶፃፅፁ\u135dፓጟጠጴ";
		text += "ፀፇፓጽፁጵጵጤፄፚፁፅጼፄጤጥፂፚፉጽፅጴጴ፦ፃፄፁ朧朝漳ጼጟጠጴፂፃፁጽፅፅጵጢፃፄፁ朧朝漳ፓጟጠጴፆፇ\u135bጾፐፚፄ፨ፃፅፁጽፔፄጠጴፂፚጽጽፅጴጵጣፃፅፁጹፓጟጠፄፉጴፅጾፐፚፅጥፃፆ\u135f朧朝漳ፔፄጠጵፅፃፁጽፁጴጠጢፃፄፁ朧朝漳ፓጟጠ፠ፉ፩ጵጽፅጴጵጢፃ";
		text += "ፄፁ朧朝漳ፓጠጵፄፉጴፉጽፅጶፓጢፃፄፁ朧朝漳ፓጟጠጴፄፇፗጾፁፅ\u135fጶፃፄፁጵፔጴጤ፡ፆፚፉጽፁጴፅጣፃፅፁጹፓጟጠፅፆፇፗጾፁፅ\u135fጶፃፄፁጵጼፚጠጴፉጴፉጽፅጴ\u135bጢፃፄፁ朧朝漳ፓጟጠጴፄፇፗጾፐጠ\u135fጶፃፄፁጵጼፚጠጴፂፚፁፂፁጴጟ፩ፄ\u135bፁጵጽጴጠጴፀፇፓጽ";
