		text += "ፚጠጴፀፇፓጽፁጴጵጣፃፅፁጽፔፄጨጴፁፇፗጽፐ\u135cፓጣፃ\u135c\u135f朧朝漳ፔፅጵፄፂፇፗጽፅጴፚጟፃፅፁጽፔፚጠጥፁፇፗጽፔፚጠጣፃፚፁጵጼጴጠፄፈ፩ፁፂፁጴጟጟፃፄፁ朧朝漳ፓጟጠጴፀፇፗጽፅጴጠጥፃፚፁጵፔጴጠጥፄፇፗጾፐፚፄ፩ፃጠፅጽፔጴጠፄፃፃ朧朝漳ጽፅጶጽጤ";
		text += "ፃጟፁፉጽጴጠጴፀፇፓጽፁጴጹጲፃፆ\u135fፉፔጴጠፄፃፃ朧朝漳ጽፅጵፚጠፃፄፁጽጽፅጹ፠ፁፇፓጽፁጴጵጢፃፄፁ朧朝漳ፔጴጠፄፃፇ\u135fጽፅጵፚጠፄፅፁጹጽጴጠፄፂፇፓጽፁጴጵጢፃፄፅጶፁፄጠጴፀፇፗጽፁጴጵጢፃፄፁጶፀጟጠ፠ፉ፩ፁጾፁጴጵጢፃፄፁ朧朝漳ፓጠጵፄፂፃፁ";
		text += "ጿፁጵፅጢፃፄፁ朧朝漳ፓጟጠጵፁፃጽጾፁጴጵጣፃፄፁ朧朝漳ፓጟጠጴፁፚጽጽፅጴጵጢፃፄፅፂፁፄጤ፠ፅፇፓጽፅጴጵጢፃፄፁ朧朝漳ፔጴጠፄፂፃጵጾፔፚ\u135fጶፃፅፁ朧朝漳ጼጴጠጴፀፃጽጽፁጴፄ፨ፃፆ\u135f\u135dጼጴጤፄፀፇፓጽፁጴጵጢፄፅፁጵጼፚጤጴፀፚጽፁፅጴጵጢፃፄፁ朧";
		text += "朝漳ፓጟጠጴፈጢ\u135fጽፁጶ፣ጢፃፄፁ朧朝漳ፓጟጠጵፁፇፗጽፔፚ\u135bጤፃፄፁፉፔጴጤ፠ፑጴጹጾጼጵፅጢፃጠፁ朧朝漳ፓጟጠጴፀፇፓጾፁጴፚጟፃፄፅጽፓጟጠጴፀፇፓጽፁፄፄ፨ፄ\u135c\u135fጹጽጴጠጴፀፇፓጽፁጴጹጲፃፅፁጽፔፄጠፄፁፇፗጽፐፚ\u135bጢፃፆ\u135fጵፔጴጠ፠ፁፇፓጽፐ\u135cፗ";
		text += "ጶፄፆ\u135fፙፔጴጠፄፂፇፗፂፁፄፄ፨ፄ\u135c\u135fፆፁጟጠጴፀፇፓጽፁጴጹጲፃፅፁጵፔፄጠ፠ፆፚፓጾፐፚጵጢፃፄፁ朧朝漳ፓጟጠጵፁፇ\u135bጿፁጴፅጢፃፄፁ朧朝漳ፓጟጠጴፀፃጹጾፔፚ\u135bጥፃጠፁ朧朝漳ጼጴጠጴፀፃጽጽፁጴፚጟፃፅፁፁፓጟጠጴፀፇፓጽፁጵ\u135bጤፃጟፁጵፔፄጠጴፀፇ";
		text += "ፓጽፁጴጹጲፃጟፁ朧朝漳ፔጴጨጴፀፇፓጽፁጴጵጢፃፚፁፚፁፚጠፄፉጢፓጽፁጴጵጢፃፄፁፁፔጴጤጴፈጢ\u135bፂፐፚፅጢፃፚፁ朧朝漳ፓጟጤጥፀፇፗጾፔ\u135cፗጵፃፄፁጽፓጟጠጴፀፇፓጽፁጴፅጣፃፇ\u135fጽፔፚጠፄፁፇ\u135fጽፔፚፄ፨ፃፙ朧朝漳ፅፓጟጤጥፀፇፓጽፁጴጵጢፃፚፅጵፔ";
		text += "ፄጠፄፁፇ\u135fጽፔፚፄ፦ፃፅፁፁፔፄጨጴፆፃጽጽፁጴጵጢፃፄፁጲፀፚጣ፦ፅፇፗጿፁጴጵጢፃፄፁ朧朝漳ፓጟጤጴፁፃ朧朝漳ጾፔፚ\u135fጷፃ\u135bፁ朧朝漳ጼጴጠጴፀፃጽጽፁጴፄ፩ፃጟፅፁፓጟጠጥፀፇፓጽፁጴጵጢፃፅፁጵፔፚጠጥፃፇፗጽፅጴጠጥፃፅፁፉጼጠጹፄፀፃፁጽፁጴጵጢ";
		text += "ፃፄፁ朧朝漳ጼጵጵፄፂፇፗጽፅጴጠጥፃፅፁፁፔጴጤጴፂፃፁጾፐ\u135cጽጢፃፄፁ朧朝漳ፓጟጠጵፁፃጽፂፅጴፄጟፃፄፁ朧朝漳ፓጟጠጴፀፃ朧朝漳ጽፅጵጴ፩ፃፆ፣ፉጽፄጠጴፄፇፓጽፁጶጽጢፃፅፁፙጽጵጹጴፀፇ\u135fጽፁጴጵጢፃፄፁ朧朝漳ፔጴጠፄፃፇ\u135fጽፔፚፅጣፃፇ\u135fጽፔጴጤ";
		text += "፠ፉጴፉጽፅጵጵጢፃፄፁ朧朝漳ፓጟጠጴፄፚጹጽፐፚፅጣፃፇ\u135fጽፔጴጤጴፁፃ朧朝漳ጽፐ\u135cፒ፨ፃ\u135d\u135f朧朝漳ፓጟጠጴፀፇፓፁፅፅጹጵፃጠፁጽፓጟጠጴፀፇፓጽፁጴጵጤፃ\u135bፁጹጽጴጠጵፆፇፓጽፁጴጵጢፃፄፅጵፔጴጠጥፂፇ\u135fጽፁጵፚጟፄ\u135bፅጹጼጟጠፄፆፇ\u135fጽፅጴ\u135fጳፃፄ";
		text += "ፁፉፔጴጤ፠ፑጴጹጾፔፚ\u135fጵፄፆ\u135f朧朝漳ጼጴጠጴፀፃጽጽፁጴፄ፨ፃፆ\u135f\u135dጼጴጤፄፀፇፓጽፁጴጵጢፄፅፁጵጼ\u135bጹ፡ፅፇፓጽፅጴጴ፨ፃፅፁፉጽፅጵፄፈጢ\u135bፂፅጴፅጢፃፚፁ朧朝漳ፓጟጤጥፀፇፗጾፐፚፚጟፃፚፁፅፓጟጠጴፀፇፓጽፁፄፅጣፃ\u135c፣ፐፁፚጠጴፁፃጹጽፁጴ\u135f";
		text += "ጴፃፄፁፉፔጴጤጴፉጢፓጽፅጶፓጢፃፄፁ朧朝漳ፓጟጠጴፄፇፗፁፐ\u135cፗጵፃፅፁጵፓጟጠጴፀፇፓጽፁጴፅጣፃፇ\u135fጹጼጟጠፄፁፇ\u135bጾፔፚፄ፨ፃ\u135d\u135fጺፁጠጹጴፀፃ朧朝漳ጽፁጴጴ፩ፃፄፅጵፔፄጠፄፁፇ\u135bጾፔፚፄ፩ፃፙ朧朝漳ፅፓጟጨፄፀፇፓጽፁጴጵጢፃፚፅጵፔፄጠፄፁፇ";
		text += "\u135bጾፔፚፄጟፃፄፁፉፔጴጤ፠ፑጴጹፁፅጴ\u135bጣፃፅፁጹጼጟጠፄፐ፩ጽፂፅጴጴጠፃፄፁ朧朝漳ፓጟጠጴፀፃ朧朝漳ፁፅጴ\u135bጣፃፅፁጹጼጟጠፅፁፇፗጽፅጴ\u135bጥፃ\u135c፣ፉጼፚጤፄፀፇፓጽፁጴጵጢፄፅፅጵፔፄጠፄፁፇ\u135bጾፔፚፚጟፃ\u135bፅጵፓጟጠጴፀፇፓጽፁፄፅጤፃጟፁጶፁፄጠ";
		text += "ጴፀፇፓጽፁጴጴ፨ፃፆ\u135fፐፁፅጹፄፀፚፓጽፐ\u135bፅጤፃጟፁጲፁጟጠጴፀፇፓጽፁጴጹጲፃፅፁጽፔፄጤጴፂፃፁጽፅጴጵጢፃፄፁ朧朝漳ፓጟጠጵፁፚፅፂፅጴጵጢፃፆ\u135f\u135dፔጴጠጴፀፇፓጽፁጴጵጢፄፅፅፂፁፚጠጴፀፇ\u135bፁፅጵጵጣፄፚፅጽፓጟጠጴፀፇፓጽፁጴጵጢፃፄፁ朧朝漳";
		text += "ፓጟጠጴፀፃ朧朝漳ጾፔፚጵጣፃፄፁ朧朝漳ፓጟጠጴፄፇ\u135bጽፁጴጵጢፃፄፁ朧朝漳ፓጟጨጴፐጢፓጽፅጴጵጢፃፄፁ朧朝漳ፔፚጤጥፀፇፓጽፁጴጵጢፃፄፁጲፁፄጠጴፀፇፓጽፁጴጵጣፃፄፁ朧朝漳ፓጟጠጴፀፇፓጽፁጴጹጴፃ\u135d\u135f朧朝漳ፔጴጠጴፀፇፓጽፁጴጹጵፃፄፁ朧朝漳ፓጟጠ";
		text += "ጴፀፇፓፂፁጵጵጢፃፅፁ朧朝漳ፓጟጠጴፀፇ\u135fጾፔፚጵጢፃፄፁ朧朝漳ፓጟጠጴፀፚፅጽፁጴጵጢፃፄፁ朧朝漳ፔጴጠጴፀፇፓጽፁጴጵጢፃፄፁ朧朝漳ፔፄጨፄፀፇ\u135bጽፁጴጵጢፃፄፁጽጽጴጠጴፀፇፓጽፁጴጵጢፃ\u135c\u135fጵፓጟጠ፠ፀፇፓጽፁጴጵጥፃፇ\u135f朧朝漳ፓጟጠጴፀፇፓጽፁጴ";
		text += "ጹጵፃፄፁ朧朝漳ፓጟጠጴፀፇፗጽፁጴጵጢፃፄፁ朧朝漳ፓጟጠጴፀፚፉጽፁጴጴ፨ፃፄፁ朧朝漳ፓጟጠጴፂፃፅጽፁጴጵጢፃፄፁ朧朝漳ፓጟጠጴፐጢፓጾፔፚጵጢፃፄፁ朧朝漳ፓጠጹ፠ፀፇፓጽፁጴጵጢፃፄፁጲፁፄጠጴፀፇፓጽፁጴጵጣፃፄፁ朧朝漳ፓጟጠጴፀፇፓጽፁጴጹጳፄፅፁ";
		text += "朧朝漳ጽጴጠጴፀፇፓጽፁጴጤጶፃፄፁ朧朝漳ፓጟጠጴፀፇፓፂፐ\u135cፓጢፃጟፁ朧朝漳ፓጟጠጴፀፇ\u135fጾፔፚጵጢፃፄፁ朧朝漳ፓጟጠጴፀፚፅጽፁጴጵጢፃፄፁ朧朝漳ፔጴጠጴፀፇፓጽፁጴጵጢፃፄፁ朧朝漳ፔፚጤ፠ፀፃፅጽፁጴጵጢፃፄፁጲፁፚጠጴፀፇፓጽፁጴጵጢፃፚፁፁፓጟጨፄ";
		text += "ፀፇፓጽፁጴጵጥፃ\u135d\u135f朧朝漳ፓጟጠጴፀፇፓጽፁጴጹጵፃፄፁ朧朝漳ፓጟጠጴፀፇፗጽፁጴጵጢፃፄፁ朧朝漳ፓጟጠጴፀፃፅጾፔፚጴጠፃፄፁ朧朝漳ፓጟጠጴፄፃፁጽፁጴጵጢፃፄፁ朧朝漳ፓጠጹጵፆፇፓጿፅጴጵጢፃፄፁ朧朝漳ፔፚጠጥፀፇፓጽፁጴጵጢፃፄፁጲፁፄጠጴፀፇፓጽፁ";
		text += "ጴጵጣፃፄፁ朧朝漳ፓጟጠጴፀፇፓጽፁጴጹጷፃጠፁጲፀጟጠጴፀፇፓጽፁጵጴ፦ፃፄፁ朧朝漳ፓጟጠጴፀፇፓጽጼጵጵጢፄፇ\u135f朧朝漳ፓጟጠጴፀፇፓፂፐፚጵጢፃፄፁ朧朝漳ፓጟጠጴፀፚፅጽፁጴጵጢፃፄፁ朧朝漳ፔጴጠጴፀፇፓጽፁጴጵጢፃፄፁ朧朝漳ፔጴጤጴፀፇፓጽፁጴጵጢፃፄ";
		text += "ፅጶፁጴጠጵፂፇፓጽፁጴጵጢፄፇ\u135f朧朝漳ፓጠጵ፠ፀፇፓጽፁጴጴጠፃፇ\u135f朧朝漳ፓጟጠጴፀፇፓጽፁጴጹጵፃፄፁ朧朝漳ፓጟጠጴፀፇፗጽፅጴጠጥፃፄፁ朧朝漳ፔፚጠጴፀፃ朧朝漳ጾፐፚጵጢፃፄፁ朧朝漳ፓጟጠጴፁፇፗጽፁጴጵጢፃፄፁጵፔጴጤጥፃፃፁጾፐፚጵጢፃፄፁ朧朝漳ፓ";
		text += "ጠጵፄፀፚጽጽፁጶጽጢፃፆ\u135fፐፁጟጨጴፈጢፓጽፁጴጵጢፃፄፅጵፔጴጠጴፀፇፓጾፔፚ\u135bጤፄ\u135c\u135f朧朝漳ፔጴጠጴፀፃጽጽፁጴጹጴፃፄፁጹፔጴጠጥፀፃጵጽፅጵ\u135bጣፃፇ\u135f朧朝漳ጼጴጠ፡ፂፇፗፂፐፚፅጣፃፄፁፅፔጴጠፄፀፃ朧朝漳ጿፅጴፅጢፄፚፁ朧朝漳ጽጴጠፄፂፇፓጽፔ\u135c";
		text += "ጽጤፃፄፁጽፓጟጤፄፀፇፓጾፔፚጵጤፃጟፁ\u135dጽጴጠጴፀፇፓጽፁጴጹጲፃፆ\u135f\u135dፓጠጵጥፀፇፓጽፁጴጵጢፄፅፁጲፁጴጠፄፁፇፓጾፁጴፄ፩ፄፚፁፉፔጴጠጥፀፃ朧朝漳ጽፅጴፅጢፃፚፁጵፔጴጠጴፅፃፁፂፅፄፚ፩ፃፇ\u135fጺፁፄጨፄፀፃፁጽፐጟፅጢፃፄፁ朧朝漳ፓጟጠፅፂፇ\u135f";
		text += "ጽፁጴጴ፦ፃፄፁ朧朝漳ፔፄጤ፠ፀፇፓጽፁጴጵጢፃፄፁ朧朝漳ፔጴጠጴፀፇፓጽፁጴፅጣፃፆ\u135f\u135dጽጴጨፄፀፇፓጽፁጴጵጢፄፅፁፐፁጟጨጵፁፇፓጽፁጴጵጢፃፄፅጵፔጵጹ፠ፁፚፅጽፁፅ\u135bጢፃፄፁጶፀፚጠ፠ፉጢፓጽፐፚጵጢፃፄፁ朧朝漳ፓጟጤ፠ፂፃጹፂፁፅፅጢፄ\u135bፁጹጼፄ";
		text += "ጠ፠ፉጢፓፂፐፚጵጢፃፄፁ朧朝漳ፓጠጵፄፀፚጹጽፐ\u135cፓጣፃፄፁ朧朝漳ፓጟጠጴፀፇፓፁፅፅጹጶፃፄፁ朧朝漳ፔፅጵፄፀፇፓጽፁጴጵጢፃፅፁጵፓጟጠጴፀፇፓጽፁጴጵጢፃፄፁ朧朝漳ፓጟጠጴፀፇፓጽፅጶጽጣፃ\u135d\u135f朧朝漳ፓጟጠጵፅፇፓፂፁጴጵጢፃፄፁ朧朝漳ፓጟጠፄፁፚጽ";
