		text += "朧朝漳ጼጟጠጴፂፃፁጽፁፄጠጢፃፄፁ朧朝漳ፓጟጠጵፁፇፗጽፔፚጴ፩ፃፅፁጹፓጟጤጥፂፃፁጽፁፅፅጢፃፄፁ朧朝漳ፓጟጠጴፆፇፓፁፐፚጴጟፃፄፁፙፔጴጤ፠ፀፃጽጿፁፅፉጳፃ\u135d\u135fፐፁጟጤፅፆፇፓጽፁጴጵጢፃፄፅጵፓጟጨጴፀፇ\u135bጽፅጵ\u135bጢፃፆ\u135f\u135eፁ\u135bጵ፠ፈ፩ጹፂፐ\u135b";
		text += "ፉጷፃፄፁ朧朝漳ፓጟጠጴፀፚጹጾጼጵፅጣፃፚፁ朧朝漳ፓጟጠጴፀፇፓጾፁጵ\u135fጷፃጟፅፁፓጟጠጴፀፇፓጽፁፄፅጢፃጟፁፐፁጟጤ፠ፀፇፓጽፁጴጵጢፃፄፅጵፔጴጤ፠ፀፃፁጾፐጠ\u135bጥፃፄፁ朧朝漳ፓጟጠጴፀፇፓፁፅፄፚ፩ፃፅፁፉጼ\u135bጹ፠ፐጴፉጽፁጴጵጢፃፄፁጲፀፚጠ፠ፆ";
		text += "ፚፅፂፅጵጵጢፃፅፁጵፓጟጤፄፂፃፁጿፁፅ\u135bጢፃፄፁ朧朝漳ፓጟጠጵፁፚፅፁጼጵጹጶፃፇ\u135fፉፔፄጤፄፂፃፁጽፁፅ\u135bጢፃፄፁ朧朝漳ፓጟጠጵፁፇፓፂፁጶፁጶፃፅፁጹፓጟጠጴፀፇፓጽፁጵጵጤፄፇ\u135fጵፓጟጠፄፆፃፁጽፁጴፅጤፃፄፁ朧朝漳ፓጟጠጴፀፃ朧朝漳ጾጼጵፅጣፃፚ";
