		text += "ጹጶፃፅፅጽፔፄጤፄፂፃፁጽፁፅ\u135bጢፃፄፁ朧朝漳ፓጟጠጵፁፇፓፁፔፚፚጟፃፅፁ朧朝漳ፓጟጠጴፀፇፓጽፁፄፉጵፄ\u135bፁጲፁፚጠ፠ፅፇ\u135bጿፁጴጹጷፃፄፁ朧朝漳ፓጟጠጴፀፚጹጽፁፅጵጤፃጟፁጵፓጟጠጴፀፇፓጽፁጴጹጲፄፚፅፅፓጟጠጴፈጢ\u135fጽፁጶ፣ጢፃፄፁ朧朝漳ፓጟጠ";
