		text += "ጠጴፀፇፓጾፁጴፚጟፃፙ朧朝漳ጽፓጟጠጴፀፇፓጽፁፄፄ፨ፄ\u135c\u135f፡ጼፚጠጴፀፇፓጽፁጴጹጲፃፅፁፙጽጴጠጴፁፇ\u135bጽፁጴጵጢፃፄፁ朧朝漳ጼጴጠ፠ፉጢፓፁፐፚጵጢፃፄፁ朧朝漳ፓጟጤ፠ፂፃፁጽፅፅጵጢፃፄፁ朧朝漳ፓጟጠጴፆፇ\u135bጾፐ\u135cጽጤፃፚፅጹፓጟጠፄፀፇፓጾፔፚጴ";
		text += "፩ፃፆ\u135fጺፁጟጠጴፁፇፓጽፁጶጽጢፃፆ\u135f\u135dፓጟጨፄፀፇፓጽፁጴጵጢፃ\u135c\u135fፙፔፄጠ፡ፆፇፓጽፅጴጵጢፃ\u135d\u135f朧朝漳ፔጴጤ፠ፂፃፁጽፅጵ\u135bጢፃፄፁ朧朝漳ፓጟጠጵፁፇ\u135bፁፔፚፉጲፃፅፁጵፓጟጤጴፉጴፓጽፁጴፅጢፃፄፁ朧朝漳ፓጟጠጴፄፇ\u135bጿፁጴጹጵፃፄፁ朧朝漳ፓጟጠጴ";
		text += "ፀፃጹጾፔፚ\u135bጢፄፚፁ朧朝漳ጼፄጠጴፀፃጽጽፁጴፚጟፃፅፁፙፓጟጠጴፀፇፓጽፁፄፅጣፃፇ\u135f朧朝漳ጼጴጠ፡ፂፇ\u135bፁፐፚፅጣፃፄፁፁጼጟጠ፠ፄፚጽጽፁጴፅጢፃፄፁፙፓጟጤጥፂፇ\u135bፂፐፚጵጣፃፄፁ朧朝漳ጼጟጠጴፂፃፁጽፁጶ፣ጢፃፄፁ朧朝漳ፓጟጠጴፆፇ\u135bጿፁጴፄጟፃ";
		text += "ፄፁ朧朝漳ፓጟጠጴፀፚጹጽፅጴጠጢፃጟፁጵፔፄጠጴፉጢ\u135bጿፁጴጹጵፃፄፁ朧朝漳ፓጟጠጴፀፃጹጾፔፚ\u135bጢፄፚፁ朧朝漳ጼፄጠጴፀፃጽጽፁጴፚጟፃፅፁፙፓጟጠጴፀፇፓጽፁፄፅጣፃፇ\u135f朧朝漳ጼጴጠፅፂፃፁፂፁጴፅጣፃፄፁ朧朝漳ፓጟጠጴፀፇፗጽፅጴጠጢፃጠፁጵፔጴጠጴ";
		text += "ፐጢፗጾፐፚፅጣፃፄፁፂፀፚጠ፠ፁፇፗጽፁጶ፣ጣፃ\u135d\u135fፚፁፚጠጴፈጢፓጽፁጴጵጢፃፄፁፂፀፚጠ፠ፁፇፗጽፁጶ፣ጣፃጟፁፙፔፄጠፄፃፇፓጾፅጴጵጢፃ\u135d\u135fጲፀፚጠ፠ፁፇፗጽፁጶ፣ጣፃጠፁፚፁፚጠጴፉጢፓጽፁጴጵጢፃፄፁፂፀፚጠ፠ፁፇፗጽፁጶ፣ጣፄፅፁፙፔፄጠጵፄ";
		text += "ፇፓጾፅጴጵጢፃ\u135d\u135fጲፀፚጠ፠ፁፇፗጽፁጶ፣ጤፃጟፁፆፀፚጠጴፀፇፓጽፁጴጹጲፃፅፁጽፓጟጤጴፁፇፗጽፁጵጴ፩ፄ\u135bፁ朧朝漳ጼፄጠጴፀፇፓጽፁጴጴ፦ፃ\u135d\u135fጹፓጠጹጴፀፃጵጽፁጴጴ፩ፃፄፁጹጽጴጠፄፈጢፓጽፁጴጵጢፃፄፅጵፔጴጠጥፀፃ朧朝漳ጽፅጴፅጢፃፚፁፚፁፚ";
		text += "ጠጴፄፇፓጽፁጴጵጢፃፄፁፁጼጟጠ፠ፀፚፅጽፁጵፅጢፃፄፁፙፓጟጠ፠ፉጢፗጾፔፚጵጢፃፄፁ朧朝漳ፓጠጵፄፁፇ\u135fጽፁጵጵጣፃፅፁ朧朝漳ጼጴጣ፦ፅፇፓፁፐፚጵጢፃፄፁ朧朝漳ፓጟጤጴፂፃፁጿፅጶጽጢፃፄፁ朧朝漳ፓጟጠጵፁፃጽጽፐፚጹጵፃፄፁፅፓጟጠጴፈጢፓጽፐ\u135cፓ";
		text += "ጣፃ\u135d\u135f朧朝漳ፓጟጠጴፀፇፓፁፅጴፅጥፃፄፁፁፔጴጠፄፀፃ朧朝漳ጾጼጵፅጢፄፇ\u135f朧朝漳ፓጟጠጴፀፇፓጾፁጴፚጟፃጠፁፙፓጟጠጴፀፇፓጽፁፄፄ፩ፃፆ\u135fጲፁፄጠጴፅፇፓጽፁጶጽጢፃፆ\u135f\u135dፔጴጤጥፀፇፓጽፁጴጵጢፄፅፁጵፔፚጠጴፄፇፗጽፅጴጴ፦ፃፙ朧朝漳ፅፓጠጹጴ";
		text += "ፀፇፓጽፁጴጵጢፃፚፁጹጽጴጨፄፈጢፓጽፁጴጵጢፃፄፅጵጼጟጠ፠ፀፚፅጽፁጵፅጢፃፄፁፙፓጟጠ፠ፉጢፗጾፔፚጵጢፃፄፁ朧朝漳ፓጠጵፄፁፇ\u135fጽፁጵጵጣፃፅፁ朧朝漳ጼጴጣ፦ፅፇፓፁፅጴጵጢፃፄፁ朧朝漳ፓጟጤጴፂፃፁጿፅጶጽጢፃፄፁ朧朝漳ፓጟጠጵፁፇ\u135bጿፁጴጹጴፃ";
		text += "ፄፁ朧朝漳ፓጟጠጴፀፚጹጽፅጴጠጢፃፚፁፙፔፄጠፄፈጢፓጾፅጴጵጢፃ\u135d\u135f朧朝漳ጼጠጹፄፀፃፅጽፁጴጵጢፃፄፁ朧朝漳ጼጴጠፄፂፇፓጾፁጴፚጟፃፄፅጽፓጟጠጴፀፇፓጽፁጵ\u135bጤፃጟፁጵጼጟጠጴፀፇፓጽፁጴጹጲፃፆ\u135f\u135dፔጵጹጴፀፇፓጽፁጴጵጢፃ\u135c\u135fጹጼ\u135bጹጵፅፇ\u135bፁ";
		text += "ፔፚፚ፧ፃፆ\u135f\u135dፓጠጹ፠ፀፇፓጽፁጴጵጢፄፅፁጵፔፚጠጴፅፇ\u135bጿፁጴፅጢፃፄፁ朧朝漳ፓጟጠጴፀፚጹፂፁፅፅጣፄፚፁጹጼፄጠ፠ፉጢፓፂፐፚጵጢፃፄፁ朧朝漳ፓጠጵፄፁፇ\u135fጽፁጵ\u135bጣፃ\u135c\u135f\u135dፓጟጠፄፂፇፓጽፁጴጵጢፃፄፁፁፔፄጨጴፁፇፓጽፁጴጵጢፃፄፁጲፀ\u135bጹጵፅ";
		text += "ፇፓጿፁጴፅጣፃፄፁፙፔፄጨጴፐጴፓጽፁጴጵጢፃፄፁጲፀ\u135bጹጵፃፃጽፂፅጴፅጤፃፄፁ朧朝漳ፓጟጠጴፀፃ朧朝漳ጽፐጟፅጢፃፄፁ朧朝漳ፓጟጤጴፁፃፅጾፁጴጵጢፃፄፁ朧朝漳ፓጟጠጴፀፇፓጽፁጴጵጢፃፄፁጹጼፄጠጴፀፇፓጽፁጴጵጢፃፅፁጹፓጟጠጴፀፇፓጽፁጴጵጥፃ\u135d";
		text += "\u135f朧朝漳ፓጟጠጴፀፇፓጽፁጴጹጶፃፄፁ朧朝漳ፓጟጠጴፀፇፓጽፁፅጵጢፃፄፁ朧朝漳ፓጟጠጴፁፇፓጽፁጴጵጢፃፄፁ朧朝漳ፓጟጠጴፄፃጵጽፁጴጵጢፃፄፁ朧朝漳ፓጟጠጵፃፇፓጽፁጴጵጢፃፄፁ朧朝漳ጼፄጠፄፀፇፓጽፁጴጵጢፃፄፁጲፁፚጠጴፀፇፓጽፁጴጵጢፃፄፅፁፓጟጠ";
		text += "ጴፀፇፓጽፁጴፅጢፃፄፁ朧朝漳ፓጟጠጴፀፇፓጽፁጴፉጶፃፄፁ朧朝漳ፓጟጠጴፀፇፓጾፁጴፅጢፃፄፁ朧朝漳ፓጟጠጴፀፃጵፂፐፚጵጢፃፄፁ朧朝漳ፓጟጠጴፀፚፉጽፁጴጵጢፃፄፁ朧朝漳ፓጟጠጵፄፇፓጽፁጴጵጢፃፄፁጵፓጟጠጴፀፇፓጽፁጴጵጢፃፄፅፉፔጴጠጴፀፇፓጽፁጴ";
		text += "ጵጢፃፃ朧朝漳ጹፓጟጠፄፀፇፓጽፁጴጵጤፄፇ\u135f朧朝漳ፔፄጠጴፀፇፓጽፁጴጹጷፃፄፁ朧朝漳ፓጟጠጴፀፇፓጽፁፅጵጢፃፄፁ朧朝漳ፓጟጠጴፁፇፓጽፁጴጵጢፃፄፁ朧朝漳ፓጟጠጴፆፚፅጽፁጴጵጢፃፄፁ朧朝漳ፓጠጴ፦ፅፇፓጽፅጴጵጢፃፄፁ朧朝漳ፔ\u135bጵ፠ፀፇ\u135bጽፁጴጵጢፃ";
		text += "ፄፁጵጼፄጠጴፀፇፓጽፁጴጵጢፃፄፅፁፓጟጠጴፀፇፓጽፁጴፅጢፃፆ\u135f朧朝漳ፓጟጠጴፀፇፓጽፁጴፉጶፃፄፁ朧朝漳ፓጟጠጴፀፇፓጽፔፚ\u135bጢፃፆ\u135f朧朝漳ፓጟጠጴፀፃጵጽፁጴጵጤፃፄፁ朧朝漳ፓጟጠጴፀፃፁጽፁጴጵጢፃፄፁ朧朝漳ፓጟጠጴፀፇፓጽፁጴጵጢፃፄፁ朧朝漳ፔጵ";
		text += "ጵ፠ፃፇፓጽፁጶፓጢፃፄፁጵጼፄጠጴፂፇፓጽፁጴጵጢፃፅፁፅፓጟጠጴፀፇፓጽፅጴፄ፩ፃፆ\u135fጺፁጟጠጴፁፇፓጽፁጶጽጢፃጟፁ朧朝漳ፔጴጤጥፀፇፓጽፁጴጵጢፃፚፁፚፁፚጠፄፄፇፓጽፁጴጵጢፃፄፁፁፔፅጹጴፀፃጵጽፔ\u135cፗጲፄፆ\u135f朧朝漳ፔጴጠጴፀፇፓጽፁጴፄ፧ፃ\u135c፣";
		text += "ጵፓጠጵፄፁፃጹጽፁፄ\u135bጢፃ\u135d\u135fጵጼጠጹጴፆፇፓፁፐፚጴ፩ፃፅፅፉፓጠጵፄፃፇ\u135fጽፁጶፓጣፃ\u135c\u135fጲፀጟጠፄፈጢ\u135bጿፁጵፅጣፃፄፁ朧朝漳ፓጟጠጴፀፚጹጾጼጵፅጣፃፆ\u135f朧朝漳ፓጟጠጴፀፇፓጾፁጴ\u135fጵፃፄፁፆፁፅጹጴፉ፩ፅጽፁጴፅጢፃፄፁ朧朝漳ፓጟጣ፦ፅፇፗጾፁጴ";
		text += "ጵጢፃፄፁ朧朝漳ፓጟጤጴፆፚፓጿፅጶፓጢፃፄፁ朧朝漳ፓጟጠጵፁፇፗጾፔፚ\u135fጷፃፅፁጹጼጠጹፄፁፃ朧朝漳ጽፁጴጵጢፃፄፁ朧朝漳ጼጴጤ፡ፆፃፁፂፁጴጵጢፃፄፁ朧朝漳ፓጠጵፄፁፃጵጽፅጵፚ፨ፄ\u135c\u135f፡ጽፄጠጴፀፇፓጽፁጴጹጲፃፆ\u135fፉጼጠጹፄፁፃ朧朝漳ጽፁጴጵጢፃፄፁ";
		text += "朧朝漳ጼጴጤ፡ፆፃፅጿፁጴጵጢፃፄፁ朧朝漳ፓጠጵፄፁፃጹፂፐጠፅጢፃፇ\u135fጽጽፄጤጴፈጢፓጽፅጴጵጢፃፄፁ朧朝漳ፓጟጤ፠ፁፃጵጾፐጟፅጥፃፇ\u135fፙጼጟጤጥፂፇ\u135bፂፐፚጵጣፃፄፁ朧朝漳ጼጟጠጴፀፚፅጾጼጵፅጣፃፚፁ朧朝漳ፓጟጠጴፀፇፓጾፁጵ\u135fጷፃጠፅጵፓጟጠጴፀፇ";
		text += "ፓጽፁፄፄ፨ፄ\u135c\u135f።ፀጟጠጴፀፇፓጽፁጴጹጲፃፄፅጽፓጟጨጴፁፃጵጽፔፚጠጢፃ\u135bፅፂፁፄጠጥፄፇፓጽፅጴጵጢፃፄፁ朧朝漳ፓጟጨጴፁፃጹጽፔፚጠጥፃፆ\u135f朧朝漳ጽፄጠ፠ፉ፩ፅፁፔፚጵጢፃፄፁ朧朝漳ፓጠጵፄፀፚጹጾፔፚ\u135bጤፄ\u135c\u135f朧朝漳ፔጴጠጴፀፃጽጽፁጴጹጵፃፄፁ";
		text += "ፉፔጴጤ፠ፆፚጹጽፔፚጠጢፄ\u135bፁፙፔፄጠ፡ፆፇፓጽፅጴጵጢፃ\u135d\u135f朧朝漳ፔፄጨጴፁፚፅጽፁጴጵጢፃፄፁ朧朝漳ጼፚጠ፠ፆፇፗጾፅጵ\u135fጲፃፄፅጵጼጠጹፄፁፃ朧朝漳ጽፁጴጵጢፃፄፁ朧朝漳ጼጴጤ፡ፆፃፅጿፁጴጵጢፃፄፁ朧朝漳ፓጠጵፄፁፃጹጽጼጵፄ፧ፄፅፅፐፁጠጹ፡ፆፚ";
		text += "ፓፂፐፚ\u135fጳፃጠፁፁፓጟጨፄፀፃፁጽፐ\u135cፒጠፄፚፁ朧朝漳ፓጟጠጴፀፇፓፁፅጴፅጥፃፄፁ፡ፔጴጠ፠ፀፃፅጽፐ\u135cፒጠፄ\u135bፁ朧朝漳ፓጟጠጴፀፇፓፁፅጴፚጟፃፙ朧朝漳ጽፓጟጠጴፀፇፓጽፁፄፅጤፃጟፁፉጼፚጠጴፀፇፓጽፁጴጹጲፃፆ\u135f\u135dፓጠጵጥፀፇፓጽፁጴጵጢፄፅፁጲፁ";
		text += "ፄጠ፡ፂፃፁፂፐ\u135cፁጶፃፅፁፁፓጟጠጴፀፇፓጽፁጵጴ፨ፄ\u135c\u135f፡ጽጴጠጴፀፇፓጽፁጴጹጲፃፅፁፚፁፄጤ፠ፐጴፅጽፁፄጠጢፃፄፁ朧朝漳ፓጟጠጴፁፃፁጽፁጴፄ፨ፃፄፁ朧朝漳ፓጟጠጴፀፃ朧朝漳ጽፁጵፚ፩ፄ\u135bፁጵጼፄጠጴፀፇፓጽፁጴጴ፦ፃ\u135c፣ፉፔፚጠጴፀፇፓጽፁጴጵጢ";
		text += "ፄፅፅፂፀፚጠፄፃፇፓጾፅጶፁጶፃፅፁፉፓጟጠጴፀፇፓጽፁጵጴጟፄ\u135bፅጹጼጟጤ፡ፁፇፗጽፅጴጴ፧ፃፇ\u135fጵፔጴጠ፠ፁፇፗጽፁጵፅጣፃ\u135d\u135fፐፀ\u135bጹጵፁፚጽጾፔፚፄ፩ፄፚፁፉጽጵጹጴፀፚፁጽፁጴጵጢፃፄፁ朧朝漳ፔጴጨጴፀፇፗጾፐፚጵጢፃፄፁ朧朝漳ፓጟጤጴፉጴፉጽፅ";
		text += "ጵጵጢፃፄፁ朧朝漳ፓጟጠጴፄፃጹፂፐ\u135cፗጵፃፄፁ朧朝漳ፓጟጠጴፀፚጹጾጼጵፅጣፃ\u135c\u135f朧朝漳ፓጟጠጴፀፇፓጾፁጴፄ፨ፃፙ朧朝漳ፅፔጴጤ፠ፀፇፓጽፁጴጵጢፃፚፁ\u135eፁ\u135bጵ፠ፈጢፗጾፐ\u135b\u135fጷፃጠፅፉፓጟጠጴፀፇፓጽፁፄፅጣፃፇ\u135f朧朝漳ጼጴጣ፦ፅፇፗጾፅጴጵጢፃፄፁ朧";
		text += "朝漳ፓጟጤጴፉጴፉጽፅጵ\u135bጢፃፄፁ朧朝漳ፓጟጠጴፄፇፗጾፐፚፅጣፃፄፁፁጼ\u135bጹ፠ፅፚፓጽፁጴጵጢፃፄፁጲፀፚጣ፦ፅፇፗጾፅጴጵጢፃፄፁ朧朝漳ፓጟጤጴፆፚፓጽፔፚጵጢፃፄፁ朧朝漳ፓጟጠጵፁፇፓጾፐፚጠጥፃፚፁፉፔጴጤፄፆፚጹጽፁፄፅጣፃፚፅፐፁፚጠጴፆፇ\u135bጽፅ";
		text += "ጴጵጢፃፄፁ朧朝漳ፓጟጤ፠ፈጢ\u135fፁፅጴጵጢፃፄፁ朧朝漳ፓጟጠጵፁፇፗጾፔ\u135cጽጥፄፅፁጵፓጟጠጴፀፇፓጽፁፄፅጣፃፇ\u135f朧朝漳ጼፚጠፄፁፇፓጾፐ\u135cፁጶፃፅፁፅፓጟጠጴፀፇፓጽፁጵጴ፨ፄ\u135c\u135fፉፓጟጠጴፀፇፓጽፁጴጹጲፃ\u135c፣ፐፀፚጠ፠ፀፇፓጽፁጴጵጢፄፅፁጵፔጴጠጴ";
		text += "ፆፇፗፂፐ\u135bፚ፦ፃ\u135c፣ፐፀፚጠጥፀፇፓጽፁጴጵጢፄፅፁጹጼፚጣ፦ፅፇፗጾፅጴጵጢፃፄፁ朧朝漳ፓጟጤጴፆፚፓጽፔ\u135bፅጢፃፄፁ朧朝漳ፓጟጠጵፁፃጽጽፔፚጴጠፃፄፁ朧朝漳ፓጟጠጴፀፚጹጿፁጴጵጣፃ\u135bፁ朧朝漳ፓጟጠጴፀፇፓጾፁጴጟጟፃ\u135c፣ጺፁጠጹፅፆፚፓፂፐጠ\u135fጵፄ";
		text += "\u135bፁጲፁጟጠ፠ፅፇ\u135bጿፁጴጹጷፃፄፁ朧朝漳ፓጟጠጴፀፚጹጽፅጴጠጢፃ\u135d\u135fጹጽጴጠፄፀፇፓጽፁጴጵጢፃፄፅጶፁፅጹፄፀፇፓጽፁጴጴ፩ፄ\u135bፁጵጽጴጠጴፀፇፓጽፁጴጴ፦ፃፆ፣ጽፔፄጠፄፉጴፉጽፅጶፓጢፃፄፁ朧朝漳ፓጟጠጴፄፇፗጾፁጶጽጤፃፅፅፉፓጟጤፄፀፇፓጾፔፚ";
		text += "ጵጣፃ\u135c\u135f\u135eፁፄጠጴፃፇፓጽፁጴጵጢፃፄፁጵፔጴጤጴፁፃ朧朝漳ጽፅጵጵጣፃ\u135d\u135fጹጽጴጤ፠ፉጢፓጽፁጴጵጢፃፄፅጵፔፄጤ፠ፁፃ朧朝漳ጿፁጴጵጣፃጟፁ朧朝漳ፓጟጠጴፀፇፓጾፁፅጹጶፃፄፅፉፔፄጤፄፂፃፁጽፁፅ\u135bጢፃፄፁ朧朝漳ፓጟጠጵፁፇፗጽፔፚጴጟፃፆ\u135f\u135dፔጴጠ";
		text += "ጴፀፇፓጽፁጴጵጢፄፅፅፂፁፚጠጴፀፇፗጾፐ\u135cፓጢፃፅፁጹፓጟጠጴፀፇፓጽፁጵጵጤፃጟፁጶፁፚጠጴፀፇፓጽፁጴጴ፨ፃፆ፣ፁፓጟጠ፠ፂፚጽፁፐ\u135cጽጣፃ\u135d\u135f\u135dፓጟጠፄፂፇፓጽፁጴጵጢፃፄፁፁፔፚጨጵፅፚጽፂፐጠጹጷፄ\u135c፣ፐፁጟጠጴፀፇፓጽፁጴጵጢፃፚፁጵፔፚጤጴ";
		text += "ፀፇፓጽፁጴጵጢፃፄፁ朧朝漳ፓጟጠጴፀፇፓጽፁጴፉጳፃፄፁ朧朝漳ፓጟጠጴፀፇፓጿፅጶጽጢፃፅፁ朧朝漳ፓጟጠጴፀፚጽጽፐፚጵጣፃፄፁ朧朝漳ፓጟጠጴፀፚፓጽፁጴጵጢፃፄፁ朧朝漳ፓጟጠጵፄፇፓጽፁጴጵጢፃፄፁጵፓጟጠጴፀፇፓጽፁጴጵጢፃፄፅጽፔፄጠጴፁፇፓጽፁጴጵ";
		text += "ጢፃፆ፣ጵፓጟጠጴፀፇፓጽፁጴጹጶፄፇ\u135f朧朝漳ፔጴጠጴፀፇፓጽፁጴጹጷፃፄፁ朧朝漳ፓጟጠጴፀፇፓጽፁፅጵጢፃፄፁ朧朝漳ፓጟጠጴፁፇፗፁፐፚጠጢፃፄፁፅፓጟጠጵፅፃፁጽፁጴ\u135bጢፃፄፁ朧朝漳ፓጟጠፄፆፇፓጽፁጴጵጢፃፅፁጵፔፄጨጵፁፃ朧朝漳ጽፁጴጵጢፃፄፁጲፀፚ";
		text += "ጠ፡ፃፇ\u135fጿፅጶፁጶፃፅፁ朧朝漳ፓጟጠጴፀፇፓጽፁጵጴ፨ፄ\u135c\u135fጲፀፚጠጴፀፇፓጽፁጴጹጲፃ\u135c፣ፉፓጠጵ፠ፀፇፓጽፁጴጵጢፄፅፁፙፔፄጠ፡ፂፇፓጾፅጴጵጢፃ\u135d\u135f朧朝漳ጼጟጠ፠ፉ፩ፅጽፁጴጠጢፃፄፁፙፓጟጤ፡ፆፃጵፁፐፚጵጢፃፄፁ朧朝漳ፓጠጵፅፄፚፉጽፁፅ\u135bጤፃ";
		text += "\u135bፁጹጽጴጠጵፆፇፓጽፁጴጵጢፃፄፅጵፔጴጠጥፀፃ朧朝漳ጽፐ\u135cፓጣፃፄፁ朧朝漳ፓጟጠጴፀፇፓፁፅፅጹጶፃፄፁ朧朝漳ፔፄጠጴፉ፩ፁጽፅጴጠጢፃፄፁ朧朝漳ፓጟጠ፠ፉ፩ጵጽፅጴጵጢፃፄፁ朧朝漳ፓጠጵፄፁፃጹጽፁፄ\u135bጣፃ\u135d\u135fፚፁፚጠጴፆፇፓጽፁጴጵጢፃፄፁፁፔጴጠ፠";
		text += "ፀፇፗጾፔፚጤጲፃ\u135bፁ朧朝漳ፓጟጠጴፀፇፓፁፅጶፓጢፃፄፁጽፓጟጠጴፀፇፓጽፁጵጵጢፃ\u135d\u135fጺፁፄጠጴፅፇ\u135bጿፁጵፅጢፃፄፁ朧朝漳ፓጟጠጴፀፚጹጽፐ\u135cፓጣፃጟፁ朧朝漳ፓጟጠጴፀፇፓጾፐ\u135cፁጶፃፄፅጹፓጟጠጴፀፇፓጽፁጵጵጤፄፚፁጹፔፚጣ፦ፅፇፓፂፅጴጵጢፃፄፁ";
		text += "朧朝漳ፓጟጤጴፆፚፓጾፁጴጠጢፃፄፁ朧朝漳ፓጟጠጵፁፃፁጽፁጴጴ፦ፃፄፁ朧朝漳ፓጟጠጴፀፃ朧朝漳ጾጼጵፅጢፄ\u135bፁ朧朝漳ፓጟጠጴፀፇፓጾፁጵ\u135fጷፃፚፁፉፓጟጠጴፀፇፓጽፁፄፄ፨ፄ\u135c\u135fፁጼጟጠጴፀፇፓጽፁጴጹጲፃጟፁ朧朝漳ፓጟጤፄፀፇፓጽፁጴጵጢፃፚፁጵጼጵጹ፡";
		text += "ፅፇፓጾፐፚፉጷፃፄፁ朧朝漳ፓጟጠጴፀፃጹጾፔፚጤጲፃ\u135c\u135f朧朝漳ፓጟጠጴፀፇፓፁፅጴፄ፩ፃ\u135d\u135fጾፀፚጤጥፀፇፓጽፁጴጵጢፄፅፁጲፁፄጠጴፐ፩ጹፂፐጟፄጟፃፄፁ朧朝漳ፓጟጠጴፀፚጹጾፔፚጠጤፃፇ\u135f朧朝漳ፓጟጠጴፀፇፓጾፐ\u135cፓጢፃፅፁጵፓጟጠጴፀፇፓጽፁጵጴ፩ፄ";
		text += "\u135bፁጵፔጴጠጴፀፇፓጽፁጴጴ፦ፃፆ\u135fፆፁጠጹፄፀፃጽጽፐጠጵጢፃፄፁ朧朝漳ፓጟጠጴፆፃጽጽጼጴፄ፨ፃፄፁ朧朝漳ፓጟጠጴፀፚጹጽፅጶጼ፩ፃፃ朧朝漳ጵጼጟጠጴፀፇፓጽፁጴጹጲፃፄፅፁፓጟጨፄፆፚፓፁፅጶፓጢፃፄፁ朧朝漳ፓጟጠጵፁፚፅፂፅጴጹጷፃፆ\u135fፅፔፄጨጴፀፚ";
		text += "ፓጽፁጴጵጢፃፄፁጲፀፚጠፄፃፇፓጾፅጴፚጟፃፅፁ朧朝漳ፓጟጠጴፀፇፓጽፁፄፉጵፄ\u135bፁ朧朝漳ፓጟጠፄፆፇፓፁፅጶጽጤፃፆ፣ፉፓጟጠፄፀፇፓጾፔፚጵጢፄፇ\u135fፚፁፚጠጵፁፇፓጽፁጴጵጢፃፄፁፁፔፅጵጥፂፃፁጽፅጵጹጷፄ\u135bፁ朧朝漳ጼፚጠ፠ፂፇፓጽፁጴጵጢፃፄፁፉጼ";
		text += "ጟጟ፦ፁፃፅጽፁጴጵጢፃፄፁጲፀፚጠ፠ፐጴጹፁፅጴጵጢፃፄፁ朧朝漳ፓጠጵፄፁፃጽጽፐ\u135cፓጣፄፆ\u135f朧朝漳ፓጟጠጴፀፇፓጾፐጠጹጶፃፄፅፉፔፄጤፄፂፃፁጽፁፅ\u135bጢፃፄፁ朧朝漳ፓጟጠጵፁፇፗጽፔፚጴ፨ፃፆ\u135f\u135dፔጴጠጴፀፇፓጽፁጴጵጢፄፅፅፂፁፚጠጴፀፇ\u135bጽፁፅፄጟ";
		text += "ፃፄፁጽፓጟጠጴፀፇፓጽፐ\u135cፒ፧ፃፅፁ朧朝漳ፓጟጠጴፀፇፓፁፅጶፁጶፃፅፁጹፓጟጠጴፀፇፓጽፁጵጵጤፄፚፁ朧朝漳ጼፚጤጥፂፇ\u135bፂፐፚጵጣፃፄፁ朧朝漳ጼጟጠጴፀፚፁጽፐ\u135cፗጲፄፆ\u135f朧朝漳ፓጟጠጴፀፇፓፁፅጴጴ፨ፃፅፁፚፁፄጤ፠ፀፚጹጽፁጵ\u135bጣፄፆ\u135fጽፔፚጠ፠ፅ";
		text += "ፇ\u135bጿፁጶፒጠፃፄፁ朧朝漳ፓጟጠጴፀፚጹጽፐፚጵጢፃፄፁ朧朝漳ጼጴጠጴፀፇፓጽፁጴፚጟፄፅፅጽፓጟጠጴፀፇፓጽፁፄፄ፨ፄ\u135c፣ጶፁፄጠጴፀፇፓጽፁጴጹጲፄፚፅፅፓጠጹ፠ፂፃጵጽፐ\u135cፓጢፄ\u135c\u135f朧朝漳ፓጟጠጴፀፇፓፁፅጴፅጥፃፄፁፙፔፄጨጴፁፇፓጽፁጴጵጢፃፄፁጲ";
		text += "ፀ\u135bጹጵፅፇፓጽፁጴጴ፨ፃፅፅፅፔፚጠ፠ፂፚፓጽፅጵ\u135bጢፄፅፁጹጽጴጠፄፂፇፓጽፁጴጵጢፃፄፁፉፔጴጠጥፀፃፁጽፁጶፓጣፃፅፁ朧朝漳ጽጴጠፄፆፇ\u135bጿፁጵጴ፧ፃፄፁ朧朝漳ፓጟጠጴፀፚጹጽፅጵ\u135bጤፄ\u135bፁጶፀፚጠፄፁፇፓጿፁጴጹጴፃ\u135d\u135fጹፔፚጠፄፀፃጵጽፁጴጴ፩ፃ";
		text += "ፄፁፚፁፚጠጴፐጢፓጽፁጴጵጢፃፄፁፁፔጴጠፄፀፃፁጽፐ\u135cፓጣፃ\u135d\u135f朧朝漳ፓጟጠጴፀፇፓፁፅጴፚጟፃፅፅፁፓጟጠጴፀፇፓጽፁጵ\u135bጤፃ\u135c\u135fፚፁፚጠጵፄፇፓጽፁጴጵጢፃፄፁፁፔፚጨፄፃፃፁጽፁጴፅጢፃፄፁ朧朝漳ፓጟጣ፦ፅፇፗጽፁጴጵጢፃፄፁ朧朝漳ፓጟጤጴፆፚፓጽ";
		text += "ፁፄፅጢፃፄፁ朧朝漳ፓጟጠጵፁፃጹፂፐፚጹጳፃፄፁ朧朝漳ፓጟጠጴፀፚጹጾጼጵፅጣፃፇ\u135f朧朝漳ፓጟጠጴፀፇፓጾፁጶጽጤፃፅፅፁፓጟጠ፠ፀፇፓጾፔፚጴ፩ፄ\u135bፁ朧朝漳ጼፚጠጴፀፇፓጽፁጴጴ፦ፃፆ\u135f\u135dፔጴጤጥፀፇፓጽፁጴጵጢፄፅፁፙፔፄጠ፡ፆፇፓጽፅጴጵጢፃ\u135d\u135f朧朝";
		text += "漳ጼ\u135bጹ፠ፁፇ\u135fጽፁጴጵጢፃፄፁጲፀፚጤጥፂፃጽፁፐፚጵጤፃፄፁ朧朝漳ጼጟጠጴፉጴፉጽፁፅፅጢፃፄፁ朧朝漳ፓጟጠጴፄፃጹፂፐ\u135bጹጳፃፄፁ朧朝漳ፓጟጠጴፀፚጹጾፔፚፚ፨ፄፆ\u135f朧朝漳ፔፚጠጴፀፃጽጽፁጴፚጟፃፅፁፙፓጟጠጴፀፇፓጽፁፄፅጣፃ\u135c\u135fጹጽጵጵፅፅፇፓጽ";
		text += "ፁጴጵጢፃፄፅጵፔፅጵጥፃፚፅጾጼጵፅጣፃፄፁ朧朝漳ፓጟጠጴፀፇፓጾፁጵ\u135fጷፃፄፅጵፓጟጠጴፀፇፓጽፁፄፄ፨ፄ\u135c\u135fጲፀጟጠጴፀፇፓጽፁጴጹጲፃፙ朧朝漳ፅፔጴጠጥፀፇፓጽፁጴጵጢፃፚፁጵጼጟጤ፡ፆፇፓፂፁጴጵጢፃፄፁ朧朝漳ፓጠጵፄፉጴፉጽፁጵ\u135bጢፃፄፁ朧朝漳ፓ";
		text += "ጟጠጴፄፃጽጽፐ\u135cፁጳፃፄፁጹፓጟጠጴፈጢፓጾጼጵፅጢፄ\u135bፁ朧朝漳ፓጟጠጴፀፇፓጾፁጵ\u135fጷፃፚፅጹፓጟጠጴፀፇፓጽፁፄፄ፩ፃፆ\u135fፐፀጟጠጴፃፇፓጽፁጶጽጢፃፆ\u135f\u135dፔጴጤጥፀፇፓጽፁጴጵጢፄፅፁፐፁጟጤፅፂፇፓጽፁጴጵጢፃፄፅጶፁፅጹፄፀፚፓጽፐ\u135bፅጤፃጟፁጲ";
