		text += "ጢፃፆ\u135f朧朝漳ፓጟጤጥፀፃጽፂፅጴጴ፨ፃፄፁ朧朝漳ፓጟጠጴፀፃ朧朝漳ጽፐ\u135cፓጣፃ\u135d\u135f朧朝漳ፓጟጠጴፀፇፓፁፅጶጽጤፃፆ፣ፉፓጟጠፄፀፇፓጾፔፚጴ፨ፄ\u135c\u135fጵፔፚጠጴፀፇፓጽፁጴጹጲፃ\u135d\u135fጹጼጠጵ፠ፀፇ\u135bጽፁጴጴ፩ፃፄፁፚፁፚጠጵፅፇፓጽፁጴጵጢፃፄፁፁጼ\u135bጹ፠";
		text += "ፄፚጽጽፁጴጵጢፃፄፁጲፀፚጤጥፂፃጹፁፐፚጵጥፃፄፁ朧朝漳ጼጟጠጴፂፃፁጽፅጶጽጢፃፄፁ朧朝漳ፓጟጠጵፁፇፗጾፐፚፚጟፄፅፅፅፓጟጠጴፀፇፓጽፁፄፅጤፄፇ\u135fጾፁፄጣ፦ፅፇፗጽፁጴጵጢፃፄፁ朧朝漳ፓጟጤጴፆፚፓጽፁፄፅጢፃፄፁ朧朝漳ፓጟጠጵፁፃጹፂፐ\u135bጹጲፃ";
