		text += "ጽጽፐ\u135b\u135fጳፃፄፁጽፓጟጠጴፈጢፓጽፐ\u135cፓጣፃ\u135d\u135f朧朝漳ፓጟጠጴፀፇፓፁፅጵ\u135fጷፃ\u135bፅጹፓጟጠጴፀፇፓጽፁፄፉጵፄ\u135bፁጲፁጟጠ፠ፅፇ\u135bጿፁጴጹጷፃፄፁ朧朝漳ፓጟጠጴፀፚጹጽፅጴጠጢፄፅፁጹጽጴጠፄፀፇፓጽፁጴጵጢፃፄፅጶፁፅጹፄፀፇፓፂፁፅፅጢፄ\u135c\u135fጹጼፄጠ";
