		text += "ጵጢፃፄፁጹጼጟጠጴፀፇፓጽፁጴጵጢፃፄፅፉፓጟጠጴፀፇፓጽፁጴጵጢፄፚፁ朧朝漳ፓጟጠጴፀፇፓጽፅጴጵጢፃፄፁ朧朝漳ፓጟጠጴፀፇፓፁፅጵጵጢፃፄፁ朧朝漳ፓጟጠጴፀፇ\u135bፁፅጴጵጢፃፄፁ朧朝漳ፓጟጠጵፃፚፉጽፁጴጵጢፃፄፁ朧朝漳ፓጟጠጵፆፇፓጽፁጴጵጢፃፄፁ朧朝";
		text += "漳ፓጠጹጴፀፇፓጽፁጴጵጢፃፅፁ朧朝漳ፓጟጠጴፀፇፓጽፁጴጵጢፄ\u135bፅጽፓጟጠጴፀፇፓጽፁጴጵጣፃጠፁ朧朝漳ፓጟጠጴፀፇፓጽፁጴጴ፧ፃፄፁጵፓጟጠጴፀፇፓጽፁፅ\u135bጢፃፄፁ朧朝漳ፓጟጠጴፀፇፓፂፁጴጵጢፃፄፁ朧朝漳ፓጟጠፄፀፇፓጽፁጴጵጢፃፄፁ朧朝漳ፓጟጠጥፉጢ";
		text += "ፓጽፅጴጵጢፃፄፁ朧朝漳ፔጴጤ፠ፀፇፓጽፁጴጵጢፃፄፁፂፁፚጠጴፁፇፓጽፁጴጵጢፃፄፅፉፓጟጠጴፀፇፓጽፁጴጵጢፄፚፁ朧朝漳ፓጟጠጴፀፇፓጽፅጴጵጢፃፄፁ朧朝漳ፓጟጠጴፀፇፓጿፅፄፅጢፃፅፁ朧朝漳ፓጟጠጴፀፃፁፂፁጴጵጢፃፄፁ朧朝漳ፓጟጠጴፂፃጽጽፁጴ\u135bጢፃ";
		text += "ፄፁ朧朝漳ፓጟጠጵፆፇፓጽፁጴጵጢፃፄፁ朧朝漳ፓጠጹጴፀፇፓጽፁጴጵጢፃፅፁ朧朝漳ፓጟጠጴፀፇፓጽፁጴጵጢፃፇ\u135fፉፓጟጠ፠ፀፇፓጽፁጴጴጟፄፚፁ朧朝漳ፓጟጠጴፀፇፓጽፁፄጠጥፃፄፁጹፓጟጠጴፀፇፓጽፁፅ\u135bጢፃፄፁ朧朝漳ፓጟጠጴፀፇፓፂፁጴጵጢፃፄፁ朧朝漳ፓጟ";
		text += "ጠፄፀፇፓጽፁጴጵጢፃፄፁ朧朝漳ፓጟጠጥፀፇፓጽፅጴጵጢፃፄፁጲፀፚጤጴፀፇፗጽፁጴጵጢፃፄፅፁጼጴጠጴፂፇፓጽፁጴጵጢፃፄፅፉፓጟጠጴፀፇፓጽፁጴጵጢፄፚፁ朧朝漳ፓጟጠጴፀፇፓጽፅጴጠጤፃፄፁጹጼጟጤጴፀፇፗጽፁጴጵጢፃፄፁጶፀጟጠ፠ፉጢፗጿፅጴጵጢፃፄፁ";
		text += "朧朝漳ፓጟጤ፠ፂፚጹጽፅፄፅጤፃጟፁጵጼፄጠጴፀፇፓጽፁጴጴ፨ፃፆ፣ጵጽፄጠ፠ፀፇ\u135bጽፐ\u135cፗጳፃፅፁ朧朝漳ፓጟጠጴፀፇፓፁፅጴጵጤፃፅፁፉጼጠጹጴፁፚጽጽፁጴጵጢፃፄፁ朧朝漳ጼጴጠጴፂፃጽጽፐፚ\u135fጷፃፄፁጵፓጟጠጴፈጢፓጾጼጵጵጣፄፇ\u135f朧朝漳ፓጟጠጴፀፇፓጾ";
		text += "ፁጴጵጤፃ\u135d\u135fጹፔፚጨፄፀፃጵጽፁጴጴ፩ፃፄፁፚፁፄጠፅፄፇፓጽፁጴጵጢፃፄፁፁፔፅጵፄፀፇፓጽፁጴጵጢፃፄፁጶፀጟጠጥፀፇፓጾፁጴጵጢፄፚፁ፡ፓጟጠጴፀፇፓጽፁጴጵጣፃ\u135d\u135f朧朝漳ፓጟጠጴፀፇፗጽፅጴፚጟፃፄፁፅፓጟጠጴፀፇፓጽፁጵ\u135bጢፄፇ\u135f朧朝漳ጽጴጠፄፂ";
		text += "ፇፓጽፅጴፚጟፃፆ\u135fፙፓጟጠጴፀፇፓጽፁጵ\u135bጤፃ\u135c\u135f朧朝漳ጼጟጠ፠ፐጴጽጽፔፚጵጢፃፄፁ朧朝漳ፓጠጵፄፀፚፅጽፅጴ\u135bጢፃፆ\u135fጹጽጵጵ፠ፄፇፓጽፁጴጵጢፃፄፅጵፓጟጠ፠ፉጴጽጽፅጶ፣ጢፃፄፁ朧朝漳ፓጟጠጴፄፚፓፂፅጴጵጣፃፄፁጹጼጠጵ፠ፁፚጹጽፁጴጵጢፃፄፁ朧";
		text += "朝漳ጼጴጠጴፐ፩ጹፂፐጟፚ፧ፃፄፁ朧朝漳ፓጟጠጴፀፚጹጽፅጵ\u135bጤፃጟፁፁጼፄጠጴፀፇፓጽፁጴጹጲፃፅፁፐፁጠጹፄፀፇፗጾፅፅ\u135bጢፃጠፁፐፁጠጵ፠ፅፇፓጽፁጴጵጢፃፄፅጵጼ\u135bጹ፠ፂፃፁጽፁጴጵጢፃፄፁጲፀፚጠፄፆፚፓፂፅጴጵጣፃ\u135c\u135f朧朝漳ፔፅጵጥፀፃጵፂፁፅጴ";
		text += "ጟፃፄፁ朧朝漳ፓጟጠጴፀፇፓጽፁጴጵጤፃፅፁጹፓጟጠ፠ፂፃፁፁፐ\u135bጵጢፃፄፁ朧朝漳ፓጟጠጵፁፃጽፂፁጴፄጠፃፄፁ朧朝漳ፓጟጠጴፀፃ朧朝漳ጽፁጴ\u135bጢፃጠፁፐፁጠጵ፠ፅፇፓጽፁጴጵጢፃፄፅጵጼጠጹጴፁፚጹጽፁጴጵጢፃፄፁ朧朝漳ጼጴጠፅፃፃፁፂፁጴፅጣፃፄፁ朧朝漳";
		text += "ፓጟጠጴፀፇፗጽፅጴጠጢፃ\u135c\u135fጵፔጴጠጴፆፇፗጾፐ\u135cጽጤፃፚፁጽፓጟጤፄፀፇፓጾፔፚጹጲፃፆ\u135fጵፔጴጠጴፆፇፗጾፔፚፚጟፄፆ\u135fፉፓጟጠጴፀፇፓጽፁፄፅጣፃፇ\u135f朧朝漳ጼፄጠፄፂፇፓጾፅጶጽጤፃፚፅጹፓጟጤፄፀፇፓጾፔፚጵጤፃጟፁጶፁፄጠጴፀፇፓጽፁጴጹጲፄፅፁ";
		text += "ጹፔጴጠፄፀፃጹጽፅጶፓጢፃጠፁፐፁጠጵ፠ፈጢፓጽፁጴጵጢፃፄፅጶፀፚጠ፠ፁፇፗጽፁጵ\u135bጣፃጠፁፙፔፅጵ፠ፐጢፓጽፅጴጵጢፃ\u135d\u135fጲፀፚጠ፠ፁፇፗጽፁጵ\u135bጣፄፅፁ朧朝漳ፔፄጣ፦ፂፇፗፁፅጴጵጢፃፄፁ朧朝漳ፓጟጤጵፁፇ\u135bጽፅጴፅጢፃ\u135c\u135fጶፀጟጤጥፂፃጵፂፐፚጴ፧";
		text += "ፃፄፁ朧朝漳ጼጟጠጵፁፇ\u135bጽፅጴፅጢፃ\u135c\u135fጹጽጴጤፅፁፇፓጽፁጴጵጢፃፄፅጵፓጠጵፅፄፚፉጽፅጵፅጤፃ\u135bፁጹጽጴጠጵፆፇፓጽፁጴጵጢፃፄፅጵፔጴጠጥፀፃ朧朝漳ጽፐ\u135cፓጣፃፄፁ朧朝漳ፓጟጠጴፀፇፓፁፅፅጹጶፃፄፁ朧朝漳ጼጟጠ፠ፂፚፓጽፁጴፅጢፃፄፁፙፓጟጠ፡ፁ";
		text += "ፇፓጾፐፚ\u135fጲፃፄፁ朧朝漳ፓጟጠጴፀፇፓጽፁጴፅጣፃፄፁ朧朝漳ፓጟጠጴፀፇፓጽፁጴጵጢፃፄፁ朧朝漳ፓጟጠጵፃፇ\u135bፁፔፚ\u135bጢፃፄፁጲፁጟጠጵፄፇፓጽፁጴጵጢፃፄፁጵፔጵጵ፠ፃፇፓጽፁጶጽጢፃፄፁ\u135dጼፚጠጴፀፇፓጽፁጴጵጢፃፅፁ\u135dፓጟጠጴፀፇፓጽፅጴፄ፩ፃፃ朧朝";
		text += "漳ጹጽጴጠጴፀፇፓጽፁጴጹጲፃፅፁጽፓጟጤጥፂፇፓፂፐጠ\u135bጢፃፄፁ朧朝漳ፓጟጠጴፀፃፁፂፁጴጹጴፃፄፁ朧朝漳ፓጟጠጴፀፇፗጽፁፄጠጢፃጟፁጹጽጴጠ፠ፅፇፓጽፁጴጵጢፃፄፁፉፓጠጹጴፀፃፅጽፐጠጵጢፃጟፁፙፔፄጠ፡ፆፇፓጽፅጴጵጢፃ\u135d\u135f朧朝漳ፓጠጵፅፄፚፉጾፐ";
		text += "ፚጵጢፃፆ\u135fጵጼፚጠ፠ፉጢ\u135bጾፐፚጵጢፃፄፁ朧朝漳ፓጟጤ፠ፁፇ\u135fጽፁጵ\u135bጤፃጟፁ朧朝漳ጼፄጠጴፀፇፓጽፁጴጴ፨ፃፅፁጽፓጟጤጴፁፇፗጽፁጵጵጣፃ\u135c\u135fጵፔፚጠጴፐጢፗጽፐፚጴጠፃፆ\u135f\u135dፔፄጤጥፀፇፓጽፁጴጵጢፃ\u135c\u135fጲፀጟጠጴፈጢ\u135bጿፁጴፚጟፃፄፁ朧朝漳ፓጟጠጴ";
		text += "ፀፃጹጽፐ\u135cፗጲፄፇ\u135f朧朝漳ፓጟጠጴፀፇፓፁፅጴፅጥፃፄፁፅፓጟጠ፠ፁፇፗጽፁጵ\u135bጢፃጟፁጵፔጴጠጴፈጢፗፁፐፚፄ፨ፃፅፁጵፓጟጤፄፂፃፁጽፐ\u135bጵጢፃፄፁ朧朝漳ፓጟጠጴፆፇ\u135bጾፐፚፅጣፃፄፁፙጼ\u135bጹ፡ፂፃፅጽፁጴጵጢፃፄፁጲፀፚጠጵፁፚፅፂፅጴፉጴፃፆ\u135fፅፔ";
		text += "ፄጨጴፀፚፓጽፁጴጵጢፃፄፁጲፀፚጠፄፃፇፓጿፁጴፚጟፃፅፁ朧朝漳ፓጟጠጴፀፇፓጽፁፄፉጵፄ\u135bፁ朧朝漳ፓጟጠጴፂፃፁጾፁጶፗጴፃ\u135bፁፅፓጟጠጴፀፇፓጽፁጴፄ፨ፄ\u135c፣ጺፀፚጠጴፀፇፓጽፁጴጹጲፃፆ፣ጵፓጟጤ፠ፂፚጹጽፁጴጵጢፃፄፁ朧朝漳ፔጴጠፄፀፇፓጽፁጴጵጢ";
		text += "ፃፄፁ朧朝漳ፓጟጠጴፀፇፓጽፁጴጴ፨ፃጟፁፉጽጴጠጴፀፇፓፂፐፚጹጵፃፄፁ朧朝漳ፓጟጠጴፀፇፗጽፅፄ\u135bጥፃፄፁ朧朝漳ፔፚጠጴፀፃፁፁፔፚጵጣፃፄፁ朧朝漳ፓጟጠጴፁፃፅጽፁጴጵጢፃፄፁጵፔጴጣ፦ፅፇፗጽፁጴጵጢፃፄፁ朧朝漳ፓጟጤጴፆፚፓፁፐጟ\u135bጢፃፄፁ朧朝漳ፓ";
		text += "ጟጠጵፁፃጹፂፐጟ\u135fጴፃፄፁ朧朝漳ፓጟጠጴፀፚጹጽፁፄፚ፩ፄ\u135bፁጵፓጟጠጴፀፇፓጽፁጴጴ፦ፃ\u135c፣ፐፀጠጵ፠ፀፇፓጽፁጴጵጢፄፅፁፐፁጠጵ፡ፄፇፓጽፁጴጵጢፃፄፅጵፔፅጵጥፀፃፅጽፁጶጽጤፄፇ\u135f朧朝漳ጼጴጠፄፆፇፓፁፐፚ\u135fጳፃፄፁጹፔጴጤጥፀፚጽጽፁጴጠጢፄፚ";
		text += "ፁ朧朝漳ጽፄጠፅፆፇ\u135bፂፅጴ\u135fጶፃፄፁፁፓጟጨፄፁፚፉጽፔፚጠጤፃፄፁፙፔፄጤ፠ፈጢፓጾፅጴጵጢፃ\u135d\u135f朧朝漳ፓጟጠጥፐጴፁጾፅጵፅጢፃፄፁ朧朝漳ፓጟጠጴፁፃጹፂፐጟ\u135fጲፃፄፁ朧朝漳ፓጟጠጴፀፚጹጾፔፚፚ፨ፄፆ\u135f朧朝漳ጼፄጠጴፀፃጽጽፁጴፚጟፃፅፁፙፓጟጠጴፀ";
		text += "ፇፓጽፁፄፅጢፄፅፅፂፁፄጠጥፅፇፓጽፅጴጵጢፃፄፁ朧朝漳ፓጟጨፄፂፇፓፁፅጴጵጢፃፄፁ朧朝漳ፓጟጠጴፀፇ\u135bፂፅጶፁጳፃፄፁ፡ፔፄጠጵፁፇፗጽፁጴጵጢፃፄፁ朧朝漳ፓጟጠ፡ፅፃጽጽፔፚጴጠፃፆ\u135f朧朝漳ፓጟጠጴፀፇፓጽፁጴፅጢፃፄፁጺፁፚጤ፡ፂፇፓጿፅጴፉጷፃፅ";
		text += "ፁ朧朝漳ፔፅጹፄፆፃጹጽፁጶ፣ጤፃፄፁ朧朝漳ፓጟጠጴፀፇፓጽፐፚጵጢፃፆ፣ፅጼፅጹፄፀፃፅጽፅፅ\u135bጣፃፅፁጺፁፚጤፄፐጢፓጿፅጴ\u135bጢፄፅፁጽፓጟጠጴፀፇፓጽፁጴጵጤፄ\u135bፁፅፔጴጠጴፐጢ\u135bጽፁፄፅጤፃፄፁ朧朝漳ፓጟጠጴፀፇፓጽፐጠፄ፦ፃጠፁ朧朝漳ጽፄጠ፠ፀፇፓ";
		text += "ጽፁጴጵጢፃፄፁፁፓጟጠጴፂፚፉጾፁጴፅጢፃጠፁጶፁጟጤጥፀፇ\u135bፂፅጴጤጴፃፄፁ፡ፔጵጹ፠ፈጢፗጽፐጠፅጥፃ\u135d\u135f朧朝漳ጽፄጠፅፆፃጽጽፐፚ\u135fጶፃፇ\u135fጹፓጟጨፄፁፚፓጾፔፚጠጤፄ\u135bፁጺፁፄጠጴፐጢፗፂፐ\u135cጼ፦ፃፆ፣ፅፔፄጨጴፀፃፅጽፅፅፚ፩ፃ\u135bፁጺፁፚጠ፠ፃፇ";
		text += "ፓጿፅጴፉጷፃ\u135d\u135fፉፔፅጹፄፁፚፉጽፁጶ፣ጣፄ\u135c\u135fፙጼጟጠ፡ፅፇፗጿፅጴጴጠፃፅፅፉጼጟጨጴፂፚፉጽፅጵጵጢፃጠፁጶፁጟጤጥፐጢ\u135bፂፅጴጹጷፃፄፁ፡ፔጵጹ፠ፉጴጹጽፐጠፅጢፄፅፁ朧朝漳ጽፄጠፅፆፃጽፁፐፚ\u135fጶፃፄፁፅፓጟጨፄፁፚፓጽፐፚጠጥፃፇ\u135fጲፀጟጤጥፂ";
		text += "ፇ\u135bፂፐፚጵጣፃፄፁ朧朝漳ጼጟጠጴፀፚጹፂፁፅጹጲፃ\u135d\u135f朧朝漳ፓጟጠጴፀፇፓጽፁጴጴጠፃፅፅፉፔፄጠጴፃፇ\u135fጽፁፄፚ፩ፃፆ፣ጹጽፄጠጴፁፇፓጽፁጶጽጢፃፄፅጶፁፅጹጴፐ፩ጽጽፁጴጵጢፃፄፁ朧朝漳ፓጟጠጴፐጢፗፂፐፚጹጵፃፆ፣ፅፓጟጤፄፀፃፅጽፅፅ\u135bጢፄፚፁጽ";
		text += "ፔፚጠ፠ፂፇፓጽፐ\u135cፁጳፃፅፅጽፓጟጠጴፀፇፓጽፁጵጴ፩ፃፆ\u135fፐፁጟጠጴፅፇፓጽፁጶጽጢፃ\u135c፣ፉጼጴጠጴፀፇፓጽፁጴጵጢፄፅፁጺፁጴጠጴፉ፩ጽጽፐፚ\u135fጷፃፄፁጵፓጟጠጴፈጢፓጽፁፄፉጵፄ\u135bፁፙፔፚጤጥፂፃጹፂፐፚጴ፧ፃፄፁ朧朝漳ጼጟጠጴፀፚጹፂፁፅፄ፨ፄፆ\u135f";
		text += "朧朝漳ጽፄጠፅፆፇፓጿፅጴጠጥፃፄፁ\u135dጼጟጠ፠ፉጢ\u135fጽፁጵፅጢፃፄፁፙፓጟጠጵፁፚፅፂፅጵፉጶፃፄፁፙፔፅጵጥፀፚፓጽፁጴጤጳፃጟፁጹጽጴጠ፡ፂፇፓጽፁጴጵጢፃፄፁፉጼ\u135bጹ፡ፂፚፉጽፁጴጵጢፃፄፁጲፀፚጠጵፁፚፅፂፅጵጹጴፃፄፁጾፀጟጨጴፂፃፁጽፐጟ\u135bጢፃፄ";
		text += "ፁ朧朝漳ፓጟጠጴፆፇፓፁፅፅጹጶፃፚፁጹፔፄጤፄፂፃፁጽፁፅ\u135bጢፃፄፁ朧朝漳ፓጟጠጵፁፇፓፁፔፚጴ፩ፃፆ፣ጽፔጵጵጥፀፇ\u135fጽፐ\u135cፒጠፄፚፁ朧朝漳ፓጟጠጴፀፇፓፁፅጴፅጥፃፄፁፁፔጴጠ፠ፀፃ朧朝漳ጽፐ\u135cፒጠፄ\u135bፁ朧朝漳ፓጟጠጴፀፇፓፁፅጵ\u135fጷፄፆ፣ፅፓጟጠጴፀ";
		text += "ፇፓጽፁፄፅጢፄፅፁጹጽጴጠፄፀፇፓጽፁጴጵጢፃፄፅጶፁፅጹፄፁፚፁጽፁጴጠጤፃጟፁ።ፁፄጠጴፀፇፓጽፁጴጹጲፃፅፁጽፓጟጤጴፁፇ\u135bጽፁጵጵጤፃጟፁ።ፁፚጠጴፀፇፓጽፁጴጹጲፃ\u135c፣ፉጼጴጤጴፀፇፓጽፁጴጵጢፄፅፁጲፀፚጠ፠ፉጢፗጽፁጴጵጢፃፄፁ朧朝漳ፓጠጵፅ";
		text += "ፄፚፉጽፁጴጵጢፃ\u135c\u135fጺፀፚጤጴፁፇፗፁፔፚጵጢፃፄፁ朧朝漳ፓጟጠጴፀፇፓጽፁጴጵጢፃፄፁጺፀፚጠጴፀፇፓጽፁጴጵጢፃፅፅፅፓጟጠፄፀፇፓጽፁጴጴ፦ፃጟፁ朧朝漳ፔጴጠጴፀፇፓጽፁጵጵጤፃፄፁ朧朝漳ፓጟጠጴፀፇፓጽፁፅጵጢፃፄፁ朧朝漳ፓጟጠጴፁፇፗፁፐፚጠጢፃ";
		text += "ፄፁፅፓጟጠጴፀፚፅጽፁጴፅጢፃፄፁ朧朝漳ፓጟጠፅፁፇፓጽፁጴጵጢፃፅፁጵፓጟጠ፠ፀፇ\u135bጾጼጴ\u135bጣፄፚፁ朧朝漳ፓጟጠጴፀፇፓጾፁጶጽጤፃፆ፣ፉፓጟጠፄፀፇፓጾፔፚጵጤፃጟፁ朧朝漳ጽፄጠጴፀፇፓጽፁጴጴ፨ፃፆ\u135f\u135dፔጴጨጴፀፇፓጽፁጴጵጢፄፅፁፚፁፄጠፅፃፇፓጽ";
		text += "ፁጴጵጢፃፄፁፁፔጴጤ፠ፀፚጹጽፁጵ\u135bጣፃፙ朧朝漳ፁጼፚጠጵፁፇፗጾፐፚጹጳፃፄፁፙፔፄጨጴፂፃፅጽፁጴጵጢፃፄፁ朧朝漳ጼፚጠ፠ፀፇፓጽፅጶፓጢፄ\u135c፣ፐፁጠጹ፡ፆፚፉጽፁጴፄ፩ፄ\u135bፁጵፓጟጠጴፀፇፓጽፁጴጴ፦ፃ\u135c፣ፐፀጠጵ፠ፀፇፓጽፁጴጵጢፄፅፁፐፁጠጵ፡ፆ";
		text += "ፇፓጽፁጴጵጢፃፄፅጵፔጴጤ፡ፆፚፉጽፁጴፄ፧ፄ\u135c\u135fጺፁጴጤጴፃፇፓጾፔፚጹጴፃፄፁጹፓጟጨጴፆፚፓጽፐጟጠጢፃፄፁ朧朝漳ፓጟጠጴፆፇፓፂፁጴጴጠፃ\u135c፣ፉፔፄጨጴፀፇፓጽፁጴጵጢፄፅፁጵጼፚጠጥፁፇ\u135bጿፅጴጵጤፃፄፁጹጼጠጵ፠ፁፚፁጽፁጴጵጢፃፄፁ朧朝漳ጼጴ";
		text += "ጠጴፂፃጹፂፐፚ\u135fጲፃፄፁ朧朝漳ፓጟጠጴፀፃጹጽፐ\u135cፓጢፄፇ\u135f朧朝漳ፓጟጠጴፀፇፓፁፅጶፁጵፃፅፅጽፓጟጠጴፀፇፓጽፁጵጵጢፃፆ\u135f朧朝漳ፔፄጣ፦ፂፇፗፁፔፚጵጢፃፄፁ朧朝漳ፓጟጤጴፀፃፅጽፐ\u135cፓጢፄፇ\u135f朧朝漳ፓጟጠጴፀፇፓፁፅጶፁጵፃፅፅጽፓጟጠጴፀፇፓጽፁ";
		text += "ጵጵጢፃፆ\u135f朧朝漳ጽጴጣ፦ፄፇፗፁፐፚጵጢፃፄፁ朧朝漳ፓጟጤጴፀፃጽጽፅጶፁጵፃ\u135c\u135fጲፀጟጠጴፈጢ\u135bጽፁፅ\u135fጷፃፄፁ朧朝漳ፓጟጠጴፀፇፓጽፔፚፄጟፄ\u135c\u135f朧朝漳ጼፚጠ፠ፀፚፉጿፁጴጵጥፃፄፁ朧朝漳ፓጟጠጴፃፇ\u135fጾፅጵ\u135bጣፃ\u135c\u135fጲፀፚጤጥፂፃፅጽፔፚጴ፧ፃፄፁ朧";
		text += "朝漳ጼጟጠጴፂፃፁጾጼጴጠጢፃፄፁ朧朝漳ፓጟጠጵፁፇ\u135bጽፁጴጵጢፃፄፁፁፓጟጠጴፀፇፓፂፁጶፓጣፃፇ\u135f朧朝漳ጼጴጠጴፂፃጽፁፐፚፉጴፃፄፁ朧朝漳ፓጟጠጴፀፃ朧朝漳ጾፐጠ\u135bጤፃጟፁ朧朝漳ፓጟጠጴፀፇፓፁፅጴፅጣፃፄፁፁፔፚጠፄፂፇፓጽፁጴ\u135bጢፃፆ\u135fፚፀጟጠፅፃ";
		text += "ፇፓጽፁጴጵጢፃፄፁፁፔጴጤ፠ፀፇ\u135bጾጼጴ\u135bጣፄፇ\u135f朧朝漳ፓጟጠጴፀፇፓጾፁጵ\u135fጷፃፆ\u135f\u135dፓጟጠጴፀፇፓጽፁፄፅጣፃፅፁ朧朝漳ጼጵጹጵፁፃጹፂፐጟጠጢፃፄፁ朧朝漳ፓጟጠጴፀፚጹጾጼጵጵጣፄፇ\u135f朧朝漳ፓጟጠጴፀፇፓጾፁጴጵጤፃፙ朧朝漳ጹፔጵጹጴፀፇፓጽፁጴጵጢ";
		text += "ፃፚፁ朧朝漳ፔፄጣ፦ፂፇፗፁፔፚጵጢፃፄፁ朧朝漳ፓጟጤጴፁፃጽጽፐ\u135cፓጢፄፅፁ朧朝漳ፓጟጠጴፀፇፓጾፐፚፚ፨ፃፅፁፙፔፄጨጴፅፇፗጽፁጴጵጢፃፄፁጲፀፚጠጥፉጢ\u135bጽፁፅ\u135fጷፄ\u135c፣ፐፁጠጹ፠ፂፃጵጽፐ\u135cፓጢፄ\u135c\u135f朧朝漳ፓጟጠጴፀፇፓፁፅጴፅጥፃፄፁፅፔፄጨጴፁ";
