		text += "ፃፇ\u135f朧朝漳ፓጟጠጴፀፇፓጽፁጴጵጢፃ\u135c፣ጽፔጵጹጴፀፇፓጽፁጴጴጠፄፇ\u135f朧朝漳ጼፄጠጴፀፇፓጽፁጴ\u135bጥፃ\u135bፁፅጼፄጠጥፀፇፓጽፁጶፓጤፃፇ\u135f朧朝漳ፓጟጠጴፀፇፗጽፁጴጵጢፃፄፁ朧朝漳ፓጟጠጴፂፇ\u135fጾፁጶጼ፧ፃ\u135bፁፁጽፄጤጴፄፇፓጽፁጴጵጢፃፄፁ朧朝漳ፔጴጨ";
