		text += "ፁጴጹጷፃፇ\u135fጲፀጟጠጴፁፇፓጽፁጴጵጢፃፄፁ朧朝漳ፓጟጠጴፀፇፓጽፁጵ\u135bጢፃፄፁጺፀፚጠጴፀፇፓፁፅጴጵጢፃፄፁፉፓጟጠጴፅፇፓጽፁጴጵጢፄፅፁ朧朝漳ፓጟጠጴፆፇፓጽፁጶጼ፧ፃፄፁ朧朝漳ጼ\u135bጹፄፀፇፓጽፁፄፅጢፃፄፅጵፔፚጠጴፀፃጽፁፔፚጵጢፃፄፁፉፓጟጠ";
		text += "ጵፃፃጵጽፁጴጹጳፄፆ\u135f朧朝漳ፓጟጠጴፆፇፓጽፁፄጤጶፃፄፁጲፀጠጵ፠ፀፇፓጽፁፄፅጢፃፄፅፉጼጟጠጴፀፚፅጿፅጴጵጢፃፅፁጹፓጟጠጴፁፇ\u135fጽፁጴፅጢፃፄፁ朧朝漳ፔጴጠጴፆፇፓጽፁጴፉጵፃፄፁጶፀጠጵ፠ፀፇፓጽፁፄፅጢፃፄፁጺፀፚጠጴፁፃጽፁፔፚጵጢፃፄፁፉ";
		text += "ፓጟጠጴፅፇ\u135bጽፁጴፄ፦ፃፄፁ朧朝漳ፔጴጠጴፆፇፓጽፁጶጼጠፃፄፁጵጼ\u135bጹፄፀፇፓጽፁጵ\u135bጢፃፄፁፚፁፚጠጴፁፃጹፂፅጴጵጢፃፄፅጵፓጟጠጵፁፃፅጽፁጴፄጟፃጟፁ朧朝漳ፔጴጠጵፁፇፓጽፁፄፚ፩ፃፄፁጶፁፄጨፄፀፇፓጽፁጵ\u135bጢፃፄፅፅፔፚጠጴፁፚፅጽፔፚጵጣፃ";
		text += "ፄፁፉፓጟጠጵፆፚፓጽፁጴፄ፨ፄ\u135bፁ朧朝漳ፓጟጠጵፁፇፓጽፁጴፚ፦ፃፄፁጹጼጠጵጥፀፇፓጽፁጵ\u135bጢፃፄፁፅፔፄጠጴፂፇፓፁፅጴጵጢፃፄፁፉፓጟጠጴፈ፩ፅጽፁጴ\u135fጵፃፇ\u135f朧朝漳ፔጴጠጴፆፇፓጽፁፄፅጣፃፄፁጹጼ\u135bጹፄፀፇፓጽፁፄፅጢፃፄፅጶፀፚጠጴፂፃጽፁፔፚ";
		text += "ጵጢፃፄፁፉፓጟጠጵፄፚጽጽፁጴፚ፨ፄ\u135bፁ朧朝漳ፓጟጠጴፆፇፓጽፁጴጴ፦ፃፄፁጾፀጠጵ፠ፀፇፓጽፁፄፅጢፃፄፁጺፁፚጠጴፃፚፅጿፅጴጵጢፃፄፁፉፓጟጠጴፅፚጽጽፁጴጟ፨ፄ\u135bፁ朧朝漳ፓጟጠጵፁፇፓጽፁጶ፧ጷፃፄፁጽጽጴጨፄፀፇ\u135fጽፁፄፅጢፃፄፅጵጼጟጠጴፃፃፁ";
		text += "ጿፅጴጵጥፃ\u135bፅፉፓጟጠጵፂፚጽጽፁጴጠጢፃፄፁ朧朝漳ፓጟጠጴፆፇፓጽፁፅፅጢፃፄፁጾፁፄጠጥፀፇፗጽፁጵ\u135bጢፃፄፁጵጼጴጠጴፄፃጹፂፅጴጵጢፃፄፁፉፓጟጠጴፄፃፁጽፁጵጵጥፄፇ\u135f朧朝漳ጼጴጠፄፂፇፓጽፁጶፓጥፃፄፁፁጼ\u135bጹጴፀፃ朧朝漳ጽፁጵ\u135bጢፃፄፁ\u135eፁፚ";
