		text += "ጠጵፄፀፃጹጽፅጵ\u135bጢፃፄፁፚፁፚጠጴፐጴፉጽፐፚጴ፩ፃፄፁፉፓጟጠጵፁፇ\u135bጽፁጶፒ፨ፄ\u135bፁ朧朝漳ፓጟጠጴፆፇፓጽፁፅፉጶፃፄፁ\u135eፁፄጠፄፀፃፁጽፁጵ\u135bጢፃፄፁ朧朝漳ጼጟጠጴፑጴፅጽፅጴጴጟፃፄፁፉፓጟጠጴፃፚፉጽፁጶ፣ጢፃፅፁ朧朝漳ጼፚጠጴፆፇፓጽፁጵጹጴ";
		text += "ፃፄፁ፡ጼ\u135bጹፄፀፇፓጽፅጴ\u135bጢፃፄፁፅፔፄጠጴፐጢፓጽፁጴጵጣፃፅፁጹፓጟጠጴፆፃ朧朝漳ጽፁጶ፣ጢፃፄፁ朧朝漳ፔጴጠፄፂፇፓጽፁፅጹጴፃፄፁ፡ፓጟጠጴፀፇፗጽፅጴ\u135bጢፃፄፅፆፁጴጠጴፐጢፓጽፁጴጵጣፃፄፁፉፓጟጠጴፁፃፅጽፁፄፄ፨ፄ\u135bፁ朧朝漳ፓጟጠጴፆፇፓ";
		text += "ጽፁጴፚ፨ፃፄፅጵፓጟጠፄፀፃጹጽፁጵ\u135bጢፃፄፁፂፁጴጠጵፁፇፓጽፅጴጴ፨ፃፄፁፉፓጟጠጴፅፇ\u135bጽፁፄፅጢፃፅፁ朧朝漳ጼፚጠፄፂፇፓጽፁጵፉጶፃፄፅጶፁፄጠጥፀፇፗጽፅጴ\u135bጢፃፄፁፙጼፄጠጵፁፚፅጽፔፚጵጣፃፅፁጹፓጟጠጴፐጴፓጽፁፄፉጵፃፇ\u135f朧朝漳ፔጴጠጵ";
		text += "ፅፇፓጽፁፄፉጶፃፄፅጵጽፄጤጴፀፃጽጽፁጵ\u135bጢፃፄፅፉጼፚጠጵፁፇፓፁፅጴጵጢፃፄፁፉፓጟጠጴፁፇፗጽፁፄፚ፦ፄ\u135bፁ朧朝漳ጼፚጠጴፆፇፓጽፁጴ\u135fጶፃፄፅጹጼ\u135bጹፄፀፇፓጽፁፅፅጢፃፄፁፁፔጴጠጵፂፃፅጾፁጴጴ፩ፃፄፁፉፓጟጠጴፄፃጹጽፁፄ\u135bጥፄፇ\u135f朧朝漳ጼ";
		text += "ጴጠጵፁፇፓጽፁጶጼ፩ፃፄፅጹጽጴጨፄፀፇ\u135fጽፁጵ\u135bጢፃፄፁ።ፀጟጠጵፂፃጹፂፅጴጵጢፃፄፅጵፓጟጠጵፁፇፓጽፁፄ\u135fጵፃጠፁ朧朝漳ፓጟጠጴፀፇፓጽፁጴጵጢፃፄፁ朧朝漳ፓጟጠፄፀፇፓጽፁጴጵጢፃፄፁ朧朝漳ፓጟጠጴፀፇፓጽፅጴጵጢፃፄፁጵፓጟጠጴፀፇፓጽፁጴፅጣ";
		text += "ፃፄፁ朧朝漳ፓጟጠጥፀፇፓፁፔፚጠጥፃፄፅጽፓጠጹጴፀፇፓጽፁጴፅጢፃፄፁ朧朝漳ፔጴጠጴፀፇፓጽፅጴጵጢፃፄፁ朧朝漳ፓጟጠጴፃፃጵጽፁፄጠጥፃፇ\u135fጲፁጴጠጵፄፇፓጽፁጴፄጠፃፄፁ朧朝漳ፔፄጠጥፀፇፓጽፁጴፅጢፃፄፁ朧朝漳ፓጟጠጴፀፇ\u135fጿፁጴጹጴፃፇ\u135fጽፓጠጵ";
		text += "ጥፀፚፅጽፁጴጵጣፄ\u135bፁ朧朝漳ፓጟጠ፡ፅፇፓጽፁጴፄ፨ፃፄፁ朧朝漳ፔ\u135bጵፄፀፚፁጽፔፚፅጢፃፇ\u135fጵጼፚጠጴፀፇ\u135fፂፁጴጹጴፃፇ\u135fጵፓጟጠጥፁፃጹጽፁጴጴ፦ፃፄፁጲፁጴጠጥፄፇፓጽፔፚፄ፨ፃፄፁ朧朝漳ጼጴጠጥፀፚፁጽፔፚፅጢፃፇ\u135fጵጼፚጠጴፀፃ朧朝漳ጾፔፚጹጴ";
		text += "ፃፇ\u135fጵፓጟጠጥፁፃጹጽፁጴጴ፦ፄፅፁጲፁጴጠጥፁፇፓጽፔፚፄ፨ፃፄፁ朧朝漳ጼጵጹጴፀፚፁጽፔፚፅጢፃፇ\u135fጵጼፚጠጴፀፃ朧朝漳ፂፐፚጹጴፃፇ\u135fጵፓጟጠጥፁፃጹጽፁጴጴ፧ፃፅፁጲፁጴጠጥፁፇፓጽፔፚፄ፨ፃፄፁ朧朝漳ጼፄጠጥፀፚፁጽፔ\u135cጽጢፃፇ\u135fጵጼፚጠጴፀፃጵ";
		text += "ጾፐፚጹጴፃፇ\u135fፙፓጟጠጥፁፃጹጽፁጴጴ፧ፄፅፁጲፁጴጠጥፈጢፓጽፔፚፄ፨ፃፄፁ朧朝漳ጼፅጹፄፀፚፁጽፔ\u135cጽጢፃፇ\u135fጵጼፚጠጴፀፃጹጽፐፚጹጴፃፃ朧朝漳ጵፓጟጠጥፁፃጹጽፁጴጴ፨ፃ\u135bፁጲፁጴጟ፦ፅፇፓጽፔፚፄ፨ፃፄፁ朧朝漳ጼፚጨጴፀፚፁጾፁጴ\u135bጢፃፇ\u135fጵጼፚ";
		text += "ጠጴፀፃጹፁፅጴጹጴፃፚፁፉፓጟጠጥፁፃጹጽፁጴጴ፨ፄፚፁጲፁጴጠጥፈጢፓጽፔፚፄ፨ፃፄፁ朧朝漳ጼጟጠጴፀፚፁጽፔፚፅጢፃፇ\u135fጵጼፚጠጴፀፃጽጽፔፚጹጴፃፚፅጵፓጟጠጥፁፇፗጽፁጴጴ፩ፃ\u135bፁጲፁጴጤጵፅፇፓጽፔፚፅጣፃፄፁ朧朝漳ጼጟጨፄፀፚፁጾፅጴ\u135bጢፃፇ\u135f";
		text += "ጵፔጴጠጴፀፃጽፁፐፚጹጴፃፇ\u135fጵፓጟጠጥፁፃጹጽፁጴጴጟፃፇ\u135fጲፁጴጠጥፄፇፓጽፔፚጵጣፃፄፁ朧朝漳ፔጴጠ፠ፀፚፓፂፁፅ\u135bጢፃፇ\u135f朧朝漳ፔጴጠጴፀፇፗጿፅጴጹጷፃፇ\u135fጵፓጟጠጥፀፇፗጽፁጴጵጤፃፄፁጲፁጠጹፄፂፇፓጽፔፚጴ፨ፃፄፁ朧朝漳ፔፄጨጴፀፚፓጽፔፚ";
		text += "ፅጢፃፇ\u135f朧朝漳ጼፚጠጴፀፇ\u135bፂፁጴጹጷፃፇ\u135fጵፓጟጠጥፅፇፓጽፐፚጵጢፃፄፁ朧朝漳ፓጟጠጴፀፇፓጽፁጴፅጣፃፅፁ\u135dጽጴጤጥፀፚፁጽጼጴፅጢፃፄፁ朧朝漳ፔጴጠጴፀፇፓጽፁጴጵጢፃፄፁ朧朝漳ፓጟጠጴፉጢፓጽፁጴጵጣፃፅፁጹፓጟጨጵፅፇፓፁፔ\u135bፄ፨ፃፄፁጽፓጟጠ";
		text += "ፄፀፇፓጽፁጴጵጢፃፄፁ朧朝漳ፓጟጠጴፀፃፁጽፁጴጵጢፃፅፁፉፔፄጠጵፆፇ\u135fጽፁፄጟ፧ፄ\u135c\u135f朧朝漳ፔፚጠጴፅፇፓጽፁጴጵጢፃፄፁ朧朝漳ፓጟጠጴፀፇፓጿፁጴጵጢፃፄፁጵፔጴጠ፠ፀፇ\u135fጽፐፚጹጵፃ\u135c፣ጽፓጟጠጥፀፚጹጽፁጴጵጢፃፄፁ朧朝漳ፓጟጠጴፀፇፓጽፁጶፓጢ";
		text += "ፃፄፁ朧朝漳ፔጴጤ፠ፂፇፓፂፐጟፅጢፄፚፁፚፁፚጠጴፃፇፗጽፐፚጵጢፃፄፁ朧朝漳ፓጟጠጴፀፇፓጽፁጴጴጟፃፄፁ朧朝漳ፓጟጠፄፆፇ\u135bጽፁጴጹጶፃፄፅፅጽጴጠ፠ፀፇ\u135fጽፅጴ\u135bጢፃፄፁ朧朝漳ፓጟጠጴፀፇፓጽፁጴጵጢፃጟፁ朧朝漳ፓጟጠጴፁፃጹጽፐፚጴ፦ፃፇ\u135fጲፁፚጨ";
		text += "ጵፁፇፓጽፔፚፄ፧ፃፄፁ朧朝漳ጼፄጤጴፂፇፗጽፁጴጵጢፃፄፁ朧朝漳ፓጟጠጴፀፇፗጾፐፚጵጢፃ\u135d\u135fጵፓጠጹፄፅፇፓጽፁጴፅጣፃ\u135c\u135f朧朝漳ፓጠጵፅፃፇ\u135bጽፅጴጵጢፃፄፁ朧朝漳ፓጟጠጴፀፇፓጽፅጵ\u135bጢፃፄፁፙጼጟጠጵፅፃፁፂፐፚጵጥፃፅፁፙፓጟጠጴፀፚፁጽፐፚ\u135bጢ";
		text += "ፃፄፁ朧朝漳ፓጟጠጴፀፇፓጽፁጴፄ፨ፃፄፁ朧朝漳ጼጠጹ፠ፀፚፉጿፅጵፅጢፃፇ\u135fጵጽፄጠጴፀፃጽጽፁጴ\u135bጤፃፄፁ朧朝漳ፓጟጠጴፀፇፓጽፁጴጵጣፃ\u135c\u135f朧朝漳ፓጟጨጴፐጢፓፂፅጵ\u135fጲፃፄፁ朧朝漳ፔጵጵጥፀፇፓጿፅጴጵጤፃ\u135c\u135f朧朝漳ፓጟጠጴፀፇፓጽፁጴጵጢፃፅፁፉፓ";
		text += "ጟጠጴፐጴፅጽፁፅፄጠፄፚፁ朧朝漳ፔፚጠፅፃፇፓጽፁፄፄጟፃፆ\u135fፉፓጟጠጴፀፇፓጽፁጴጵጢፃፄፁጵጼፚጠጴፀፃፅጽፔፚጹጶፃጠፅፁፓጟጠጥፁፚፅጽፁጴጹጴፃፚፁጹጼፚጠጴፀፇፓጽፁጴጵጢፃፄፁ朧朝漳ፔጴጤ፠ፀፇፓጿፅጶጽጢፄ\u135bፅጵፔፚጠጴፃፇፗፂፅጴጵጢፄ\u135b";
		text += "ፁ朧朝漳ፔፄጤ፠ፀፇፓጽፁጴጵጢፃፄፁ朧朝漳ፓጟጠፄፆፇፓጽፁጶ፧ጴፃፄፅፆፀ\u135bጵፄፀፇ\u135fጽፅፅ\u135bጢፃፄፅፐፁጴጠ፠ፆፇፓጽፁጴጵጢፃፄፁ朧朝漳ፓጟጠጴፁፃጹጽፁጴጹጲፃፅፁጲፁ\u135bጵ፠ፁፇፓጽፔፚ\u135bጢፃፄፁ朧朝漳ጼጟጠጴፂፃጽጽፁጴጵጢፃፄፁ朧朝漳ፓጟጠጴፀ";
