		text += "ፔጴጠጴፀፚጽጿፁጴፚጟፃፄፁ朧朝漳ፓጟጠጴፀፇፓጽፁጴጵጣፃ\u135c\u135f朧朝漳ፓጠጵ፠ፁፇፓፂፅፄ\u135fጴፃፄፁጽፔፄጠፄፀፇፓጽፔፚ\u135bጤፃጠፁ朧朝漳ፓጟጠጴፀፇፓጽፁጴጵጢፃፅፁፉፓጟጠጵፂፚጹጽፁፅፅጥፄፅፁ朧朝漳ፓጟጠ፠ፃፇፓጽፁጴጤጴፃፆ\u135f፡ፓጟጠጴፀፇፓጽፁ";
		text += "ጴጵጢፃፄፁጵፔጴጠጴፀፚጽፂፁጴጹጶፄፇ\u135fጽፓጟጠጥፂፇ\u135fጽፁጴጹጴፃፄፁጹጽፄጠጴፀፇፓጽፁጴጵጢፃፄፁ朧朝漳ፔጴጤ፠ፀፇፓፁጼጴ\u135bጢፄ\u135bፁጾፀፚጠጴፀፇ\u135bጾፅጴጵጢፃ\u135d\u135f朧朝漳ፔፅጵ፠ፀፇፓጽፁጴጵጢፃፄፁ朧朝漳ፓጟጠፄፆፇፓጽፁፄጤጷፃፄፅፅፔ\u135bጵፄ";
		text += "ፀፇፓጽፐ\u135bፅጢፃፄፁፚፁጴጠ፡ፅፇፓጽፁጴጵጢፃፄፁ朧朝漳ፓጟጠጴፁፃጹጽፁጴጹጵፃፇ\u135fጲፁ\u135bጴ፦ፂፇፓጽፔፚፚ፧ፃፄፁጲፀጟጨጴፃፚጽጽፁጴጵጢፃፄፁ朧朝漳ፓጟጠጴፀፇፗጾፐፚጵጢፄፚፁፙፓጠጹፅፁፚፉጽፁጴጵጤፃ\u135c\u135f朧朝漳ፓጟጠጵፃፇ\u135fፁፔፚጵጢፃፄፁ";
		text += "朧朝漳ፓጟጠጴፀፇፓጽፅጵ\u135bጢፃፄፅፂፀጟጠጵፅፃጵጾፅጴጵጣፃፆ\u135fፙፓጟጠጴፅፇፓጽጼጴጠጢፃፄፁ朧朝漳ፓጟጠጴፀፇፓጽፁጴፄ፨ፃፄፁጲፁፚጠጴፀፚፉፂፁጴፅጢፃፇ\u135fጹጽጴጠጴፀፃጵጽፁጴጤጵፃፄፁ朧朝漳ፓጟጠጴፀፇፓጽፁጴጵጣፃ\u135c\u135f朧朝漳ፓጟጤጥፀፇፓጿ";
		text += "ፅጴጹጲፃፄፁ朧朝漳ፔፄጨፄፀፇፓጾፐጟጠጥፄፚፁ朧朝漳ፓጟጠጴፀፇፓጽፁጴጵጢፃፅፁፉፓጟጠጵፅፃጹጽፁፅፉጳፃጟፁ朧朝漳ፔፚጠ፡ፁፇፓጽፁጵ\u135fጴፃፚፁ朧朝漳ፓጟጠጴፀፇፓጽፁጴጵጢፃፄፁጵጼፚጠጴፀፚፉፂፅጴጹጶፃፃ朧朝漳ጵፓጟጠጴፂፚጹጽፁጴጹጴፃፚፁ";
		text += "ፁፔፄጠጴፀፇፓጽፁጴጵጢፃፄፁ朧朝漳ፔጴጤ፠ፀፇፓፂፐፚፅጢፄ\u135bፁጾፀፚጠጴፀፇ\u135bፁፅጴጵጢፃ\u135c\u135fፁጼጴጤ፠ፀፇፓጽፁጴጵጢፃፄፁ朧朝漳ፓጟጠፄፁፇፓጿፁፅፚ፦ፃፄፅፅጽጵጵጥፀፇ\u135bጽፐጟፅጢፃፄፁፙፔጴጤጴፆፇፓጽፁጴጵጢፃፄፁ朧朝漳ፓጟጠጴፁፇፗጽፁጶ";
		text += "ፓጢፃፇ\u135fጲፁጠጹጴፈጢፓጽፔፚ\u135fጳፃፄፁ朧朝漳ጼጟጨጴፄፃጹጽፁጴጵጢፃፄፁ朧朝漳ፓጟጠጴፀፇፓጾፐፚፄጟፃፚፅጵፓጟጠጴፀፃጹጽፁጴጵጤፄፚፁ朧朝漳ፓጟጠጴፀፇፓጽፁጴጵጢፃፄፁ朧朝漳ጽጴጠጴፀፇፓጽፅጴፅጤፃፄፁጽፓጟጠጵፆፚፉጾፔፚጵጥፃፆ፣ፁፓጟጠ";
		text += "ጴፀፇፓጽፁጴጵጢፃፄፁ朧朝漳ፓጟጨጴፀፇፓጽፁጴፅጣፃፆ\u135f朧朝漳ጼጴጤ፠ፀፚፓፂፁጴፅጢፃፇ\u135fጽጼጴጠጴፀፇፓጽፁጴጵጢፃፄፁ朧朝漳ፓጟጠጴፉጢፓጽፁጴጵጣፃፅፁጹፓጟጤፄፈጢፓፂፐጠፚ፩ፃፄፁጽፔፚጤፄፀፇፓጽፁጴጵጢፃፄፁ朧朝漳ፓጟጠጴፀፃፁጽፁጴጵጢ";
		text += "ፃፅፁጵፔፄጠጴፆፃጵጽፁፅ\u135fጷፄፚፁ朧朝漳ፔፚጠጥፈጢፓጽፁጴጵጢፃፄፁ朧朝漳ፓጟጠጴፀፇፓጿፁጴጵጢፃፄፁጵፔጴጠ፠ፀፃጽፂፅጴጹጷፃፄፁፁፓጟጤጴፃፃፅጽፁጴጵጢፃፄፁ朧朝漳ፓጟጠጴፀፇፓጽፁጶፓጢፃፄፁ朧朝漳ፔጴጠፄፂፇፓጿፅጴጵጢፄ\u135c\u135f朧朝漳ጽፄጠ";
		text += "ጴፄፇ\u135fፁፅጴጵጢፄፅፁ朧朝漳ጼጴጤ፠ፀፇፓጽፁጴጵጢፃፄፁ朧朝漳ፓጟጠጴፁፇፓጽፁፄፅጣፃፄፅፉፔጴጤጴፀፇፓጽጼጴ\u135bጢፃፄፁ፡ጽጴጤጴፈጢፓጽፁጴጵጢፃፄፁ朧朝漳ፓጟጠጴፁፇፗጽፁጴጹጲፃፚፁጲፁጟጠጵፅፇፓጾፁጴጤጳፃፄፁ朧朝漳ፔ\u135bጵጥፄፃፁጽፁጴጵጢ";
		text += "ፃፄፁ朧朝漳ፓጟጠጴፀፇፓጽፅጴጵጢፄፆ\u135fፁፓጠጹ፠ፁፇ\u135fጽፁጵጵጥፄፇ\u135f朧朝漳ፓጠጹ፠ፀፃ朧朝漳ጿፅጴጵጢፃፄፁ朧朝漳ፓጟጠጴፀፇፓጽፁጵ\u135bጢፃፄፅጺፀፚጠጵፆፇፓጾፐፚጵጢፃፃ朧朝漳ፁፓጟጠጴፁፚፁጾፁፄ\u135bጢፃፄፁ朧朝漳ፓጟጠጴፀፇፓጽፁጴጴ፨ፃፅፁ\u135dጼ";
		text += "ጵጵፄፀፇፓጽፁጵ\u135bጢፃፄፁጾፁፄጠጴፀፇ\u135bጾፁጵጹጳፃፄፁ朧朝漳ፓጟጠጴፀፇፓጽፁጴጵጣፃ\u135c\u135f朧朝漳ፓጠጵ፡ፅፇፓፂፐፚጤጲፃፄፁ朧朝漳ፔ\u135bጹጴፀፇፓጽፁጴጵጢፃፄፁ朧朝漳ፔጴጠጴፀፚጹጾፐፚጹጴፃፄፁ朧朝漳ፓጟጠጴፀፇ\u135bጽፁጴጹጲፄ\u135c\u135fጲፁጴጠጴፀፇፓጽ";
		text += "ፁጴጵጥፃፄፁጲፁጴጤጥፀፚፁጽፁጴጵጢፃፄፁ朧朝漳ጼጴጠጴፀፚፅፁፅጴጹጴፃፄፁ朧朝漳ፓጟጠጴፀፇፗጽፁጴጵጢፄፇ\u135fጲፁፄጠጴፀፇ\u135bጽፁጴጵጤፃፄፁ朧朝漳ፔጴጤጴፀፚፅጽፁጴጵጢፃፄፁ朧朝漳ፔፚጠጴፀፇፗፂፁጴጹጵፃፄፁ朧朝漳ፔፄጠጴፀፃ朧朝漳ጽፁጴጵጤፃ";
		text += "ፚፁጲፁፄጠጴፀፇፓጽፁጴጴ፧ፃፄፁ朧朝漳ፔፅጵጥፀፚፅጽፁጴጵጤፃፄፁ朧朝漳ፔጴጠጴፀፃጵፂፁጴጹጵፃፄፁ朧朝漳ፔፄጠጴፀፇ\u135bጽፁጴጴ፨ፄፇ\u135fጲፁፄጠጴፀፇፓጽፁጴጵጥፃፄፁ朧朝漳ጼጠጹ፠ፀፚፅጽፁጴጵጢፃፄፁ朧朝漳ጼጴጠጴፀፃፁፂፐፚጹጵፃፄፁ朧朝漳ፓጟ";
		text += "ጠጴፀፃጵጽፁጴጹጲፃፚፁጲፁፄጠጴፀፇፓጽፁጴጴ፨ፃፄፁጲፀጠጹጴፀፚፅጽፁጴጵጤፃፄፁ朧朝漳ጼጟጠጴፀፚፁፂፐፚጹጵፃፄፁ朧朝漳ፓጟጠጴፀፃፁጽፁጴጹጶፃ\u135c\u135fጲፁፄጠጴፀፇፓጽፁጴጵጣፃፄፁ朧朝漳ፔፅጵ፠ፀፚፉጽፁጴጵጤፃፄፁ朧朝漳ፔፄጠጴፀፇ\u135fጽፁጴጹ";
		text += "ጶፃፄፁ朧朝漳ፓጟጠጴፀፇ\u135fጽፁጴጵጥፃጠፁጲፁፚጠጴፀፇፓጽፁጴጵጣፃፄፁ朧朝漳ጼ\u135bጵጥፀፚፉጽፁጴጵጢፃፄፁ朧朝漳ፔጴጠጴፀፃጽጾፅጴጹጶፃፄፁ朧朝漳ፓጟጠጴፀፇፗጽፁጴጴ፩ፃ\u135bፁጲፁፚጠጴፀፇፓጽፁጴጵጤፃፄፁ朧朝漳ጼጠጵ፠ፀፚፉጽፁጴጵጢፃፄፁ朧朝漳";
		text += "ፔጴጠጴፀፃጽጾፅጴጹጶፃፄፁ朧朝漳ፓጟጠጴፀፇ\u135bጽፁጴጴጟፃፇ\u135fጲፁፚጠጴፀፇፓጽፁጴጵጥፃፄፁ朧朝漳ጽጴጤፄፀፚፉጽፁጴጵጢፃፄፁ朧朝漳ፔጴጠጴፀፃፅጽፅጴጹጶፃፄፁ朧朝漳ፓጟጠጴፀፇፗጽፁጴጴጠፃፅፁጲፁፚጠጴፀፇፓጽፁጴጵጣፃፄፁ朧朝漳ጽፅጵፄፀፚፉ";
		text += "ጽፁጴጵጢፃፄፁ朧朝漳ፔጴጠጴፀፃፅፂፐፚጹጶፃፄፁ朧朝漳ፓጟጠጴፀፇፗጽፁጴጴጠፄ\u135c\u135fጲፁፚጠጴፀፇፓጽፁጴጵጣፃፄፁ朧朝漳ጼጟጨፄፀፚፁጽፁጴጵጢፃፄፁ朧朝漳ፔፄጠጴፀፚጽጿፁጴጹጶፃፄፁ朧朝漳ፓጟጠጴፀፇፗጽፁጴጹጴፃ\u135bፁጲፁፚጠጴፀፇፓጽፁጴጵጤፃፄ";
		text += "ፁጲፁጴጨጴፀፚፉጽፁጴጵጢፃፄፁ朧朝漳ፔጴጠጴፀፃጽጿፅጴጹጴፃፄፁ朧朝漳ፓጟጠጴፀፇፗጽፁጴጴጠፄ\u135c\u135fጲፁፚጠጴፀፇፓጽፁጴጵጣፃፄፁጲፁፅጹፄፀፚፉጽፁጴጵጢፃፄፁ朧朝漳ፔጴጠጴፀፃጽጿፅጴጹጴፃፄፁ朧朝漳ፓጟጠጴፀፇፗጽፁጴጴጠፄፅፁጲፁፚጠጴፀፇፓ";
		text += "ጽፁጴጵጣፃፄፁ朧朝漳ፓጟጠጴፀፚፓጽፁጴጵጢፃፄፁ朧朝漳ፔጴጠጴፀፇፓጽፁጴጹጷፃፄፁ朧朝漳ፓጟጠጴፀፇ\u135bጽፁጴጵጢፄ\u135c\u135fጲፁጟጠጴፀፇፓጽፁጴጵጣፃፄፁ朧朝漳ፔ\u135bጵጥፀፚፓጽፁጴጵጢፃፄፁ朧朝漳ፔፄጠጴፀፃጽጿፅጴጹጴፃፄፁ朧朝漳ፓጟጠጴፀፇ\u135fጽፁጴጹጳ";
		text += "ፃጟፁጲፁፚጠጴፂፇ\u135bጽፁጴጴ፦ፃፄፁ朧朝漳ፔ\u135bጹፄፀፚፓጽፁጴጵጢፃፄፁ朧朝漳ጼፄጠጴፀፃ朧朝漳ጽፁጴጹጷፃፄፁ朧朝漳ፓጟጠጴፀፃጹጽፁጴጴ፦ፃፆ\u135fጲፁጟጠጴፀፇፓጽፁጴጴ፩ፃፄፁ朧朝漳ጼጴጤጴፀፚፓጽፁጴጵጢፃፄፁ朧朝漳ፔጴጠጴፀፇ\u135fፁፔፚጹጷፃፄፁ朧朝";
		text += "漳ፓጟጠጴፀፇፗጽፁጴጵጥፄፇ\u135fጲፁጟጠጴፀፇፓጽፁጴጵጤፃፄፁ朧朝漳ጼጟጨፄፀፚፁጽፁጴጵጢፃፄፁ朧朝漳ፔጴጠጴፀፇ\u135fፁፔፚጹጷፃፄፁ朧朝漳ፓጟጠጴፀፇ\u135bጽፁጴጴ፩ፃጠፁጲፁጴጠጴፀፇፓጽፁጴጵጣፃፄፁ朧朝漳ፔ\u135bጵጥፀፚፓጽፁጴጵጢፃፄፁ朧朝漳ፔጴጠጴፀፇ";
		text += "\u135fፁፔፚጹጷፃፄፁ朧朝漳ፓጟጠጴፀፇፗጽፁጴጵጥፄፇ\u135fጲፁጟጠጴፀፇፓጽፁጴጵጣፃፄፁጲፀጟጨጴፀፚፓጽፁጶ፣ጢፃፄፁፂፀፚጠጴፀፇፓጽፅጴጵጢፃፅፁጵፓጟጠጴፄፚጹጽፁጴጵጢፃ\u135c\u135f朧朝漳ፓጟጠ፠ፁፇፓጽፁጵጹጲፃፄፁ朧朝漳ፓጟጤ፠ፀፇፓጾፅጴፅጢፃፄፁጽጼ";
		text += "ፚጠጴፁፇፓፁፅጴጵጢፃ\u135bፁ፡ፓጟጠጴፅፚጽጽፁጴፅጢፄ\u135c\u135f朧朝漳ፓጟጤፄፐጢፓጽፁጵ\u135fጴፃፄፁጵፔጴጤጴፀፇፓጽፐ\u135c፣ጢፃፄፁፂፀፚጠጴፀፇፗጿፁጴጵጢፃፇ\u135f፡ፓጟጠጴፄፚጹጽፁጴጵጢፃ\u135c\u135f朧朝漳ፓጟጤጴፐጢፓጽፁጵጹጲፃፄፁ朧朝漳ፓጟጤ፠ፀፇፓጾፔ\u135c፣ጢ";
		text += "ፃፄፅጽጼፚጠጴፁፇፗፂፁጴጵጢፃ\u135d\u135fጵፓጟጠጵፅፚፓጽፁጴፅጤፃፆ\u135f朧朝漳ፓጟጨጴፐጢፓጽፁጴጴ፨ፃፄፁጹፔፄጤጥፀፇፓጿፁጴፅጢፃፄፁጲፁፄጠጴፂፇ\u135bፂፁጴጵጢፃጟፁጵፓጟጠጴፁፃፁጽፁጴ\u135bጣፃጟፁ朧朝漳ፓጟጨፄፁፇፓጽፁጴጠጢፃፄፁጹፔፚጤጴፀፇፓጿፅ";
		text += "ጴፅጢፃፄፁፁፓጟጠጴፂፇ\u135fፁፅጴጵጢፃጟፁጵፓጟጠጴፀፚፅጽፁጴ\u135bጥፄ\u135bፁ朧朝漳ፓጟጨፄፐጢፓጽፁጵ\u135bጣፃፄፁጹጼጴጤጴፀፇፓጿፁጴፅጢፃፄፁፙፓጟጠጴፂፃ朧朝漳ጿፅጴጵጢፃጟፁጵፓጟጠጴፐጴጽጽፁጴ\u135bጥፄ\u135bፁ朧朝漳ፓጟጨጴፁፇፓጽፁጶ።ጟፃፄፁጹጼጵጹ፠";
		text += "ፀፇፓፁፐፚፅጢፃፄፅጹጼጴጠጴፂፃጵጾፔፚጵጢፃጟፁ፡ፓጟጠጴፀፃጹጽፁጴፚ፧ፄ\u135bፁ朧朝漳ፓጟጤፄፁፇፓጽፁፅጵጤፃፄፁጹጼፚጤፄፀፇፓፁፐ\u135c፣ጢፃፄፅፅጼጟጠጴፂፃጹፁፅጴጵጢፄፆ\u135f፡ፓጟጠጵፆፃጽጽፁጴፚ፨ፄፅፁ朧朝漳ፓጠጵጥፁፇፓጽፁጴፅጥፃፄፁጽጼ";
		text += "\u135bጹፄፀፇፓፁፅጶ፣ጢፃፄፁጹጼፄጠጴፃፃጹፂፅጴጵጢፄፅፁ፡ፓጟጠጵፄፇ\u135bጽፁጴፚ፩ፃፇ\u135f朧朝漳ፓጟጤጥፐጢፓጽፁጴጤጳፃፄፁጽጼጟጨጴፀፇፓፁፔ\u135c፣ጢፃፄፁፁጼጴጠጴፃፇፗጾፁጴጵጢፃጟፁ፡ፓጟጠጴፅፇ\u135fጽፁጴጟ፩ፄፚፁ朧朝漳ፓጠጵ፠ፐጢፓጽፁጵ\u135fጳፃፄ";
		text += "ፁጽጽጴጠጥፀፇፓፂፁጴፅጢፃፄፁፙጽፄጠጴፃፇፗጾፁጴጵጢፄፚፁ፡ፓጟጠጵፂፃጵጽፁጴጟጟፃጟፁ朧朝漳ፓጠጵ፠ፐጢፓጽፁፄጟጠፃፄፁጽጽፄጠ፠ፀፇፓጿፁጶ፣ጢፃፄፅፁጼጟጠጴፃፃፅጿፁጴጵጢፃጟፁጵፓጟጠጴፐጴጽጽፁጴፚጠፄፚፁ朧朝漳ፓጟጨጴፁፇፓጽፁፅ\u135f";
		text += "ጳፃፄፁጾፀፚጤፄፀፇፓጿፁጶ፣ጢፃፄፁ朧朝漳ጽፄጠጴፄፚጹፁፅጴጵጢፄ\u135c\u135f፡ፓጟጠጴፁፚፁጽፁጵጹጲፄ\u135bፁ朧朝漳ፓጠጹ፠ፐጢፓጽፁጴ\u135fጳፃፄፁፂፀጟጤጴፀፇፓጽፁጴፅጢፃፅፁፅፔጴጠጴፄፚጽፁፅጴጵጢፃፄፁጵፓጟጠፄፅፚጹጽፁጵጹጴፃፄፁ朧朝漳ፓጟጠጴፁፇ";
		text += "ፓጽፅጵ\u135bጥፃፄፁፂፁጴጤ፠ፀፇፓጾፁጶ፣ጢፃፄፁፂፀፚጠጴፀፚፁፁፔፚጵጢፃፄፁ፡ፓጟጠፄፄፚጹጽፁጴጹጵፃፆ\u135f朧朝漳ፓጟጤጴፐጢፓጽፁጴጴጠፃፄፁፂፁፅጵጥፀፇፓጾፁጶ፣ጢፃፄፅጵጼፄጠጴፄፚፉጽፁጴጵጢፃፚፁ፡ፓጟጠጵፂፇ\u135bጽፁጵጹጶፃ\u135bፁ朧朝漳ፓጟጠ";
		text += "፠ፁፇፓጽፅፄጟ፦ፃፄፁፂፁ\u135bጹጴፀፇፓጽፁጶ፣ጢፃፅፅጹፔፄጠጴፄፚፉጾፅጴጵጢፃፅፁጵፓጟጠፅፃፚፁጽፁጵጵጢፃ\u135c\u135f朧朝漳ፓጠጹጴፐጢፓጽፁፅጴ፦ፃፄፁፂፁጟጤጴፀፇፓጽፐ\u135c፣ጢፃፅፅፅፔጴጠጴፄፚፓጿፅጴጵጢፃፆ\u135f፡ፓጟጠፅፅፃጹጽፁጵጹጷፄፇ\u135f朧朝漳";
		text += "ፓጟጠ፠ፐጢፓጽፅፅ\u135bጤፃፄፁፁፓጟጠ፠ፀፇፗጽፔፚፅጢፃፅፁጲፀፚጠጴፅፇፓጾፔፚጵጣፃፇ\u135f፡ፓጟጠፄፁፚፅጽፁጵፉጷፃፚፁ朧朝漳ፓጟጤፄፐጢፓጽፁጴ\u135fጵፃፄፁፅፓጠጵጥፀፇፗጾፅጶ፣ጢፃፄፁጽፔፄጠጴፅፇፗጽፔፚጵጣፃፚፁጵፓጟጠፄፃፚፅጽፁጵፅጣፄፅፁ";
		text += "朧朝漳ፔጴጤጴፐጢፓጽፅጵጴ፨ፃፄፁፅፔጴጤጴፀፇፓጿፁጶ፣ጢፃፄፁፅፔፚጠጴፅፃፅጿፁጴጵጢፃፚፁጵፓጟጠፄፅፚፁጽፁጵፅጤፃፅፁ朧朝漳ፔጴጤፄፐጢፓጽፁጵፚጠፃፄፁፅፔፄጤ፠ፀፇፗጽፐ\u135c፣ጢፃፄፁ\u135dጼፚጠጴፅፇፗጾፁጴጵጢፃጟፁ፡ፓጟጠጴፐጴፓጽፁጵፅጣ";
		text += "ፃፚፁ朧朝漳ፓጠጵ፠ፁፇፓጽፁጶ።፩ፃፄፁፅፔፅጵ፠ፀፇፗጽፐ\u135c፣ጢፃፄፅጵጼፄጠጴፅፇ\u135fጽፐፚጵጣፃ\u135bፁጵፓጟጠፄፉ፩ጹጽፁጵፅጣፃፚፁ朧朝漳ፓጟጤፄፁፇፓጽፅፄ\u135bጥፃፄፁፅፔፚጠ፠ፀፇፗጿፁጴፅጢፃፄፁጵጽጴጠጴፂፇ\u135fጿፁጴጵጣፃ\u135d\u135fጵፓጟጠጵፂፚፉጽፁ";
		text += "ጵፅጤፃፆ\u135f朧朝漳ፓጠጵጥፁፇፓጽፁጵጴ፨ፃፄፁፅፔጴጤጴፀፇፓጽፔፚፅጢፃፅፅፂፀጟጠጴፅፇ\u135fፂፅጴጵጣፃጟፁ፡ፓጟጠጴፀፃጹጽፁጴፚ፦ፃጟፁ朧朝漳ፔጴጤ፠ፁፇፓጽፅፅፄ፨ፃፄፁፅጼፄጠጴፀፇፗጿፁጴፅጢፃፄፅፆፁፄጠጴፅፇ\u135fጿፁጴጵጣፃጠፁጵፓጟጠጵፆፚ";
		text += "ጹጽፁጵፅጥፄፅፁ朧朝漳ፓጟጤ፠ፐጢፓጽፅጴፄጠፃፄፁፉጼፄጤፄፀፇፗጾፐፚፅጢፃፅፁጶፁጟጠጴፆፇፓፁፅጴጵጢፃፇ\u135fጵፓጟጠጴፄፚጹጽፁጴጴ፧ፄፅፁ朧朝漳ፔጴጤ፠ፁፇፓጽፅጴ\u135fጷፃፄፁፐፀጟጤጴፀፇፓጽፔፚፅጢፃፄፁጾፁጴጠጴፆፃጹጽፐፚጵጣፃፇ\u135fጵፓጟጠ";
		text += "ጴፄፇ\u135bጽፁጵ\u135bጢፃ\u135c\u135f朧朝漳ፓጟጠፄፁፇፓጽፅጵጴጟፃፄፁፉፓጟጤ፠ፀፇፓጾፔ\u135c፣ጢፃፅፁፉጽፄጠጴፆፃጹፁፅጴጵጣፄፆ\u135f፡ፓጟጠጴፉ፩ፅጽፁጵፚ፩ፃፅፁ朧朝漳ፔጴጨጴፐጢፓጽፁጴጴ፨ፃፄፁጹጼጠጵፄፀፇፗጿፁጴፅጢፃፄፁ፡ጽጴጠጴፂፃፁጽፁጴጵጣፃ\u135c\u135fጵ";
		text += "ፓጟጠፅፁፇፓጽፁጵፚጟፃ\u135c\u135f朧朝漳ፔጵጵ፠ፁፇፓጽፁፅፄጟፃፄፁፉጽጵጹጴፀፇፗጿፁጶ፣ጢፃፄፅፐፀፚጠጴፆፃፅጽፔፚጵጣፃፚፁ፡ፓጟጠጴፃፚፁጽፁጵፚ፨ፃፆ\u135f朧朝漳ፔጴጤጴፐጢፓጽፁጴጴ፦ፃፄፁፙጽፄጨጴፀፇፗጿፁጶ፣ጢፃፅፁፂፀፚጠጴፀፇፓጾፐፚጵጢፃ";
		text += "ጟፁ፡ፓጟጠፄፀፚፁጽፁጶፁጴፃፄፁ朧朝漳ፓጠጵ፠ፁፇፓጽፅጴፉጶፃፄፁፙጼ\u135bጵፄፀፇፓጾፐፚፅጢፃፅፁጺፁፚጠጴፈ፩ፅፂፁጴጵጣፃ\u135c\u135f፡ፓጟጠጴፃፚፁጽፁጶጽጣፃፚፁ朧朝漳ፓጟጤፄፁፇፓጽፁፅጵጤፃፄፁጺፁጟጤጴፀፇፓፁፐ\u135c፣ጢፃፅፁፅጼጟጠጴፉጴጹጾፔፚ";
		text += "ጵጣፄፆ\u135f፡ፓጟጠፄፅፚፓጽፁጶፁጳፃጟፁ朧朝漳ፔጵጵ፠ፐጢፓጽፅጶጽጢፃፄፁፚፁጵጵጥፀፇፗፁፐፚፅጢፃፄፁፙጽጴጠጴፉጴፅፂፐፚጵጣፄፆ\u135fጵፓጟጠጴፐጴጽጽፁጶጼጟፄፚፁ朧朝漳ፔጴጤፄፁፇፓጽፁጴጟ፨ፃፄፁጶፁፚጤ፠ፀፇፗፁፔ\u135c፣ጢፃፅፅጹፓጟጠጴፉጴፉ";
		text += "ፁፐፚጵጣፄፇ\u135f፡ፓጟጠፅፃፇ\u135bጽፁጶፁጷፃፅፁ朧朝漳ፔጵጵፄፁፇፓጽፅፄጤጵፃፄፁፚፀ\u135bጵፄፀፇፓፁፅጴፅጢፃፅፅፁጼጟጠጴፉጴጹፁፅጴጵጢፃጠፁ፡ፓጟጠፄፄፚጹጽፁጴጹጷፃ\u135d\u135f朧朝漳ፔጴጨፄፁፇፓጽፅጴጹጳፃፄፁ\u135dፓጟጠጴፀፇ\u135bፂፁጶ፣ጢፃፅፅጾፁፄጠጴ";
		text += "ፉጴጹፁፅጴጵጢፄፚፁ፡ፓጟጠፅፄፃጽጽፁጶፁጲፄፅፁ朧朝漳ፓጠጵፄፐጢፓጽፅጵጹጲፃፄፁ朧朝漳ፓጟጨፄፀፇ\u135bጿፅጴፅጢፃፅፁጹጽጴጠጴፉጢፓፂፐፚጵጤፄ\u135c\u135fጵፓጟጠፄፄፃጹጽፁጶፓጣፄፚፁ朧朝漳ፔፅጹፄፐጢፓጽፅጵፄጟፃፄፁ\u135dፔፄጠጥፀፇ\u135bፁፅጴፅጢፃፅፁ";
		text += "ፂፀፚጠጴፀፇ\u135bጿፅጴጵጤፄ\u135bፁ፡ፓጟጠፄፆፃጵጽፁጶፓጥፃፇ\u135f朧朝漳ፔፄጨፄፁፇፓጽፅፄጤጴፃፄፁፁፓጟጤ፠ፀፇፓጾፅጴፅጢፃፄፁፐፀፚጠጴፉጢ\u135fፂፁጴጵጤፃጠፁ፡ፓጟጠፄፄፚጹጽፁጴጵጢፃጠፁ朧朝漳ፔፄጨፄፁፇፓጽፅጶጼ፦ፃፄፁ\u135dጼጴጠ፠ፀፇ\u135bጽፁጴፅጢ";
		text += "ፃፆ\u135f\u135eፀፚጠጴፉ፩朧朝漳ፂፁጴጵጤፄፚፁ፡ፓጟጠፄፐጢ\u135fጽፁጶፒ፧ፃፇ\u135f朧朝漳ፔፄጤጴፐጢፓጽፁጶ።ጟፃፄፁ\u135dጼፅጹጴፀፇ\u135bፂፁጶ፣ጢፃፅፅጾፁጴጠጴፄፇፓጾፐፚጵጢፃ\u135d\u135f፡ፓጟጠፄፆፃፅጽፁጵፚ፨ፃፆ\u135f朧朝漳ፔፄጤጴፐጢፓጽፅፄፚ፦ፃፄፁ\u135dጼ\u135bጵፄፀፇ\u135b";
		text += "ጾፅጴፅጢፃፄፅጽጼፚጠጴፉ፩ጽጽፔፚጵጤፃፅፁጵፓጟጠ፠ፄፚጹጽፁጴጵጢፃ\u135c\u135f朧朝漳ፓጟጠፄፐጢፓጽፐፚፄ፧ፃፄፁ፡ጼጠጵ፠ፀፇ\u135bጾፐፚፅጢፃፄፅፁፔፄጠጴፂፃጽጽፔፚጵጢፃ\u135d\u135f፡ፓጟጠፄፂፇፗጽፁጶ።ጟፃፆ\u135f朧朝漳ፔፄጤጥፐጢፓጽፅጴጠጥፃፄፁ፡ጽጴጨጴ";
		text += "ፀፇ\u135bጽፐፚፅጢፃፆ\u135fፁጼፚጠጴፐ፩ፁፁፔፚጵጤፃፆ\u135f፡ፓጟጠ፡ፄፇ\u135bጽፁጴ\u135bጣፃፚፁ朧朝漳ፓጟጤጴፁፇፓጽፁጵፄጠፃፄፁ፡ጽፄጠፄፀፇ\u135bጽፔፚፅጢፃፆ\u135fፙፓጟጠጴፐ፩ፅጾፔፚጵጤፃፆ\u135fጵፓጟጠ፠ፈ፩ጵጽፁጶ።ጟፄፇ\u135f朧朝漳ፔፄጤጴፁፇፓጽፁጵጴጟፃፄፁፉፓ";
		text += "ጟጤ፠ፀፇፓጾፁጴፅጢፃፄፁፂፀፚጠጴፀፇፓጾፐፚጵጢፃፚፁጵፓጟጠጴፉጴጹጽፁጶ፣ጢፃፅፁ朧朝漳ፓጟጤጴፁፇፓጽፁጶ፣ጢፃፄፁ፡ፓጟጠፄፀፇፓጽፔፚፅጢፃፆ፣ጵፔፚጠጴፐጢፓጽፅጴጵጢፃፇ\u135fጵፓጟጠ፡ፂፇ\u135fጽፁጶ፣ጢፃፅፁ朧朝漳ፓጟጤጴፁፇፓጽፁፄጟ፨ፃፄ";
		text += "ፁ።ፀፚጠ፠ፀፇ\u135bጾፅጴፅጢፃፄፅፁፔፄጠጴፂፚጹጿፁጴጵጤፃፚፁጵፓጟጠጵፃፚፉጽፁጶ፧ጲፄፅፁ朧朝漳ፓጟጠጥፁፇፓጽፐጠፄ፩ፃፄፁ።ፀ\u135bጹጴፀፇ\u135bጾፁጴፅጢፃፄፅፐፀፚጠጴፑጴጽጾፅጴጵጤፃፅፁጵፓጟጠፄፀፃ朧朝漳ጽፁፄፉጲፄፅፁ朧朝漳ፓጟጤፄፁፇፓጽፁ";
		text += "ጴጹጵፃፄፅጶፀጠጵ፠ፀፇ\u135bፂፁጶ፣ጢፃፄፁጵጼጴጠጵፁፚፁጽፁጴጵጤፃ\u135bፁጵፓጟጠ፡ፄፇ\u135bጽፁጴ\u135bጣፃፚፁ朧朝漳ፓጟጠጥፁፇፓጽፐፚፉጶፃፄፅጵጽፄጤጥፀፇ\u135bጾፅጶ፣ጢፃፆ\u135fፂፀፚጠጴፀፚፁጾፅጴጵጤፃ\u135c\u135f፡ፓጟጠፄፄፚጹጽፁጴጹጴፄፆ\u135f朧朝漳ፔፄጤ፠ፐጢ";
		text += "ፓጽፅጵፚጠፃፄፁፐፁፄጠጥፀፇ\u135bጾፐ\u135c፣ጢፃፅፁጾፁጟጠጵፁፚፅጿፁጴጵጤፃፇ\u135fጵፓጟጠፄፄፃ朧朝漳ጽፁፄፄ፨ፄፅፁ朧朝漳ፓጟጤ፠ፁፇፓጽፐ\u135bጹጲፃፄፁጲፁፅጹጴፀፇ\u135bጾፐ\u135c፣ጢፃፆ\u135fፂፀፚጠጴፀፚፁጾፅጴጵጤፃ\u135c\u135f፡ፓጟጠፄፄፚጹጽፁጴጹጶፃ\u135bፁ朧朝漳ፔ";
		text += "ፄጤ፠ፐጢፓጽፅጵፚጠፃፄፁፉፓጟጤ፠ፀፇፓጾፔ\u135c፣ጢፃፆ\u135fፂፀፚጠጴፀፚፁጾፅጴጵጤፃጟፁጵፓጟጠ፠ፑጴፁጽፁፄፉጶፄፚፁ朧朝漳ፔፄጨጴፐጢፓጽፐጟ\u135fጲፃፄፅጵፔ\u135bጵፄፀፇፓጽፐ\u135c፣ጢፃፅፅፉፔፄጠጴፄፚፓጾፁጴጵጤፃ\u135d\u135f፡ፓጟጠፅፃፇ\u135fጽፁፄፉጷፃጠፁ朧";
		text += "朝漳ፔፅጵ፠ፁፇፓጽፁፅጴ፧ፃፄፅጵጼፄጤጥፀፇፓጿፅጴፅጢፃፆ\u135fፂፀፚጠጴፀፇፓጾፐፚጵጢፃጠፁ፡ፓጟጠ፠ፄፚጹጽፁጴጵጢፃ\u135c\u135f朧朝漳ፓጟጠፄፐጢፓጽፁጵጹጲፃፄፁ朧朝漳ፓጟጤ፠ፀፇፓፁፅጴፅጢፃፆ\u135fፂፀፚጠጴፀፇፓጾፐፚጵጢፃ\u135d\u135f፡ፓጟጠፄፅፃ朧朝漳ጽፁ";
		text += "ፄ\u135fጷፄ\u135bፁ朧朝漳ፔፄጠ፠ፐጢፓጽፅፄጟ፦ፃፄፁፂፀ\u135bጵፄፀፇፓጾፔ\u135c፣ጢፃፅፁፉፔፚጠጵፂፇፗጾፁጴጵጢፄፆ\u135f፡ፓጟጠ፠ፉጢ\u135fጽፁፄ\u135bጢፃ\u135bፁ朧朝漳ፔፚጤጥፐጢፓጽፅጶፗጳፃፄፅጹፔጴጤጴፀፇፓፁፐፚፅጢፃፆ\u135fፂፀፚጠጴፀፇፓጾፐፚጵጢፄፆ\u135fጵፓጟጠ፡ፄፇ";
		text += "\u135bጽፁጴ\u135bጣፃፚፁ朧朝漳ፓጠጵጥፁፇፓጽፐጠጵጤፃፄፁጹፔጴጤጴፀፇፓጽፔ\u135c፣ጢፃፄፅጵጽፄጠጵፂፇፓፁፅጴጵጥፄፇ\u135f፡ፓጟጠ፡ፂፃጹጽፁፄ\u135bጣፃፄፁ朧朝漳ፔ\u135bጵጥፐጢፓጽፐጟጟ፩ፃፄፅጹፔጴጠጴፀፇ\u135fጿፁጶ፣ጢፃፄፅፁጼጴጠጵፂፇፗጾፁጴጵጢፄፇ\u135f፡ፓጟጠ";
		text += "፡ፄፚፁጽፁፄ\u135bጣፃፄፁ朧朝漳ፔፚጨጴፐጢፓጽፁፅፉጴፃፄፅጹፔጴጤጴፀፇ\u135fጽፐጠፅጢፃፄፁጲፀጟጠጴፀፇፗፁፅጴጴ፦ፃፆ፣ፅፓጟጠጴፁፇ\u135fጽፁጴጵጤፃፇ\u135f朧朝漳ጼጴጤጴፃፇፓጽፁጴፉጳፃፄፁ朧朝漳ፔፅጵጥፀፇ\u135fጽፐፚጵጢፃፚፁ\u135dፔፚጠጴፅፇ\u135bፁፔፚጵጥፃፆ";
		text += "\u135f朧朝漳ፓጟጤጴፉጴጽጽፁጵፅጤፄፇ\u135f朧朝漳ፔፚጤጴፀፇፓጾፁጶፓጥፃፄፁፅፔፅጵጥፀፇ\u135fጾፁጴጵጢፃፚፁፚፀጟጠጴፅፇ\u135bፁፔፚጵጥፄ\u135bፁ朧朝漳ፓጟጤፄፐጢ\u135fጽፁጵፅጤፄፇ\u135f朧朝漳ፔፚጠጵፄፇፓጽፁጵ\u135fጲፃፄፁጽፔጴጠፄፀፇፓጾፐጟፅጢፃፇ\u135fጵጼፄጠጴፀፃጹ";
