		text += "ጹፂፅጵፚ፦ፃ\u135c፣ፉጼጟጤጥፅፃ朧朝漳ጾፐ\u135bፄ፩ፃጟፁፙጼጴጤጵፃፃጹጾፅጵ\u135fጶፃ\u135c\u135fፙጼጟጤጴፆፃፁጾፁጴፅጢፃፄፁፉጽጴጤጥፈ፩ጹፂፅጵፚ፦ፃፄፁ朧朝漳ጼጴጤጴፄፚፁጾፅጵ\u135bጢፃፄፁፐፁፚጠጴፀፃ朧朝漳ጾፔ\u135bፄ፦ፃ\u135bፁፉፓጟጠጴፈጢ\u135bጾፐ\u135bፄ፩ፃፚፁ朧朝";
