		text += "ጴፂፚፉጽፁጴጵጥፃ\u135d\u135f朧朝漳ፓጟጤ፠ፄፇፓጽፁጴጵጢፃፅፁፅጼጟጠጥፀፇፓጾፐ\u135bፅጢፃፄፁፙፔፄጠጴፀፃጽጾፐፚጵጢፃ\u135c\u135fፅፓጟጠጴፈጢ\u135bጽፁጴጵጤፄ\u135bፁ朧朝漳ፓጟጤ፠ፅፇፓጽፁጶጼጟፃፄፁ朧朝漳ጼፚጤፄፀፇፓጽፁጴጵጢፄ\u135c\u135fፁፔጴጠጴፀፃጽጽፁጴጵጢፃ\u135d";
