		text += "ፇ\u135f朧朝漳ፓጟጤፄፂፇፓጽፁጶጼ፧ፃፄፁ朧朝漳ጼ\u135bጹፄፀፇፓጽፁጴጵጢፃፅፁ朧朝漳ፓጟጠፄፃፃጵጽፔፚጵጢፃ\u135c፣ፉፓጟጠጴፆፃጹጽፁጴጴ፩ፃፚፁ朧朝漳ፓጟጤጥፈጢፓጽፁጵ\u135bጣፃፄፁ朧朝漳ጼጟጠ፠ፀፇፓጾፐ\u135bፅጢፃፄፁፆፁጴጠጴፀፇፓጽፁጴጴ፧ፃ\u135c፣ጽፓጟጠጴ";
