		text += "ፓጽፁጴጤጵፃ\u135c\u135fጽፓጟጠጴፆፚፅጽፁጴጴ፨ፃፚፁ朧朝漳ፓጟጠ፡ፅፇፓጽፁጵፚ፧ፃፄፁ朧朝漳ጼጟጨጴፀፇፓጾፐ\u135bፅጢፃፄፁጹፓጟጠጴፀፇ\u135bፂፐፚጵጢፃ\u135c\u135fጽፓጟጠጴፂፇፓጽፁጴጴ፩ፃፄፁ朧朝漳ፓጟጤ፠ፐጢፓጽፁጵ\u135fጶፃፄፁ朧朝漳ጼፚጤጥፀፇፓጽፐፚጵጢፃፄፁ";
		text += "ጽፓጟጠጴፀፇ\u135bጽፁጴጵጢፃፆ፣ፁፓጟጠጴፆፚፉጽፁጴጵጤፃፄፁ朧朝漳ፓጟጠጥፂፇፓጽፁጴ\u135bጢፃፄፁ朧朝漳ፔፄጤ፠ፀፇፓጽፐፚጵጢፃፄፁፉጼጴጠጴፀፃጹጾፅጴጵጢፃ\u135c፣ጽፓጟጠጴፂፇፓጽፁጴጵጤፃፆ\u135f朧朝漳ፓጟጠጴፁፇ\u135bፁፐ\u135bፅጥፃፄፁ朧朝漳ጼጴጤፄፀፇፓጾ";
		text += "ፁጵፅጢፃፄፁፆፁጟጠጴፀፃ朧朝漳ፂፁጴጵጢፃፚፁጵፓጟጠጴፅፇ\u135fጽፁጴጴ፦ፄፆ\u135f朧朝漳ፓጟጤፅፆፇፓጽፁጵጹጶፃፄፁ朧朝漳ጼጵጹ፠ፀፇፓጾፅፄፅጢፃፄፁፂፁጟጠጴፀፃ朧朝漳ፂፅጴጵጢፃፚፁፅፓጟጠጴፄፇ\u135fጽፁጴጴ፦ፃጟፁ朧朝漳ፓጟጤጴፅፇፓጽፁጵጵጥፃፄፁ";
		text += "朧朝漳ጼጵጵ፠ፀፇፓጾፅጴጠጢፃፄፁ朧朝漳ፓጟጠጴፃፇ\u135fጽፅጴጵጢፃፄፁ朧朝漳ጼጴጤጥፆፚፉጽፁጴጴ፨ፃ\u135bፁ朧朝漳ፓጟጤጥፄፇፓጽፁጶጽጥፃፄፁ朧朝漳ጼፚጨጴፀፇፓጽፐፚጵጢፃፄፁፉጼፚጠጴፀፃጹጿፅጴጵጢፃ\u135d\u135fጹፓጟጠጴፆፃጵጽፁጴጴ፩ፃ\u135d\u135f朧朝漳ፓጟጤ፠";
		text += "ፁፇፓጽፁጵ\u135fጴፃፄፁ朧朝漳ጼ\u135bጵጥፀፇፓጽፐፚጵጢፃፄፁፉፔጴጠጴፀፃጹጾፁጴጵጢፃ\u135c\u135fፁፓጟጠጴፂፇፓጽፁጴጴ፨ፃፅፁ朧朝漳ፓጟጤ፡ፃፇፓጽፁጵ\u135fጴፃፄፁ朧朝漳ጼ\u135bጹ፠ፀፇፓጾፔ\u135cጽጢፃፄፁፉጼፄጠጴፀፃጹጾፁጴጵጢፃ\u135d\u135f朧朝漳ፓጟጠጴፈጢ\u135bጽፁጴጴ፨ፄ";
		text += "\u135c\u135f朧朝漳ፓጟጤ፠ፈጢፓጽፁጶጽጤፃፄፁ朧朝漳ጼፚጠፄፀፇፓጾፐጠጵጢፃፄፁጹፓጟጠጴፀፇ\u135bጽፐፚጵጢፃፄፁ朧朝漳ፓጟጤጥፂፇ\u135bጽፁጴጵጤፃፄፁ朧朝漳ፓጟጠ፠ፂፇፓጽፁጴጵጢፃፅፁጵፔፄጠ፠ፀፇፓጽፐፚጵጢፃፄፁፁጼፄጠጴፀፃ朧朝漳ፂፅጴጵጢፃፚፁጵፓጟጠጴ";
		text += "ፄፇ\u135bጽፁጴጴ፦ፄፇ\u135f朧朝漳ፓጟጤጴፅፇፓጽፁጴጵጢፃፄፁ፡ፔፄጠ፠ፀፇፓጽፐፚጵጢፃፄፁጺፁፚጠጴፀፇ\u135bፂፅጴጵጢፃፄፁ朧朝漳ፓጟጤፄፆፚጽጽፁጴጴ፨ፄፇ\u135f朧朝漳ፓጟጠጴፀፇፓጿፅጶጽጢፃፄፁ朧朝漳ጼጟጠ፠ፀፇፓጾፐጠ\u135bጢፃፄፁፉጼፚጠጴፀፇፓጽፁጴጵጥፃ";
		text += "ፙ朧朝漳ፅፓጟጠጴፀፇፓጽፁጴጠጤፃፅፁ朧朝漳ፓጟጠጴፀፇፗጽፅጵፚ፩ፃፄፁ朧朝漳ጼፚጤፄፀፇፓጾፔ\u135bጵጢፃፄፁፙጼፚጠጴፀፃጹጽፅጴጵጢፃ\u135c፣ጽፓጟጠጴፈ፩ጵጽፁጴጴ፨ፃ\u135bፁ朧朝漳ፓጟጠጴፀፇፓጽፔ\u135bጵጢፃፄፁ朧朝漳ፓጟጠጴፀፃጵጾፔፚ\u135bጢፃፄፁፐፁፚጠጴ";
		text += "ፀፇፓጽፁጴጴ፩ፃፚፅፁፓጟጠጴፅፇ\u135fጽፁጴጴ፦ፃ\u135d\u135f朧朝漳ፓጟጠጴፀፇፗፁፐ\u135bጴ፧ፃፄፁ朧朝漳ጼጟጨጴፀፇፓጾፐ\u135bፅጢፃፄፁፉፔፚጠጴፀፃጽጾፅጴጵጢፃ\u135d\u135fፁፓጟጠጴፆፃጵጽፁጴጵጤፃፄፁ朧朝漳ፓጟጤጴፅፇፓጽፁጵፅጤፃፄፁ朧朝漳ጼፄጠ፠ፀፇፓጾፁፅ\u135bጢፃ";
		text += "ፄፁፅፔፄጠጴፀፇፓጽፁጴጴ፩ፃ\u135c\u135fጹፓጟጠጴፆፚፁጽፁጴጴ፨ፃፅፁ朧朝漳ፓጟጠጴፀፇፗፂፁጵጴ፦ፃፄፁ朧朝漳ጼ\u135bጹ፠ፀፇፓጾፔ\u135cጽጢፃፄፁፐፁፚጠጴፀፃጹፁፔፚጵጢፃ\u135c፣ፉፓጟጠጴፆፇፗጽፁጴጴ፨ፃፚፁ朧朝漳ፓጟጠ፠ፀፇፓጽፁጵጴ፧ፃፄፁ朧朝漳ጼፄጠ፠ፀፇ";
		text += "ፓጾፅጴ\u135bጢፃፄፁፂፁጟጠጴፀፃጵጽፐፚጵጢፃፄፁ朧朝漳ፔጴጨፄፄፃጵጽፁጴጴ፩ፃጟፁ朧朝漳ፓጟጤ፠ፅፇፓጽፁጵ\u135bጥፃፄፁ朧朝漳ጼጟጤፄፀፇፓጾፔ\u135bጵጢፃፄፁፉጼፄጠጴፀፃጹጾፁጴጵጢፃፆ\u135f朧朝漳ፓጟጠጴፄፇፗጽፁጴጴ፩ፃፇ\u135f朧朝漳ፓጟጠ፠ፀፇፓጽፁጴጵጢፃ";
		text += "ፅፅፁጼጴጤፄፀፇፓጾፔ\u135cፓጢፃፄፁፉጼፄጠጴፀፃጹጽፔፚጵጢፃ\u135d\u135fፅፓጟጠጴፈ፩朧朝漳ጽፁጴጴ፨ፃ\u135bፁ朧朝漳ፓጟጠ፠ፀፇፓጽፁጵጴ፧ፃፄፁ朧朝漳ጼፄጠ፠ፀፇፓጾፅጴ\u135bጢፃፄፁፂፁጟጠጴፀፃጵጽፐፚጵጢፃፆ\u135f朧朝漳ፓጟጠጴፀፇፓጽፁጶጼ፨ፃጠፁ朧朝漳ፓጟጤ፡";
		text += "ፅፇፓጽፁጶጼ፨ፃፄፁ朧朝漳ፓጟጠጴፀፃጵጾፔፚጵጢፃፄፁፐፁጴጠጴፀፇፓጽፁጴጵጥፃፚፁጵፓጟጠጴፀፇፓጽፁጴጟ፨ፃጟፁ朧朝漳ፓጟጠጴፀፇፓጽፔ\u135cጽጢፃፄፁ朧朝漳ፓጟጠጴፀፃጽጾፐጠ\u135bጢፃፄፁፙፔፚጠጴፀፃጹፁፐፚጵጢፃፄፁ朧朝漳ፓጠጵ፠ፈጢ\u135fጽፁጴጴ፩ፃ";
		text += "ፚፁ朧朝漳ፓጟጤ፠ፁፇፓጽፁጶጽጤፃፄፁ朧朝漳ጼጟጤጴፀፇፓጽፁጴጵጢፃ\u135d\u135fፂፁጟጠጴፀፃጹጾፐፚጵጢፃ\u135c\u135fፉፓጟጠጴፀፇፓጽፁጶጼ፨ፄ\u135c\u135f朧朝漳ፓጟጤ፠ፆፇፓጽፁጵፚ፨ፃፄፁ朧朝漳ፓጟጠጴፀፃጽጾፔፚ\u135bጢፃፄፁፉጼፄጠጴፀፃጽጾፁጴጵጢፃፄፁ朧朝漳ፓጟጤፄ";
		text += "ፄፃጽጽፁጴጴ፧ፃፚፁ朧朝漳ፓጟጠጴፀፇፓጾፔ\u135bጵጥፃፄፁ朧朝漳ጼጴጠፄፀፇፓጾፅጴጵጢፃፄፁ朧朝漳ፓጟጠጴፅፃጽጾፅጴጵጢፃ\u135c፣ፅፓጟጠጴፀፇፓጽፁጵፄ፩ፃ\u135bፁ朧朝漳ፓጟጤጥፀፇፓጽፁጴጵጢፃፅፁ፡ጼፄጤፄፀፇፓጾፔፚጵጢፃፄፁፉጼጴጠጴፀፃጹጽፅጴጵጢፃ";
		text += "\u135d\u135fፁፓጟጠጴፆፃጵጽፁጴጵጤፃፄፁ朧朝漳ፓጟጤጴፅፇፓጽፁጵፅጤፃፄፁ朧朝漳ጼፄጠ፠ፀፇፓጾፁፅ\u135bጢፃፄፁፅፔፄጠጴፀፇፓጽፁጴፄጠፃ\u135bፁፅፓጟጠጴፈጢፓጽፁጴጴ፨ፃፚፁ朧朝漳ፓጟጤ፠ፁፇፓጽፁጶጼ፦ፃፄፁ朧朝漳ጼፚጨፄፀፇፓጾፐጠፅጢፃፄፁፉጼጟጠጴፀፇ";
		text += "\u135bጽፁጴጵጢፃ\u135bፁፁፓጟጠጴፆፚፓጽፁጴጵጤፃፄፁ朧朝漳ፓጟጠጴፀፇፗፁፐ\u135bፄ፧ፃፄፁ朧朝漳ጼጟጠጴፀፇፓጾፐ\u135bጵጢፃፄፁፉፔጴጠጴፀፃጽጾፁጴጵጢፃ\u135c\u135fፅፓጟጠጴፂፇፓጽፁጴጴ፦ፃ\u135bፁ朧朝漳ፓጟጤፄፂፇፓጽፁጵፅጤፃፄፁ朧朝漳ጼጵጹ፠ፀፇፓጾፅጴ\u135bጢፃፄፁ";
		text += "ጹፓጟጠጴፀፇፓጽፁጴጴ፧ፃፚፁፅፓጟጠጴፈ፩ፁጽፁጴጵጢፃፄፁ朧朝漳ጼጟጤፄፀፇፓጽፁጵጹጴፃፄፁ朧朝漳ጼጴጤጥፀፇፓጽፁጴጵጢፃ\u135d\u135fፉጽፄጠጴፀፃጹፂፅጴጵጢፃ\u135c\u135fፁፓጟጠጴፀፇፓጽፁጴጟ፦ፃጟፁ朧朝漳ፓጟጠጴፀፇፓጽፔ\u135bፅጢፃፄፁ朧朝漳ፓጟጠጴፀፇ\u135fጾ";
		text += "ፐፚጠጢፃፄፁ朧朝漳ፓጟጠጴፅፃ朧朝漳ጾፅጴጵጢፃ\u135bፁጹፓጟጠጴፀፇፓጽፁጵፄ፩ፃጟፁ朧朝漳ፓጟጠጥፂፇፓጽፁጴጵጢፃፄፁጽፓጟጠጴፀፇፓጽፁጴፅጢፃ\u135bፁጲፁፄጠጴፀፇፓፁፅጴጵጢፃፄፁ朧朝漳ፓጟጠጥፃፚጹጽፁጴጵጢፃፄፁ朧朝漳ጼጟጤ፠ፐጢፓጽፁጵ\u135fጶፃፄፁ";
		text += "朧朝漳ጼፚጤ፠ፀፇፓጽፁጴጵጢፄፆ\u135fፉፔፚጠጴፀፃጹፁፔፚጵጢፃ\u135c\u135fፅፓጟጠጴፆፇፗጽፁጴጴ፩ፃፆ\u135f朧朝漳ፓጟጠጴፀፇፓጾፅጵፚ፦ፃፄፁ朧朝漳ጼፚጨፄፀፇፓጽፁጴጵጢፃ\u135d\u135fፉፔጴጠጴፀፃጹጽፔፚጵጢፃ\u135d\u135fፁፓጟጠጴፀፇፓጽፁጶ።፧ፄፆ\u135f朧朝漳ፓጟጤ፡ፂፇፓጽ";
		text += "ፁጵ\u135fጴፃፄፁ朧朝漳ጼፅጹጴፀፇፓጽፁጴጵጢፃ\u135d\u135fጲፁፄጠጴፀፇፓፁፅጴጵጢፃፄፁጵፓጟጠጴፀፇፗጽፅጴጟ፩ፃጠፁ朧朝漳ፓጟጤጥፐጢፓጽፁጴ\u135fጷፃፄፁ朧朝漳ጼጵጹጴፀፇፓጾፁፅጵጢፃፄፁጺፁጟጠጴፀፃጹጾፁጴጵጢፃ\u135c\u135fፁፓጟጠጴፂፇፓጽፁጴጵጢፃፄፁ朧朝漳ጼ";
		text += "ጟጠጴፁፇፓጽፁጴጹጵፃፄፁ朧朝漳ፓጠጵፄፀፇፓጽፁጴፅጢፃፇ\u135fፆፀጟጠጴፀፇፓጽፁጴጵጥፃ\u135bፅፁፓጟጠጴፀፇፓጽፅጴጟ፧ፄፆ\u135f朧朝漳ፓጟጤጴፅፇፓጽፁጵጹጶፃፄፁ朧朝漳ጼፄጤጴፀፇፓጾፁጵፅጢፃፄፁፅፔፄጠጴፀፃጵፂፁጴጵጢፃፄፅፁፓጟጠጴፀፚጹጽፁጴጵጢ";
		text += "ፃፄፁጲፁጟጤፅፂፇፓጽፁጵፄ፦ፃፄፁ朧朝漳ጼጴጠፄፀፇፓጾፅጴጵጢፃፄፁፆፁፄጠጴፀፇፓፂፁጴጵጢፃፄፅጵፓጟጠጴፀፇፓጽፁጵፅጥፃፆ\u135f朧朝漳ፓጟጠጥፀፇፓጽፁጴጵጢፃፄፁ朧朝漳ፓጟጠጴፀፇፓፁጼጵጹጵፃ\u135d\u135f\u135dጼጵጹ፠ፆፃጽፁፐጠፚጟፃ\u135d\u135f朧朝漳ጼጴጣ፦ፁ";
		text += "ፇ\u135bጾፐፚ\u135bጢፄፚፁ\u135dጽፄጠጵፁፚጹፁፔ\u135b\u135fጵፄፆ\u135fጽፓጟጠጴፀፃ朧朝漳ጽፐፚጵጢፃፅፁ朧朝漳ፔጴጠጴፉጢፓጽፔፚ\u135bጢፃፄፁ朧朝漳ፓጟጠፄፀፃ朧朝漳ጽፁጴጵጢፃፅፁ朧朝漳ፔፄጠጵፅፇፓጾፁጴጵጢፃፄፁ朧朝漳ፔጴጠ፠ፂፚፅጽፁጴጠጤፃፄፁ朧朝漳ፓጟጠጵፅፇፓጾ";
		text += "ፁጴ\u135bጢፃፄፁጵፓጟጠፄፀፚፉጽፁጵጵጤፃፄፁ朧朝漳ፓጟጠፄፂፇ\u135fጿፅጴጴ፦ፃፆ\u135f朧朝漳ፓጟጠጴፁፇ\u135bጾፁጴፅጢፃ\u135bፁ朧朝漳ፓጟጠጴፂፇፓፂፅጴጹጶፃፄፅፅፓጟጤ፠ፂፇፓጽፁጴ\u135bጣፃፆ\u135fፁፔጴጠጵፅፇፓጽፐፚጴ፧ፃፄፁ朧朝漳ፓጟጠፄፀፇፗጽፅጴ\u135bጥፃ\u135bፁ朧朝";
		text += "漳ፔፚጠጴፀፇፓጽፁጴጵጣፃፄፁፅፔፄጠጴፀፇፗጽፅጴፚ፦ፃፅፁጲፁፚጠጴፄፇፓጽፁጴጵጣፃፅፅጽፔጵጵጥፀፃጵጽፐፚጵጢፃፆ\u135fጶፁጴጠጵፅፇፗፁፔፚጴ፩ፃፆ\u135f朧朝漳ፓጟጠጥፀፇፗጽፁፅፅጣፄፇ\u135fጵፔጴጤፄፁፇፓጾፐፚጵጢፃፄፁጽፓጟጠ፠ፁፚፁጽፅፄጠጢፃፆ";
		text += "\u135f朧朝漳ጼፚጠጴፀፇፓጽፔፚጹጶፃፄፅፅፓጠጹፄፀፚፉጽፁጵጵጢፃፄፁ朧朝漳ፔጴጠጵፅፇፗፁፔፚጵጥፃፄፁ朧朝漳ፓጟጠጴፀፚፉጽፁጵጵጤፃፄፁ朧朝漳ፓጟጠፄፁፃጵጾፅጴጴ፦ፃፆ\u135f朧朝漳ፓጟጠፄፀፚፉጽፁፅፅጢፃፚፁጹፓጟጠጴፀፇፗጽፐ\u135bፚ፧ፃፄፁፅፔፄጠጴፀ";
		text += "ፇ\u135bጽፁፅፅጢፄ\u135bፁጲፁፚጠጴፄፇፓጽፁጴጵጢፃፅፁጹጼፚጨፄፀፃፅጽፁጴጵጢፃፚፁጶፁፄጠጵፅፇፓፂፅጴጹጶፃፄፁ\u135dፔጴጠፄፈጢፗጽፁጵፅጢፃፄፁ朧朝漳ፔጴጠጵፅፇፗጽፅጶጼ፧ፃፄፁፁፔፄጠጴፀፇፗጽፁጴ\u135bጢፄ\u135bፁ朧朝漳ጼጟጠ፠ፀፇፓጽፐፚፅጤፃፚፁጵፓጠ";
		text += "ጹፄፁፇፗጾፔ\u135c፣ጢፃፚፁጹፓጟጠጴፀፇፗፂፁጴጹጶፃፄፁጽፔፄጠጴፀፇፓጽፁጶፓጢፃ\u135bፁ朧朝漳ፓጟጠጴፁፇፓፂፅጴፉጵፃፄፁፅፓጟጤፄፀፇፓጽፁጴፅጣፄፚፁ朧朝漳ጼፄጠጵፅፇፓጾፅጴጵጢፃፄፁ朧朝漳ፔጴጠ፠ፉጢፓጿፁጴፅጢፃ\u135bፁጹፓጟጠጴፁፇፗፂፁጴጴ፧ፃ";
		text += "ፄፅፅፓጟጤፄፂፇፓጽፁጴፅጢፄ\u135bፁጶፁፄጠጴፅፇፓጾፅጴ\u135bጢፃፄፁጵፓጟጠፄፁፚፅጽፁጵፅጢፃጠፁጹፓጟጠጴፂፇፓጽፅጴፅጤፃጟፁ朧朝漳ጽጴጨፄፁፇፗጿፁጴጴጟፄፚፁ朧朝漳ፔፚጠ፠ፀፇፓጽፁጴጹጲፃፄፁፁፔፄጠጴፀፇፗጽፁጴፅጢፄፅፁ朧朝漳ጼጟጠ፠ፀፇፓጽ";
		text += "ፔፚጴጟፃፅፅፁፓጟጤፄፀፃፁጽፁጶፓጢፃ\u135c\u135f朧朝漳ፓጟጠጴፂፇፓጿፁጴፉጵፃፄፁፅፓጟጨጴፀፃ朧朝漳ጽፁጴጵጢፃፅፁጲፁፚጠጴፉጢፓጽፐፚጴ፨ፃፅፁ\u135dፓጟጤፄፀፇፓጽፁጴ\u135bጢፃፆ\u135fጵጽጴጠፄፉጢፓጾፁጴጵጢፃፄፁጵፓጠጵፄፁፃፁጽፁጵጵጢፃፄፁ朧朝漳ፔጴጠ";
		text += "ጵፅፇፓፂፅጴጴ፨ፃፄፁ朧朝漳ፓጟጠፄፁፇ\u135bጽፐጠጵጣፄፚፁ朧朝漳ጼፄጠጴፆፇ\u135bጽፁጴጵጢፃፅፅፁፔጴጠ፠ፉጢፓፁፅጴፅጢፃ\u135c\u135fጹፓጟጠጴፀፇፗፂፁጴፅጤፃጟፁጲፀፚጤፄፀፃ朧朝漳ጽፐፚጵጢፃፄፁጵፔፄጠ፡ፄፇፓጾፁጴ\u135bጢፃፄፁጵፔጵጵጥፀፚፉጽፁጵ\u135bጢፃፄ";
		text += "ፁ朧朝漳ፔፚጠጴፉጢፓፂፅጴጹጶፃፄፁጹፓጟጤፄፂፇፓጽፁጴጵጣፃፆ\u135f\u135dፓጠጵፄፐጢፓጾፅጴ\u135bጢፃፄፁጹፓጟጠፄፀፚፉጽፁጴ\u135bጢፃጠፁ朧朝漳ፓጟጠጴፄፇፓጿፁጴጹጶፃፅፁጵጽጴጠጵፁፚፅጽፁጴ\u135bጢፃጟፁ朧朝漳ጼጟጠጴፀፇፓጾፁጴጹጶፃፄፅፅፓጠጹፄፀፚፉጽፁ";
		text += "ፅፅጢፃፚፁ朧朝漳ፓጟጠጴፁፇፓጽፅጴጹጶፃፄፁፁፓጟጠጴፀፇፗጽፁጴፅጢፃጟፁ朧朝漳ጼጟጠ፠ፀፇፓጽፐፚጵጣፃፄፅፅፔጴጠፄፉጢፓፁፐ\u135c፣ጢፃ\u135d\u135fጹፓጟጠጴፃፇፓጽፅጴፉጵፃፄፁፅፓጟጨጴፀፃፁጽፁጵ\u135bጢፃፄፁ朧朝漳ፔጴጠፄፂፃፁጽፁፄ\u135fጵፃፄፅፅፓጟጨጴ";
		text += "ፀፇፓጽፁጴጠጢፃፅፁጲፁፚጠጵፅፇፗጽፅጶፓጢፄፇ\u135fጵፓጟጤፄፀፇፓጽፁጴፅጢፄ\u135bፁጶፁፄጠጵፅፇፓጾፅጴ\u135bጢፃፄፁጹፓጟጠፄፀፚፉጽፅፄጠጢፃ\u135c\u135f朧朝漳ፓጟጠጴፃፇፓጽፅጴጹጶፃፄፅፅፓጟጠ፠ፀፃጵጽፁጴጵጢፃፆ\u135fጶፁጴጠፅፃፇፗፁፔፚጴ፦ፃፆ\u135f朧朝漳ፓ";
		text += "ጟጠፄፀፇ\u135fጽፁጶፓጢፃፚፁጹፓጟጠጴፀፇፗፂፁጴጴ፧ፃፄፁፉፓጟጠጴፀፇ\u135bጽፁጴፅጢፄ\u135bፁጶፁፄጠጴፅፇፓጽፐፚፉጵፃፄፁፅፔጴጠጴፀፇፓጽፁጵ\u135bጢፃፅፁጶፁጴጠፄፂፃፁጽፁፄፄ፧ፃፄፅፅፔጵጹጴፁፚፁጽፅፅጵጢፄ\u135bፁጶፁፄጠፄፂፃፁጽፁፄፄ፧ፃፅፁጽፓጟ";
		text += "ጠጴፀፃፁጽፅፄጠጣፄፇ\u135fጵፔፄጨጴፀፚጹጾፅጴጹጶፃፅፅፁፔጵጵጥፁፚፅጽፁፅፅጣፄፚፁጵፔፄጨጴፀፚጹጾፅጴፉጵፃፄፁጹፓጟጠ፠ፁፇ\u135bጽፁጴጵጢፃ\u135d\u135fጶፁጴጠፅፃፇፗጽፐ\u135cፓጢፄፅፁፅፓጠጹፄፁፚፅጽፅፄጠጣፄፚፁጲፁፚጠፅፄፇፗጽፐ\u135cፓጢፄፅፁፅፔጵጹ";
		text += "ጴፀፇ\u135bጽፁጵ\u135bጢፃፄፁ朧朝漳ፔፚጠፅፃፇፗፁፔፚፉጴፃፄፁጹፓጟጤጴፀፇፓጽፁጴፅጢፃፆ\u135fጶፁጴጠጴፅፇፓጽፁጴጵጢፃፅፁጹጽጴጠጵፅፃጵጽፁጵፅጤፃፄፁ朧朝漳ፓጟጠፄፁፃፁጽፁፅጵጣፃፄፁ\u135dፔፄጠጴፀፇ\u135fጽፁጴፅጢፃጟፁ朧朝漳ጽጴጠፄፁፃፁጽፁፅፄጠፃፄ";
		text += "ፁ\u135dፓጟጠጴፀፇፗጽፅጴፚጟፃፄፅጽጽፄጠፄፂፃፁጽፁፅፉጵፃፄፁፅፔፄጠጴፀፇ\u135bጽፁጴፅጢፃጟፁ朧朝漳ጽጴጠጵፄፇ\u135bጽፁጴጴ፨ፃፄፁጵፓጟጨጴፀፃፁጽፁጶፓጢፃጟፁጵፔጴጨጴፀፚፅጾፅጴፅጣፃጟፁጲፁጟጠፄፀፃጵጽፁጴጵጢፃፄፁጵፔፄጨጴፀፚፓጾፅጴጴ፧ፃ";
		text += "ፄፁ朧朝漳ፓጟጠጴፁፇፗጿፁጴጹጷፄፚፁ朧朝漳ጽፄጠ፠ፀፇፓጽፐፚጵጣፃፅፁጵጽጴጠጵፆፚፅጽፅጴፄጟፃፄፅፁጼፄጠጴፐጢ\u135bጽፁጴጵጤፃፄፁጵፔጴጠ፠ፉጢፓፁፔ\u135c፣ጣፃፅፁ\u135dፓጠጹጴፁፇፓጾፁጴጵጢፃፄፁጵፓጟጨጴፀፚፉጽፁፄፅጤፃፄፁ朧朝漳ጼፄጠጴፁፇፗጽ";
		text += "ፐ\u135cፓጢፄ\u135bፅፁፓጟጨጴፀፃፁጽፁጶፓጢፃጟፁ朧朝漳ጼፄጠጴፀፇፓጽፁጴፅጤፃጟፁጵፓጟጠፄፀፃፅጽፐፚጵጢፃፆ\u135f朧朝漳ፔጴጠፄፂፃፁጽፁጶፒጠፃፅፁጹጽጴጠፄፀፇፗጽፁጵጵጤፃፄፁ朧朝漳ፔጴጠጴፁፇፓጾፅጴጴ፩ፃፄፁ朧朝漳ፓጟጠ፠ፁፇ\u135bጿፁጴጹጳፄፚፁጲፁ";
		text += "ፚጠጵፅፇፓጿፁጴጵጢፃፄፁጵፔጴጠ፠ፉጢፓፁፅጵፅጣፃፅፁ\u135dፔጴጠጴፅፇፓጾፔፚጵጢፃፄፁጹፔጵጵጥፁፚፁጽፅጴፚጟፃፄፅጵጼፄጠጴፆፇ\u135bጽፁጴጵጣፃፅፅፁፓጟጤፄፁፚፅጽፁጵፅጢፃ\u135bፁ朧朝漳ፓጟጠጴፀፇፗጽፐ\u135cፓጢፄፆ፣ፁፓጟጠጥፂፇፓጽፁጴጵጣፃጟፁ朧";
		text += "朝漳ጼጴጠጴፀፇፓጽፅጴጵጣፃፅፅጽፓጟጤፄፂፇፓጽፁጴጵጣፃፆ\u135f\u135dፔጴጠፄፐጢፓፁፅጴ\u135bጢፃፄፁፁፓጟጨጴፁፚፅጽፁጵፅጢፃጟፁ朧朝漳ጽጴጠፄፁፃፁጽፅጴፉጵፃፄፁፅፔፄጠጴፀፇ\u135bጽፁጴፅጢፄ\u135bፁ朧朝漳ጽጴጠጴፄፇፓጽፁጴጵጣፃፄፅፅፓጟጠ፠ፀፃጽጽፐፚጵ";
		text += "ጢፃፆ\u135f朧朝漳ፔፄጠጴፉጢፗጽፅጶፓጣፃፆ\u135fጵፓጟጤፄፂፇፓጽፁጴጵጣፃፆ\u135f\u135dፔጴጠ፠ፅፇፓጾፁጴጵጢፃፄፁጵፓጠጵፄፀፚፉጽፁጵጵጢፃፄፁ朧朝漳ፔጴጠጴፃፇፓጿፁጴጴ፧ፃፆ\u135f朧朝漳ፓጟጠ፠ፀፇፗጽፅፄጠጣፃጟፁ朧朝漳ጼጟጠ፠ፀፇፓጽፐፚጵጣፃፅፁጹጽጴጠፄ";
		text += "ፂፚፅጽፁጶፓጢፃፚፁጹፓጟጠጴፁፇፓጽፅጴፉጴፃፄፁፁፔፄጠጴፀፇፗጽፁጴ\u135bጢፃጟፁ朧朝漳ጼጟጠ፠ፀፇፓጽፔፚጵጣፃፄፁጹፓጠጹፄፁፇፓጽፁጴ\u135bጢፃ\u135d\u135fጹፓጟጠጴፂፇፓጽፅጴፅጤፃጟፁጵፔፚጤፄፀፃፁጽፁጵ\u135bጢፃፄፁ朧朝漳ፔጴጠጴፁፇፗጽፐ\u135cፓጣፃፃ朧朝漳";
		text += "ፁፓጟጤጴፀፇፓጽፁጴፅጣፃጟፁ朧朝漳ጽጴጠጴፄፇ\u135bጽፁጴጵጣፃፄፁጵፔጴጨጴፀፃጹጽፁጴጵጢፃፅፁጵፔፄጨጴፀፚጽፂፁጴጴጟፃፄፁፁፓጟጠጴፀፇፓጽፅጴፄ፧ፃ\u135bፁ朧朝漳ጼፄጠ፠ፀፇፓጽፁጴፅጤፃጟፁጵጼፚጤፄፀፇ\u135fጽፐፚጵጢፃፄፁ朧朝漳ፔፄጠጴፅፇ\u135bጽፁጴ";
		text += "ጵጤፃፄፅፅፓጟጨጴፀፃፁጽፁጶፗጳፃ\u135d\u135fፚፀፚጤፅፃፃጵጾፐፚፄጠፃፇ\u135fፂፁፚጠጴፉ፩ፅጽፁጶፗጳፃፄፁጾፁጟጤፅፆፃጽፂፐፚፅጣፄፚፁፅፓጠጵፄፃፚጹጽፁጵጵጢፃፅፁ朧朝漳ፓጟጠጴፀፇፓጽፁጴጵጤፃፄፁፉፓጠጹፄፀፇ\u135bጽፁጵ\u135bጣፄፇ\u135f朧朝漳ፔፄጠጴፆፇፓ";
		text += "ጽፐፚጵጥፃፄፁፉፔጴጠ፠ፁፃጵጽፁጴጠጢፃ\u135c\u135fጵፔፄጠፄፐጢፓጽፔፚጴ፨ፃፅፁጹፔጵጹጴፀፇ\u135fጽፁጵ\u135bጣፃፆ\u135fጲፁጴጠጴፃፇፓጾፐፚፅጤፃፆ\u135fጵፓጟጠጥፀፃጹጽፅጴ\u135bጤፃ\u135bፁ朧朝漳ፔፚጠጴፆፇፗፂፁጴጴ፧ፃፄፁ\u135dፓጟጠጴፀፃ朧朝漳ጽፁጶፓጣፃጟፁ朧朝漳ጽጴ";
		text += "ጠፄፀፇፓጿፁጴጴጟፃፄፅጵፓጟጠጴፀፃጵጽፁጴ\u135bጢፃ\u135c\u135fጵፓጟጠጵፅፇፓጿፁጴፅጢፃፄፅፅፓጟጨጴፀፇፗጽፐፚ\u135bጣፃፅፁ朧朝漳ፓጟጠጴፉጢፓጿፁጴፅጢፃፄፅፅፔጴጠጴፀፚፉጽፁጶፓጣፃፄፁ朧朝漳ጽጴጠፄፀፇፓጿፁጴፅጢፃፄፁ\u135dፔጴጠጴፀፚፉጽፁጶፓጢፃፇ\u135f";
		text += "朧朝漳ፓጟጠጴፀፇፗጿፁጴጴ፩ፃፄፁ朧朝漳ፓጟጠጥፀፃፁጽፅጶፓጣፃፄፁጲፁፚጠጴፉጢፓጾፁጴጵጢፃፄፁጵፓጟጨጴፀፚጹጽፁጵፅጢፃፄፁ朧朝漳ፔፄጠፅፃፇፓፂፅጴፉጴፃፄፁፙፓጟጠጴፀፇ\u135fጽፁጴ\u135bጢፄ\u135bፁጶፁጴጠፄፁፃጵጽፅጴጴ፧ፃፄፁ朧朝漳ፓጟጠፄፀፚፉጽ";
		text += "ፅጴጵጢፄ\u135bፁ朧朝漳ጼፚጠጴፀፇፓጽፅጴፉጵፃፄፁፅፔጴጠጴፀፚፉጽፁጵ\u135bጢፃፄፁ朧朝漳ፔጴጠጵፅፇፗጽፁጴፉጵፃፄፁፅፓጟጤ፠ፀፇፓጽፁጴፅጣፄፚፁ朧朝漳ጼፄጠፅፄፇፓጾፅጴጵጥፃፄፁ朧朝漳ፓጟጠጴፀፇ\u135bጽፁጵ\u135bጢፃፄፁ朧朝漳ፔፄጠፅፃፇፗፂፁጴጴ፧ፃፄፅ";
		text += "ፅፓጟጤጥፀፇፓጽፁጴ\u135bጢፃፆ\u135fጵፔፄጠፄፅፇፗጽፐፚፄ፧ፃፄፁፅፓጟጠጴፀፇፗጽፁጴፅጣፄፚፁ朧朝漳ጼፄጠጴፅፇፓጽፁጴጵጣፃፄፁጹፔጵጹጴፀፃጵጽፁጶጽጢፃፄፁ朧朝漳ፔፄጠጴፁፇፗፁፔፚፅጤፃጟፁጵፔፚጨፄፀፇ\u135bጽፁጵ\u135bጢፃጟፁ朧朝漳ጼጴጠጴፆፇፗጽፅጶ";
		text += "ፓጣፃ\u135bፁፅፓጠጹጴፀፇፓጽፁጶጽጢፃጟፁ朧朝漳ጽፄጠጴፐጢፗፂፁጴጴ፧ፃፅፁጹጽጴጠፄፅፃፅጽፁጶፓጢፃጠፁጵጽጴጠጴፁፇፗጾፅጴጴ፧ፃፄፁ朧朝漳ፓጟጠ፠ፀፃፅጽፁጶ፣ጢፃጠፁ朧朝漳ጼፚጠጴፀፇፓጽፐፚጴጟፃፅፁ\u135dፔጴጠጴፀፃፁጽፁጵጵጢፃፄፁ朧朝漳ፔጴጠ";
		text += "ጴፉጢፓጿፁጴጴ፦ፃፄፁ朧朝漳ፓጟጠፄፀፃጹጽፁጶፓጢፃፚፁ朧朝漳ፓጟጠጴፁፇፓፂፅጴጴጠፃፄፁፉፔፄጠጴፀፇፗጽፁፅፅጣፃፅፁ\u135dፔጴጤፄፅፇፓጿፁጴጵጣፃፄፁ朧朝漳ፓጟጨጴፀፇፓጽፁጴጵጢፃፄፁ朧朝漳ፓጟጠጴፀፇፗፂፅጴጵጣፃፄፁ朧朝漳ፓጟጠፄፀፇፓጾፅጵ";
		text += "ጵጢፃፆ\u135fጵጼፚጤፄፈ፩ጽጽፐ\u135b\u135bጣፃ\u135d\u135f朧朝漳ጼጵጹፄፆፚፓጾፐጠፄ፦ፃ\u135bፁፙጽጴጤ፠ፃፃጹጾፅጶጽጢፃ\u135d\u135fፁጼፚጨፄፆፚፓጾፐጠፄ፧ፃፚፁፉጽጴጤጥፂፃጹፂፐ\u135cጼ፩ፃ\u135d\u135fጽፓጟጠፄፀፃ朧朝漳ጽፁጶጽጢፃፅፁጵፔፄጠጥፅፇፓጾፅጴጴ፩ፃፄፁጹፔጵጵጥፁፇ\u135b";
		text += "ጽፔ\u135bፅጢፃ\u135bፁ朧朝漳ጼጟጠጴፂፇፓጽፐፚፅጤፃፇ\u135fፅፔፄጠፄፀፃጽጽፅጴጠጢፄ\u135bፁጲፁፚጠጵፅፇፗጽፐፚጟ፧ፃፅፁጹፔፚጤፄፁፇ\u135bጽፔ\u135bፅጣፃፆ\u135fጽጼፄጠፄፂፇ\u135fጾፅጴፉጵፃፄፅፅፔጴጠ፠ፃፃጵጽፅጴ\u135bጥፃ\u135bፁጲፁፚጠፄፂፇ\u135fጾፅጴጹጶፃፄፅፅፔጴጠፄፅፃ";
		text += "ጵጽፅጴፄ፧ፃ\u135bፁ朧朝漳ጽጴጠፅፄፇፓፂፅጴጵጥፃፄፁፙፓጟጠፄፀፚፉጽፁጵፅጢፃ\u135d\u135f朧朝漳ፔፄጠጵፅፇፗፂፁጴጴ፧ፃፄፁፁፓጟጤጥፀፇፗጽፅፅጵጢፃ\u135bፁጲፁፚጠጴፈጢፓጾፐፚፉጵፃፄፁፅፔጵጹጴፀፃጵጽፅጴፚጟፃፄፁ\u135dጼፄጠፄፂፇ\u135bጾፅጴጴጟፃፅፅፁፓጟጤ";
		text += "ፄፀፃፁጽፁጶጽጢፃ\u135bፁ朧朝漳ፔፄጠጴፉጢፗጽፐፚጟ፧ፃፄፅፅፓጠጹፄፀፃጽጽፁጶጽጢፃፚፁጲፁፚጠፄፉጢፓፂፅጴፅጤፃፇ\u135fፅፓጠጵ፠ፀፃጽጽፁጶፓጢፄ\u135bፁ朧朝漳ጽጴጠፄፂፇ\u135fጾፅጴጹጶፃፄፅፅፓጟጨጴፀፃፁጽፁፅፅጣፃፇ\u135f朧朝漳ጼጟጠጴፈጢፗፁፔፚፅጤፃጟ";
		text += "ፁጲፀፚጠፄፁፇ\u135bጿፁጴጹጲፃ\u135bፁ朧朝漳ጽጴጠፅፄፇፗጽፐ\u135cፓጢፄፅፁጵፓጟጨጴፁፚፅጽፅጴፚጟፃፄፅጵጼፄጠጴፐጢፓጾፔፚጵጥፃፄፁጹፔጴጠ፠ፉጢፓፁፅጶ፣ጣፃፆ\u135f\u135dፓጠጵፄፐጢፓፂፅጴጴ፩ፃፄፁፉፔጴጠ፠ፃፃጵጽፅጴ\u135bጥፃ\u135bፁጵፔፄጠጥፅፇፗጽፐፚጟ፧ፃ";
		text += "ፅፁጹፔፚጤፄፁፇ\u135bጽፔ\u135bፅጣፃፚፁ朧朝漳ጼጟጠጴፐጢፗፂፁጴጴ፧ፃፅፁጹፔጴጨፄፁፇ\u135bጽፔ\u135bፅጣፃፆ\u135fጽጼፄጠፄፂፇ\u135fጾፅጴፅጤፃፇ\u135fፅፔጴጠ፠ፃፃጵጽፅጴ\u135bጥፃ\u135bፁጶፁፄጠጵፅፃጹፁፅጴጴ፩ፃፇ\u135fፅፔጵጹጴፀፚፉጽፅፅጵጢፃ\u135bፁጲፁፚጠጴፉጢፗጽፐፚፚ፧";
		text += "ፃፅፁጹፔፚጤፄፁፇ\u135bጿፁጴጹጴፃ\u135bፁጵፔፄጠጥፅፇፗጽፐፚጟ፧ፃፅፅፁፓጟጤፄፁፚፁጽፁጶፓጣፃፆ\u135fጹጼፄጠፅፄፇፓጾፅጴፉጴፃፄፁ\u135dፔጴጠ፠ፂፃጵጽፅጴፚጟፃፄፅጽጽፄጠጵፅፇፗጽፐፚፚ፧ፃፅፁጹፔፄጤፄፁፇ\u135bጿፁጴጹጴፄፚፁጵፔፄጨጴፀፚፁፂፁጴፅጤፃ";
