		text += "፧ፃፄፅፉፓጟጤጥፀፃፁጽፁጴ\u135bጣፄፚፁ朧朝漳ጼፄጠፄፂፇ\u135bጾፅጴፅጤፃፇ\u135fፅፔጴጠ፠ፃፃጵጽፅጴ\u135bጣፃ\u135bፁ朧朝漳ጽጴጠጵፅፇፓጽፔፚጴ፩ፃፄፁጵፓጟጠ፠ፁፇ\u135fጽፁጶጽጢፄፅፁ朧朝漳ፔፄጠፄፂፇ\u135fጾፅጴፅጤፃፇ\u135fፅፔጴጠ፠ፃፃጵጽፁፅፅጣፃፆ\u135fጽጼፄጠፄፂፇ";
		text += "\u135fጾፅጴፅጤፃፅፁፅፓጠጹፄፁፚፅጽፁፅፅጣፃፄፁ朧朝漳ጼጟጠጵፁፇፓፁፅጴጴጟፃፄፁ\u135dፓጠጹፄፀፃፁጽፁፄፅጣፃፆ\u135f\u135dፓጠጵ፠ፅፇፗጽፐፚጟ፧ፃፅፁጹፔፚጤፄፀፇ\u135fጽፅጶ፣ጢፃ\u135d\u135fጲፁፄጠጴፉጢፓጽፐፚጹጶፃፅፁጹጽጴጠጵፂፃጵጽፅጴ\u135bጥፃ\u135bፁጵፔፄጠጥፅ";
