		text += "ጼ፨ፃ\u135c\u135fፅጼ\u135bጵጥፂፇፓጾፐጟጟ፨ፃ\u135bፁፙጼፚጤ፠ፅፃጹፁፔፚጤጵፃፆ\u135fጹጼፚጠፄፈጢ\u135fጾፁጶ።፨ፄ\u135bፁፙጼፚጤ፡ፆፃጹፁፐ\u135bፚ፧ፃ\u135d\u135fጹፔፄጠ፠ፂፇፓጾፔ\u135bፄ፨ፃጠፁፁፔጴጤ፠ፃፃጹጽፔ\u135bፚ፧ፃ\u135d\u135fጽጼጟጠጥፃፚፅጽፐፚፚ፨ፃ\u135c\u135fፉፔጴጤ፡ፃፃጽጽፔ\u135bፚ";
		text += "፧ፃፆ\u135fጹፔፅጹ፠ፃፚፉጽፁፅጵጢፄፅፁጹፓጟጠ፠ፀፇ\u135bጽፁጴ\u135bጢፃፆ\u135f朧朝漳ፔፄጠጴፃፚፁጽፐጠፚ፩ፃፆ\u135fፉጼፄጤጥፁፃጽጾፅጵፚ፧ፃ\u135d\u135fጽጼጟጤጴፆፃጵጾፐ\u135bጴ፧ፃፄፁፙፔፄጤ፠ፐ፩ጽጾፐ\u135bፚጠፃ\u135c፣ጽጼፚጤፄፆፃጽጾፐ\u135bፄ፩ፃፇ\u135fጾፁፚጠጵፄፇፓፁፅጴ";
		text += "\u135bጢፃፆ\u135f朧朝漳ፔፄጠጴፂፇፓጽጼጴጠጤፄ\u135c\u135fፙፔፚጤ፠ፅፃጹጽፔ\u135cጼ፧ፃ\u135d\u135fጹጼፚጨፄፈ፩朧朝漳ጾፔ\u135c፣ጥፄ\u135bፁጲፁፄጠጵፁፇ\u135bጽፁጴ\u135bጢፃፃ朧朝漳ጽፔፅጹ፠ፈ፩朧朝漳ጾፔፚፚ፩ፃ\u135bፁፙፔፚጤጥፄፃ朧朝漳ጿፅጵ\u135fጶፃ\u135c\u135fፉጼ\u135bጹ፠ፃፚፉጽፁፅጵጢፄፅፁጾፁ";
		text += "ጴጠ፡ፆፃጹጽፅጶጽጥፃ\u135d\u135fጽጼፚጤፄፆፚፅጾፐፚፚ፨ፄፇ\u135fፙጽፄጟ፦ፅፇፓፂፁጴጹጲፃ\u135bፁ朧朝漳ጼፄጠጴፄፇፗጾፁጵጴ፦ፃፚፁፁጽፄጤጵፅፃ朧朝漳ጾፔ\u135bፄጟፃ\u135bፁ\u135dጼፄጠጴፄፇፗጾፁጵጴ፦ፃፚፁፁጽፄጤጵፅፃ朧朝漳ጾፔ\u135bፅጢፃፚፁጵጼጴጤጴፄፃ朧朝漳ጾፁጶ";
		text += "።፦ፄ\u135bፁፁጼጟጤፄፉ፩ጵጿፁጵፅጢፃፚፁጵጼጴጤጴፄፃ朧朝漳ጾፁጶ።፦ፄ\u135bፁፁጼጟጤፄፀፃ朧朝漳ጽፅጵጴ፦ፃፚፁፁጼጴጨፄፄፚፉጾፁጶጼ፧ፃጟፁፅጽጴጤፄፀፃ朧朝漳ጽፅጵጴ፦ፃፚፁፁጼጴጨፄፄፚፉጾፁጶጼ፧ፃፄፁፁፔጴጤጴፄፃ朧朝漳ጾፁጵጴጠፃፚፅፅጼጴጤ";
		text += "ጥፅፃፁጾፅጶፒ፧ፃፄፁፁፔጴጤጴፄፃ朧朝漳ጾፁጵጴጠፃፚፅፅጼጴጤጥፅፇፓጾፁጴፄ፦ፃፚፁፁጼጴጤጴፐ፩朧朝漳ፂፅጵጴ፩ፃ\u135bፁ\u135dጼፄጨጴፅፇፓጾፁጴፄ፦ፃፚፁፁጼጴጤጴፐ፩朧朝漳ፂፅጵጴ፩ፃ\u135bፁ朧朝漳ጼጴጠፄፄፃ朧朝漳ጾፁጵጴ፦ፃጠፁፂፁፚጤጴፈ፩ጵጿፁጵ";
		text += "ፄጟፃ\u135bፁ朧朝漳ጼጴጠፄፄፃ朧朝漳ጾፁጵጴ፦ፃጠፁፂፁፚጤጴፈ፩ጵጽፁጵጵጣፃፚፁፁጼጴጤጴፄፃፅጾፁፅፄ፦ፃ\u135d\u135fፅጽጴጤፄፉ፩ጵጽፁጵጵጣፃፚፁፁጼጴጤጴፄፃፅጾፁፅፄ፦ፃ\u135d\u135fፅፓጟጤጴፁፃ朧朝漳ጾፁጵጴ፦ፃፚፁ፡ጼጵጹፄፄፃጽጾፅጶፒ፧ፃጟፁፅፓጟጤጴፁ";
		text += "ፃ朧朝漳ጾፁጵጴ፦ፃፚፁ፡ጼጵጹፄፄፃጽጾፅጴጴ፦ፃፅፁፁጼጴጤጴፄፃ朧朝漳ጿፅጵጹጶፃፚፁፙጼፄጨጴፅፃፁጾፅጴጴ፦ፃፅፁፁጼጴጤጴፄፃ朧朝漳ጿፅጵጹጶፃፚፁፙጼፄጠጴፄፇፗጾፁጵጴ፦ፃፚፁፁጽፄጤጵፅፃ朧朝漳ጾፔ\u135bፄጟፃ\u135bፁ\u135dጼፄጠጴፄፇፗጾፁጵጴ፦ፃፚ";
		text += "ፁፁጽፄጤጵፅፃ朧朝漳ጾፔ\u135bፅጢፃፚፁጵጼጴጤጴፄፃ朧朝漳ጾፁጶ።፦ፄ\u135bፁፁጼጟጤፄፉ፩ጵጿፁጵፅጢፃፚፁጵጼጴጤጴፄፃ朧朝漳ጾፁጶ።፦ፄ\u135bፁፁጼጟጤፄፀፃ朧朝漳ጽፅጵጴ፦ፃፚፁፁጼጴጨፄፄፚፉጾፁጶጼ፧ፃጟፁፅጽጴጤፄፀፃ朧朝漳ጽፅጵጴ፦ፃፚፁፁጼጴጨፄፄ";
		text += "ፚፉጾፁጶጼ፧ፃፄፁፁፔጴጤጴፄፃ朧朝漳ጾፁጵጴጠፃፚፅፅጼጴጤጥፅፃፁጾፅጶፒ፧ፃፄፁፁፔጴጤጴፄፃ朧朝漳ጾፁጵጴጠፃፚፅፅጼጴጤጥፅፇፓጾፁጴፄ፦ፃፚፁፁጼጴጤጴፐ፩朧朝漳ፂፅጵጴ፩ፃ\u135bፁ\u135dጼፄጨጴፅፇፓጾፁጴፄ፦ፃፚፁፁጼጴጤጴፐ፩朧朝漳ፂፅጵጴ፩ፃ\u135b";
		text += "ፁ朧朝漳ጼጴጠፄፄፃ朧朝漳ጾፁጵጴ፦ፃጠፁፂፁፚጤጴፈ፩ጵጿፁጵፄጟፃ\u135bፁ朧朝漳ጼጴጠፄፄፃ朧朝漳ጾፁጵጴ፦ፃጠፁፂፁፚጤጴፈ፩ጵጽፁጵጵጣፃፚፁፁጼጴጤጴፄፃፅጾፁፅፄ፦ፃ\u135d\u135fፅጽጴጤፄፉ፩ጵጽፁጵጵጣፃፚፁፁጼጴጤጴፄፃፅጾፁፅፄ፦ፃ\u135d\u135fፅፓጟጤጴፁፃ朧";
		text += "朝漳ጾፁጵጴ፦ፃፚፁ፡ጼጵጹፄፄፃጽጾፅጶፒ፧ፃጟፁፅፓጟጤጴፁፃ朧朝漳ጾፁጵጴ፦ፃፚፁ፡ጼጵጹፄፄፃጽጾፅጴጴ፦ፃፅፁፁጼጴጤጴፄፃ朧朝漳ጿፅጵጹጶፃፚፁፙጼፄጨጴፅፃፁጾፅጴጴ፦ፃፅፁፁጼጴጤጴፄፃ朧朝漳ጿፅጵጹጶፃፚፁፙጼፄጠጴፄፇፗጾፁጵጴ፦ፃፚፁፁ";
		text += "ጽፄጤጵፅፃ朧朝漳ጾፔ\u135bፄጟፃ\u135bፁ\u135dጼፄጠጴፄፇፗጾፁጵጴ፦ፃፚፁፁጽፄጤጵፅፃ朧朝漳ጾፔ\u135bፅጢፃፚፁጵጼጴጤጴፄፃ朧朝漳ጾፁጶ።፦ፄ\u135bፁፁጼጟጤፄፉ፩ጵጿፁጵፅጢፃፚፁጵጼጴጤጴፄፃ朧朝漳ጾፁጶ።፦ፄ\u135bፁፁጼጟጤፄፀፃ朧朝漳ጽፅጵጴ፦ፃፚፁፁጼጴጨፄፄፚፉ";
		text += "ጾፁጶጼ፧ፃጟፁፅጽጴጤፄፀፃ朧朝漳ጽፅጵጴ፦ፃፚፁፁጼጴጨፄፄፚፉጾፁጶጼ፧ፃፄፁፁፔጴጤጴፄፃ朧朝漳ጾፁጵጴጠፃፚፅፅጼጴጤጥፅፃፁጾፅጶፒ፧ፃፄፁፁፔጴጤጴፄፃ朧朝漳ጾፁጵጴጠፃፚፅፅጼጴጤጥፅፇፓጾፁጴፄ፦ፃፚፁፁጼጴጤጴፐ፩朧朝漳ፂፅጵጴ፩ፃ\u135bፁ\u135d";
		text += "ጼፄጨጴፅፇፓጾፁጴፄ፦ፃፚፁፁጼጴጤጴፐ፩朧朝漳ፂፅጵጴ፩ፃ\u135bፁ朧朝漳ጼጴጠፄፄፃ朧朝漳ጾፁጵጴ፦ፃጠፁፂፁፚጤጴፈ፩ጵጿፁጵፄጟፃ\u135bፁ朧朝漳ጼጴጠፄፄፃ朧朝漳ጾፁጵጴ፦ፃጠፁፂፁፚጤጴፈ፩ጵጽፁጵጵጣፃፚፁፁጼጴጤጴፄፃፅጾፁፅፄ፦ፃ\u135d\u135fፅጽጴጤፄፉ፩ጵ";
		text += "ጽፁጵጵጣፃፚፁፁጼጴጤጴፄፃፅጾፁፅፄ፦ፃ\u135d\u135fፅፓጟጤጴፁፃ朧朝漳ጾፁጵጴ፦ፃፚፁ፡ጼጵጹፄፄፃጽጾፅጶፒ፧ፃጟፁፅፓጟጤጴፁፃ朧朝漳ጾፁጵጴ፦ፃፚፁ፡ጼጵጹፄፄፃጽጾፅጴጴ፦ፃፅፁፁጼጴጤጴፄፃ朧朝漳ጿፅጵጹጶፃፚፁፙጼፄጨጴፅፃፁጾፅጴጴ፦ፃፅፁፁጼጴ";
		text += "ጤጴፄፃ朧朝漳ጿፅጵጹጶፃፚፁፙጼፄጠጴፄፇፗጾፁጵጴ፦ፃፚፁፁጽፄጤጵፅፃ朧朝漳ጾፔ\u135bፄጟፃ\u135bፁ\u135dጼፄጠጴፄፇፗጾፁጵጴ፦ፃፚፁፁጽፄጤጵፅፃ朧朝漳ጾፔፚጵጢፃ\u135d\u135f朧朝漳ፓጟጠጴፀፇፓጽፁፄጠጢፃፄፁ朧朝漳ፓጟጠጴፀፃፅጽፁጴጟ፦ፃፄፁ朧朝漳ፓጟጠጴፀፇፓ";
